INSERT INTO `rinkinys` (`RINKINYS_ID`, `ORGANIZACIJA_ID`, `RINKINYS_PAVADINIMAS`, `RINKINYS_IKEL_DATA`, `RINKINYS_ATNAUJ_DATA`, `RINKINYS_APRASAS`, `RINKINYS_NUORODA`) VALUES
(1, 1, 'GDR250LT – Lietuvos Respublikos teritorijos M 1:250 000 georeferencinių erdvinių duomenų rinkinys', '2024-03-14', '2024-03-27', 'Lietuvos Respublikos teritorijos M 1:250 000 georeferencinių erdvinių duomenų rinkinys (sutrumpintas pavadinimas – GDR250LT) yra valstybinis erdvinių duomenų rinkinys, kuriame kaupiami Žemės paviršiaus gamtinių ir antropogeninių objektų, esančių Lietuvos Respublikos teritorijoje duomenys. Šį erdvinį duomenų rinkinį sudaro erdviniai objektai susiję su vandens telkiniais, žemės danga, transporto tinklu, inžinerinėmis komunikacijomis, geodeziniais punktais, reljefu, vietovardžiais, administracinių vienetų ir saugomų teritorijų ribomis, ir pan.e', 'https://data.gov.lt/datasets/548/'),
(2, 1, 'Lietuvos Respublikos teritorijos M 1:50 000 georeferencinių erdvinių duomenų rinkinys GDR50LT', '2024-03-14', '2024-03-27', 'Lietuvos Respublikos teritorijos M 1:50 000 georeferencinių erdvinių duomenų rinkinys (sutrumpintas pavadinimas – GDR50LT) yra valstybinis erdvinių duomenų rinkinys, kuriame kaupiami Žemės paviršiaus gamtinių ir antropogeninių objektų, esančių Lietuvos Respublikos teritorijoje duomenys. Šį erdvinį duomenų rinkinį sudaro erdviniai objektai, susiję su vandens telkiniais, žemės danga, transporto tinklu, inžinerinėmis komunikacijomis, geodeziniais punktais, reljefu, vietovardžiais, administracinių vienetų ir saugomų teritorijų ribomis, ir pan.', 'https://data.gov.lt/datasets/2561/'),
(3, 1, 'Lietuvos Respublikos teritorijos geografinių vietovardžių erdvinių duomenų rinkinys GV_DRLT', '2024-03-13', '2024-03-14', 'LR teritorijos geografinių vietovardžių erdvinių duomenų rinkinyje (GV_DRLT) kaupiama informacija apie geografinių objektų vietą žemėlapyje ir tų objektų pavadinimą (pavadinimo rašybą, gramatinę informaciją, vietovardžio kilmės aiškinimą). GV_DRLT duomenų rinkinys sukurtas naudojant duomenis, gautus iš šių duomenų teikėjų: Lietuvių kalbos instituto, Valstybinės saugomų teritorijų tarnybos, Kultūros paveldo departamento, Lietuvos automobilių kelių direkcijos, Nacionalinės žemės tarnybos, Etninės kultūros globos tarybos, Lietuvos geologijos tarnybos, Lietuvos TSR aukščiausiosios tarybos prezidiumo (GV_DRLT papildymui 1940-1990 m. panaikintų gyvenviečių vietomis ir pavadinimais), geoportal.lt naudotojų, Instytut badan spraw narodowosciowych (Lenkija).', 'https://data.gov.lt/datasets/2560/'),
(4, 2, 'ANK 45 str. pažeidimai ir pažeidėjai', '2024-03-12', '2024-04-09', 'Administracinių nusižengimų registro (ANR) bylos, kuriose minimas Administracinių nusižengimų kodekso (ANK) 45 straipsnis (\"Visuomenės sveikatos srities Europos Sąjungos reglamentų ar sprendimų, higienos norminių aktų ar kitų visuomenės sveikatos srities teisės aktų, Lietuvos Respublikos žmonių užkrečiamųjų ligų profilaktikos ir kontrolės įstatymo pažeidimas\"). \r\n\r\nPateikiama neagreguota lentelė (mikroduomenys). Viena eilutė yra vieno administracinio nusižengimo vieno straipsnio vienos dalies vienas pažeidėjas. Detalizuojama demografinė informacija apie pažeidėją bei pažeidimo vietos aplinkybes.\r\n\r\nDėl techninių klausimų ar galimų klaidų kreiptis į atverimas@stat.gov.lt.\r\n\r\nANK 45 straipsnio dalys:\r\n1. pažeidimas;\r\n2. pažeidimas, padarytas pakartotinai;\r\n3. pažeidimas, kuomet veikos sukėlė pavojų išplisti pavojingoms ar ypač pavojingoms užkrečiamosioms ligoms;\r\n4. pažeidimas, kuomet veikos, sukėlusios pavojų išplisti pavojingoms ar ypač pavojingoms užkrečiamosioms ligoms, padarytos karo, nepaprastosios padėties, mobilizacijos, karantino, riboto karantino metu, taip pat susidarius ekstremaliajai situacijai ar ekstremaliajam įvykiui, jeigu ekstremalioji situacija ar ekstremalusis įvykis kelia pavojų žmonių gyvybei ar sveikatai.', 'https://data.gov.lt/datasets/2558/'),
(5, 3, 'Savivaldybės turto, išskyrus nekilnojamąjį turtą, panaudos sutartys', '2024-03-06', '2024-03-06', 'Savivaldybės turto, išskyrus nekilnojamąjį turtą, panaudos sutartys 2024 metų pradžioje', 'https://data.gov.lt/datasets/2554/'),
(6, 3, 'Valstybinių brandos  egzaminų rezultatai', '2024-03-06', '2024-03-06', '3 paskutinių metų valstybinių brandos egzaminų rezultatai', 'https://data.gov.lt/datasets/2552/'),
(7, 4, 'Pajamų pasiskirstymo koeficientas S80/S20', '2024-03-06', '2024-03-06', 'Metinė visų Lietuvos privačių namų ūkių ir nuolatinių Lietuvos gyventojų statistinė informacija apie asmenų, kurių ekvivalentinės piniginės disponuojamosios pajamos yra penktojoje kvintilinėje grupėje, ir asmenų,  kurių ekvivalentinės piniginės disponuojamosios pajamos yra pirmojoje kvintilinėje grupėje, santykį pagal regionus nuo 2009 m. bei pagal amžių ir lytį nuo 2021 m. Naudojami LR Administracinių vienetų ir gyvenamųjų vietovių klasifikatorius (LR AVGVK 2018) ir Bendras teritorinių statistinių vienetų klasifikatorius (NUTS).', 'https://data.gov.lt/datasets/2555/'),
(8, 5, 'e. Recepto posistemės duomenys apie vaistinių išduotus receptinius vaistus', '2024-03-05', '2024-03-08', 'e.Sveikatos (ESPBIIS) e.Recepto posistemės duomenys apie vaistinių išduotus, pagal gydytojo receptą paskirtus, vaistus.  \r\nTerminas „VAISTAS“ šiame duomenų rinkinyje naudojamas kaip bendrinis pavadinimas visiems su receptu skiriamiems medicininiams produktams (vaistinis preparatas, medicinos pagalbos priemonė (MPP), vardinis vaistas, ekstemporalus vaistas, kitos priemonės).\r\n\r\nDuomenų nuasmeninimo kriterijai:\r\n1. Jeigu per ketvirtį vienam TLK-10-AM kodui išrašytų receptų skaičius yra mažesnis nei 10, duomenų rinkinyje pateikiamas tik dirbtinis išrašyto recepto identifikatorius, recepto išrašymo metai bei ketvirtis ir diagnozės (TLK-10-AM klasifikatoriaus), pagal kurią išrašytas receptas, kodas bei pavadinimas.\r\n2. Jeigu per ketvirtį vienam TLK-10-AM kodui vienoje savivaldybėje, kurioje yra receptą išrašiusi gydymo įstaiga, išrašytų receptų skaičius yra mažesnis nei 5, įstaigos, kurioje buvo išrašytas receptas, savivaldybė nenurodoma.\r\n3. Jeigu per ketvirtį vienam TLK-10-AM kodui vienoje savivaldybėje, kurioje pacientas yra deklaravęs gyvenamąją vietą, išrašytų receptų skaičius yra mažesnis nei 5, paciento deklaruotos gyvenamosios vietos savivaldybė nenurodoma.\r\n4. Jeigu per ketvirtį vienoje savivaldybėje, kurioje yra receptą išrašiusi gydymo įstaiga, receptus išrašiusių gydytojų, turinčių tą pačią kvalifikaciją, skaičius yra mažesnis nei 3, gydytojo kvalifikacija nenurodoma.', 'https://data.gov.lt/datasets/2557/'),
(9, 4, 'Labai mažo darbo intensyvumo namų ūkiuose gyvenantys asmenys', '2024-03-02', '2024-03-02', 'Statistinė metinė labai mažo darbo intensyvumo Lietuvos privačių namų ūkių informacija, kuriuose visų darbingo (18–64 metų) amžiaus asmenų (neįskaitant 18–24 metų amžiaus moksleivių ir studentų, pensininkams save priskyrusių arba bet kokią pensiją (išskyrus našlių pensiją) gaunančių darbingo amžiaus asmenų bei 60–64 metų amžiaus ekonomiškai neaktyvių asmenų, gyvenančių namų ūkyje, kurio pagrindinis pajamų šaltinis yra pensijos) dirbto laiko suma neviršija 20 proc. galimo dirbti viso darbo laiko.\r\nStatistinės informacijos skelbimo periodiškumas – metinis, nuo 2021 metų. Naudojamas teritorinių statistinių vienetų klasifikatorius (NUTS).', 'https://data.gov.lt/datasets/2546/'),
(10, 4, 'Išlaikomo amžiaus pagyvenusių žmonių koeficientas metų pradžioje', '2024-03-02', '2024-03-02', 'Išlaikomo amžiaus pagyvenusių (65 metų ir vyresnio amžiaus) nuolatinių Lietuvos Respublikos gyventojų skaičiaus, tenkančio šimtui 15–64 metų amžiaus gyventojų, pasiskirstymas Lietuvos Respublikos teritorijos administraciniuose vienetuose.\r\nStatistinės informacijos skelbimo periodiškumas – metinis, nuo 1996 metų. Naudojamas teritorinių statistinių vienetų klasifikatorius (NUTS).', 'https://data.gov.lt/datasets/2545/'),
(11, 3, 'Neformaliojo švietimo programos', '2024-02-29', '2024-02-29', '2024 m. patvirtintos savivaldybės finansuojamos Neformaliojo švietimo programos', 'https://data.gov.lt/datasets/2553/'),
(12, 6, 'Visagino miesto „WiFi4EU“ nemokamos belaidžio interneto ryšio zonos.', '2024-02-27', '2024-03-01', '„WiFi4EU“ įrengtos nemokamos belaidžio interneto ryšio zonos Visagino mieste.', 'https://data.gov.lt/datasets/2551/'),
(13, 7, 'Dokumentų valdymo sistemos gaunami dokumentai', '2024-02-27', '2024-02-27', 'Dokumentų valdymo sistemos gaunami dokumentai', 'https://data.gov.lt/datasets/2390/'),
(14, 4, '18 metų ir vyresnių asmenų skurdo rizikos lygis', '2024-02-14', '2024-03-02', 'Rinkinyje pateikiami duomenys apie 18 metų ir vyresnių asmenų skurdo rizikos lygį pagal aktyvumo statusų grupes ir išsilavinimą. Skurdo rodiklių skaičiavimo tikslas – parengti nacionalinius absoliutaus skurdo rodiklius bei palyginamus su kitomis Europos Sąjungos šalimis skurdo rizikos ir socialinės atskirties rodiklius, stebėti jų pokyčius, nustatyti dažniausiai į absoliutų skurdą, skurdo riziką ir socialinę atskirtį patenkančias gyventojų grupes. Skurdo rodikliams rengti naudojami pajamų ir gyvenimo sąlygų statistinio tyrimo duomenys. Naudojamų klasifikatorių nėra. Statistinio stebėjimo vienetas: Privatus namų ūkis ir 16 metų ir vyresnis asmuo – privataus namų ūkio narys. Statistinė tiriamoji visuma:  visi Lietuvos privatūs namų ūkiai ir nuolatiniai Lietuvos gyventojai. Asmenys, gyvenantys instituciniuose namų ūkiuose (globos namuose, šeimynose, įkalinimo įstaigose, vienuolynuose), nėra tiriami. Geografinė aprėptis: Statistinė informacija rengiama šalies ir regionų lygmeniu, rodiklis „Asmenų, gyvenančių skurdo rizikoje ar socialinėje atskirtyje, dalis“ – ir apskričių lygmeniu. Laiko aprėptis: Absoliutaus skurdo rodikliai – nuo 2016 m., asmenų, gyvenančių skurdo rizikoje ar socialinėje atskirtyje, dalis taikant dabartinę apibrėžtį, didelio materialinio ir socialinio nepritekliaus lygis, išsilavinimo lygis – nuo 2021 m., kiti rodikliai – nuo 2005 m. Periodiškumas – metinis.', 'https://data.gov.lt/datasets/2550/'),
(15, 4, 'Skurdo rizikos lygis', '2024-02-14', '2024-03-02', 'Metinė visų Lietuvos privačių namų ūkių ir nuolatinių Lietuvos gyventojų statistinė informacija apie asmenų, kurių ekvivalentinės piniginės disponuojamosios pajamos mažesnės už skurdo rizikos ribą, dalį, jų pasiskirstymą pagal amžių ir pilietybę, pajamų kvintilines grupes, amžių ir gimimo šalį nuo 2021 m.  Pagrindiniu skurdo kriterijumi laikoma skurdo rizikos riba, lygi 60 proc. ekvivalentinių piniginių disponuojamųjų pajamų medianos. Naudojami LR Administracinių vienetų ir gyvenamųjų vietovių klasifikatorius (LR AVGVK 2018) ir Bendras teritorinių statistinių vienetų klasifikatorius (NUTS).', 'https://data.gov.lt/datasets/2549/'),
(16, 4, 'Asmenys, gyvenantys skurdo rizikoje ar socialinėje atskirtyje', '2024-02-14', '2024-03-02', 'Metinis nuolatinių Lietuvos gyventojų, gyvenančių skurdo rizikoje ar socialinėje atskirtyje dalis per amžiaus ir lyties, pajamų kvintilines grupių, amžiaus ir pilietybės, amžiaus ir gimimo šalies, išsilavinimo, aktyvumo statuso dimensijas nuo 2021 metų.', 'https://data.gov.lt/datasets/2548/'),
(17, 4, 'Materialinis ir socialinis nepriteklius', '2024-02-14', '2024-03-02', 'Šiame rinkinyje pateikta statistinė informacija apie namų ūkių gyvenimo sąlygas. Rengiama statistinė informacija apie namų ūkio būsto sąlygas, būsto išlaikymo išlaidas ir jų naštą, namų ūkio fizinę ir socialinę aplinką, turimus įsiskolinimus, ekonominius sunkumus, su kuriais susiduria namų ūkis ar asmuo, ir galimybę tenkinti kai kuriuos poreikius. Statistinio stebėjimo vienetas: privatus namų ūkis ir 16 metų ar vyresnis asmuo – privataus namų ūkio narys. Laiko aprėptis - nuo 2021 m., metinis.', 'https://data.gov.lt/datasets/2547/'),
(18, 8, 'Valstybinės teritorijų planavimo ir statybos inspekcijos rizikos valdymo informacinės sistemos duomenys', '2024-02-12', '2024-02-12', '', 'https://data.gov.lt/datasets/2544/'),
(19, 9, 'Faktinė nacionalinė kitų energijos šaltinių gamyba (MW)', '2024-02-05', '2024-02-05', 'Faktinė nacionalinė kitų energijos šaltinių gamyba (įskaitant gamybą skirstomajame tinkle). Skelbiami valandiniai akumuliuoti duomenys. Atverta pagal Komisijos reglamentą (ES) Nr. 543/2013, 2013 m. birželio 14 d., dėl duomenų teikimo ir skelbimo elektros energijos rinkose, iš dalies keičiantis Europos Parlamento ir Tarybos reglamento (EB) Nr. 714/2009 I priedą.\r\nDaugiau informacijos: litgrid.eu', 'https://data.gov.lt/datasets/2539/'),
(20, 9, 'Faktinė prie PT prijungtų šiluminių elektrinių gamyba (MW)', '2024-02-05', '2024-02-05', 'Faktinė prie perdavimo tinklo prijungtų šiluminių elektrinių gamyba. Skelbiami valandiniai akumuliuoti duomenys. Atverta pagal Komisijos reglamentą (ES) Nr. 543/2013, 2013 m. birželio 14 d., dėl duomenų teikimo ir skelbimo elektros energijos rinkose, iš dalies keičiantis Europos Parlamento ir Tarybos reglamento (EB) Nr. 714/2009 I priedą.\r\nDaugiau informacijos: litgrid.eu', 'https://data.gov.lt/datasets/2540/'),
(21, 9, 'Prognozuojamas nacionalinis elektros energijos suvartojimas (MW)', '2024-02-05', '2024-02-05', 'Litgrid prognozuojamas nacionalinis sistemos elektros energijos suvartojimas. Atverta pagal Komisijos reglamentą (ES) Nr. 543/2013, 2013 m. birželio 14 d., dėl duomenų teikimo ir skelbimo elektros energijos rinkose, iš dalies keičiantis Europos Parlamento ir Tarybos reglamento (EB) Nr. 714/2009 I priedą.\r\nDaugiau informacijos: litgrid.eu', 'https://data.gov.lt/datasets/2541/'),
(22, 9, 'Planuojamas nacionalinis elektros energijos suvartojimas (MW)', '2024-02-05', '2024-04-12', 'Balansavimo elektros energijos tiekėjų suplanuotas nacionalinis elektros energijos suvartojimas. Atverta pagal Komisijos reglamentą (ES) Nr. 543/2013, 2013 m. birželio 14 d., dėl duomenų teikimo ir skelbimo elektros energijos rinkose, iš dalies keičiantis Europos Parlamento ir Tarybos reglamento (EB) Nr. 714/2009 I priedą.\r\nDaugiau informacijos: litgrid.eu', 'https://data.gov.lt/datasets/2542/'),
(23, 9, 'Faktinis nacionalinis Elektros energijos vartojimas (MW)', '2024-02-05', '2024-02-05', 'Rodiklis išskaičiuojamas pagal šią logiką:\r\nNacionalinė gamyba + importas - eksportas - KHAE poreikis. Atverta pagal Komisijos reglamentą (ES) Nr. 543/2013, 2013 m. birželio 14 d., dėl duomenų teikimo ir skelbimo elektros energijos rinkose, iš dalies keičiantis Europos Parlamento ir Tarybos reglamento (EB) Nr. 714/2009 I priedą.\r\nDaugiau informacijos: litgrid.eu', 'https://data.gov.lt/datasets/2543/'),
(24, 9, 'Faktinė nacionalinė kaupimo įrenginių gamyba', '2024-02-05', '2024-02-05', 'Faktinė nacionalinė kaupimo įrenginių gamyba. Skelbiami valandiniai akumuliuoti duomenys. Skelbiami valandiniai akumuliuoti duomenys. Atverta pagal Komisijos reglamentą (ES) Nr. 543/2013, 2013 m. birželio 14 d., dėl duomenų teikimo ir skelbimo elektros energijos rinkose, iš dalies keičiantis Europos Parlamento ir Tarybos reglamento (EB) Nr. 714/2009 I priedą.\r\nDaugiau informacijos: litgrid.eu', 'https://data.gov.lt/datasets/2538/'),
(25, 6, 'Visagino savivaldybės tarnybiniai lengvieji automobiliai', '2024-02-01', '2024-02-01', '', 'https://data.gov.lt/datasets/2537/'),
(26, 10, 'Duomenys apie Lietuvos muziejus ir jų padalinius', '2024-01-31', '2024-01-31', 'Duomenys apie Lietuvos Respublikos juridinius asmenis, kurių bent viena iš ekonominių veiklos rūšių yra muziejinių vertybių kaupimas, saugojimas ar tvarkymas. Tai apima:\r\n- Lietuvos muziejus;\r\n- įstaigas, kurios savo struktūros apimtyje turi padalinį, kuriam numatyta muziejinė funkcija;\r\n- įstaigas, kaupiančias, saugančias ir tvarkančias vertybių kolekcijas LIMIS (t. y. yra sudariusias LIMIS naudojimo sutartis).', 'https://data.gov.lt/datasets/2119/'),
(27, 11, 'Parama smulkiajam ir vidutiniam verslui', '2024-01-31', '2024-01-31', '', 'https://data.gov.lt/datasets/2536/'),
(28, 11, 'Viešieji pirkimai', '2024-01-31', '2024-01-31', '', 'https://data.gov.lt/datasets/2535/'),
(29, 12, 'Gydytojų skaičius pagal pareigybes (2023 m. duomenys)', '2024-01-15', '2024-01-15', 'Dokumente pateikiama informacija apie VšĮ Alytaus apskrities S. Kudirkos ligoninėje dirbančius gydytojus pagal pareigybes (2023 m. duomenys).', 'https://data.gov.lt/datasets/2534/'),
(30, 4, 'Valdžios sektoriaus skola (Mastrichto skola)', '2024-01-08', '2024-01-08', 'Valdžios sektoriaus skola yra vienas iš Mastrichto sutarties konvergencijos kriterijų, skirtų ekonominės padėties valstybėse narėse stebėsenai. Valdžios sektoriaus skola apibrėžiama kaip šalies valdžios sektoriaus (S.13) bendra negrąžinta skola nominaliąja verte ataskaitinio laikotarpio pabaigoje, išskyrus tuos įsipareigojimus, kuriuos atitinkantis finansinis turtas priklauso šalies valdžios sektoriui (S.13). Valdžios sektoriaus skolą sudaro šių kategorijų įsipareigojimai: valiuta ir indėliai (AF.2); skolos vertybiniai popieriai (AF.3) ir paskolos (AF.4), kaip nustatyta ESS 2010. Ketvirtinė valdžios sektoriaus skola pateikiama pagal subsektorius: centrinės valdžios (S.1311), vietos valdžios (S.1313) ir socialinės apsaugos fondai (S.1314). \r\nNaudojami klasifikatoriai: Europos sąskaitų sistema (ESS 2010). Statistinio stebėjimo vienetas: instituciniai vienetai, priskiriami valdžios sektoriui pagal ESS 2010. \r\nStatistinė tiriamoji visuma: valdžios sektorius (S.13). Geografinė aprėptis: visa šalies ekonominė teritorija. \r\nLaiko aprėptis: nuo 2000 m. I ketv.v. \r\nStatistinės informacijos skelbimo periodiškumas: ketvirtinis.', 'https://data.gov.lt/datasets/2495/'),
(31, 4, 'Medianinis gyventojų amžius metų pradžioje', '2024-01-08', '2024-01-08', 'Pateikta statistinė informacija apie medianinį gyventojų amžių metų pradžioje. Medianinis gyventojų amžius – tokia gyventojų amžiaus reikšmė, kuri atitinka variacinės eilutės vidurinę reikšmę, t. y. dalija gyventojus į dvi vienodas dalis taip, kad pusė jų yra jaunesni nei medianinio amžiaus, kita pusė – vyresni. Pasaulio šalių ir teritorijų klasifikatorius. Statistinio stebėjimo vienetas - Asmuo. Statistinė (tiriamoji) visuma yra prognozuojamas gyventojų, gyvų gimusiųjų, mirusiųjų arba tarptautinių migrantų skaičius. Geografinė aprėptis: Visa šalies teritorija, Europos Sąjungos valstybės narės ir ELPA šalys (Islandija, Norvegija, Šveicarija). \r\nLaiko aprėptis: nuo 1970 m. \r\nStatistinės informacijos skelbimo periodiškumas: metiniai', 'https://data.gov.lt/datasets/2494/'),
(32, 4, 'Bendrasis gimstamumo rodiklis', '2024-01-08', '2024-01-08', 'Pateikiama statistinė informacija apie bendrąjį gimstamumo rodiklį. Bendrasis gimstamumo rodiklis – per metus gyvų gimusių kūdikių ir vidutinio metinio gyventojų skaičiaus santykis, skaičiuojamas 1 tūkst. gyventojų. \r\nStatistinio stebėjimo vienetas: gyvas gimęs kūdikis. \r\nStatistinė tiriamoji visuma: statistinis tyrimas apima: a) Lietuvos Respublikoje gyvus gimusius kūdikius, kurių motinos yra nuolatinės Lietuvos Respublikos gyventojos arba nėra nustatytos, b) užsienio valstybėse gyvus gimusius kūdikius, kurių motinos yra nuolatinės Lietuvos Respublikos gyventojos. \r\nGeografinė aprėptis: statistinė informacija rengiama šalies, regionų, apskričių ir savivaldybių lygmeniu, pagal gyvenamąją vietovę (miestą, kaimą).\r\nLaiko aprėptis: nuo 1994 m. \r\nStatistinės informacijos skelbimo periodiškumas: metinis.', 'https://data.gov.lt/datasets/2493/'),
(33, 4, 'Suminis gimstamumo rodiklis', '2024-01-08', '2024-01-08', 'Pateikta statistinė informacija apie suminį gimstamumo rodiklį. Suminis gimstamumo rodiklis – tikimybinis rodiklis, parodantis, kiek gyvų vaikų per visą savo gyvenimo vaisingą laikotarpį (15–49 metų) pagimdytų moteris, jeigu gimstamumas kiekvienoje amžiaus grupėje išliktų nepakitęs. \r\nStatistinė (tiriamoji) visuma yra prognozuojamas gyventojų, gyvų gimusiųjų, mirusiųjų arba tarptautinių migrantų skaičius. Statistinio stebėjimo vienetas: asmuo. \r\nStatistinė tiriamoji visuma: statistinė (tiriamoji) visuma yra prognozuojamas gyventojų, gyvų gimusiųjų, mirusiųjų arba tarptautinių migrantų skaičius. \r\nGeografinė aprėptis: visa šalies teritorija, Europos Sąjungos valstybės narės ir ELPA šalys (Islandija, Norvegija, Šveicarija). Laiko aprėptis: nuo 2001m. \r\nStatistinės informacijos skelbimo periodiškumas: kasmet.', 'https://data.gov.lt/datasets/2492/'),
(34, 4, 'Valdžios sektoriaus pajamos ir išlaidos', '2024-01-08', '2024-01-08', '\"Pateikta statistinė informacija apie valdžios sektoriaus pajamas ir išlaidas. Valdžios sektoriaus pajamos vertinamos pagal sandorius: mokesčiai D.2+D.5+D.91, socialinės įmokos D.61, prekių ir paslaugų pardavimas P.1+P.12+P.131, kitos einamosios pajamos D.4+D.7, kitos kapitalo pajamos D.92+D.99. Valdžios sektoriaus išlaidos vertinamos pagal sandorius: tarpinis vartojimas P.2, atlygis darbuotojams D.1, palūkanos D.41, socialinės išmokos, išskyrus socialinius pervedimus natūra D.62, socialiniai pervedimai natūra per rinkos gamintojus D.632, subsidijos D.3, kitos einamosios išlaidos D.29 + (D.4 – D.41) + D.5 + D.7, kapitalo išlaidos P.5 + NP + D.92 + D.99. Naudojami klasifikatoriai: Europos sąskaitų sistema (ESA 2010). Statistinio stebėjimo vienetas -	instituciniai vienetai, priskiriami valdžios sektoriui pagal ESA 2010. \r\nStatistinė tiriamoji visuma: valstybės ir savivaldybių biudžetinės įstaigos, socialinės apsaugos fondai, valdžios sektoriaus kontroliuojamos įmonės, priskirtos valdžios sektoriui. \r\nGeografinė aprėptis: visa šalies teritorija. Laiko aprėptis: 1999 m. \r\nStatistinės informacijos skelbimo periodiškumas: ketvirtis', 'https://data.gov.lt/datasets/2491/'),
(35, 9, 'Faktinė nacionalinė hidroelektrinių gamyba (MW)', '2023-12-29', '2024-02-05', 'Faktinė nacionalinė hidroelektrinių gamyba (įskaitant hidroakumuliacines ir gamybą skirstomajame tinkle). Skelbiami valandiniai akumuliuoti duomenys. Atverta pagal Komisijos reglamentą (ES) Nr. 543/2013, 2013 m. birželio 14 d., dėl duomenų teikimo ir skelbimo elektros energijos rinkose, iš dalies keičiantis Europos Parlamento ir Tarybos reglamento (EB) Nr. 714/2009 I priedą.\r\nDaugiau informacijos: litgrid.eu', 'https://data.gov.lt/datasets/2533/'),
(36, 9, 'Faktinė nacionalinė saulės elektrinių gamyba (MW)', '2023-12-29', '2024-02-05', 'Faktinė nacionalinė saulės elektrinių gamyba (įskaitant gamybą skirstomajame tinkle). Skelbiami valandiniai akumuliuoti duomenys (skelbiama praėjusi valanda, atnaujinama dienos eigoje kas valandą), susidedantys iš kas 2 minutes skelbiamų duomenų.\r\nAtverta pagal Komisijos reglamentą (ES) Nr. 543/2013, 2013 m. birželio 14 d., dėl duomenų teikimo ir skelbimo elektros energijos rinkose, iš dalies keičiantis Europos Parlamento ir Tarybos reglamento (EB) Nr. 714/2009 I priedą.\r\nDaugiau informacijos: litgrid.eu', 'https://data.gov.lt/datasets/2532/'),
(37, 9, 'Faktinė nacionalinė vėjo elektrinių gamyba (MW)', '2023-12-29', '2024-02-05', 'Faktinė nacionalinė vėjo elektrinių gamyba (įskaitant gamybą skirstomajame tinkle). Atverta pagal Komisijos reglamentą (ES) Nr. 543/2013, 2013 m. birželio 14 d., dėl duomenų teikimo ir skelbimo elektros energijos rinkose, iš dalies keičiantis Europos Parlamento ir Tarybos reglamento (EB) Nr. 714/2009 I priedą.\r\nDaugiau informacijos: litgrid.eu', 'https://data.gov.lt/datasets/2529/'),
(38, 9, 'Faktinė nacionalinė elektros energijos gamyba (MW)', '2023-12-29', '2024-03-25', 'Faktinė nacionalinė elektros energijos gamyba. Gali būti nurodoma informacija dvi minutinių laikotarpiu. \r\nKomisijos reglamentas (ES) Nr. 543/2013, 2013 m. birželio 14 d., dėl duomenų teikimo ir skelbimo elektros energijos rinkose, iš dalies keičiantis Europos Parlamento ir Tarybos reglamento (EB) Nr. 714/2009 I priedą.\r\nDaugiau informacijos: litgrid.eu', 'https://data.gov.lt/datasets/2530/'),
(39, 9, 'Nacionalinė elektros energijos gamyba', '2023-12-29', '2023-12-29', 'Atverta prieiga prie elektros nacionalinės elektros energijos gamybos duomenų. Duomenis sudaro: planuojama ir faktinė nacionalinė energijos gamyba; faktinė nacionalinė vėjo elektrinių, saulės elektrinių, hidroelektrinių, šiluminių elektrinių ir kitų energijos šaltinių gamyba; faktinė nacionalinė kaupimo įrenginių gamyba. Daugiau informacijos apie duomenis adresu: litgrid.eu', 'https://data.gov.lt/datasets/2528/'),
(40, 4, 'Viešbučių ir motelių numerių ir vietų užimtumas', '2023-12-29', '2024-01-10', 'Pateikta statistinė informacija apie mėnesinį, ketvirtinį, metinį apgyvendinimo paslaugų tiekėjų užimtų vietų arba numerių skaičių pagal administracinę teritoriją ir apgyvendinimo tipus. Naudojami klasifikatoriai: Lietuvos Respublikos administracinių vienetų ir gyvenamųjų vietovių klasifikatorius (LR AVGVK 2018); \r\n\r\nApibrėžtys: Apgyvendinimo įstaiga – vietos veiklos rūšies vienetas, teikiantis mokamas trumpalaikio apgyvendinimo paslaugas turistui. Turistas – fizinis asmuo, keliaujantis į vietovę, esančią už jo įprastinės aplinkos ribų, apsistojantis joje bent vienai nakvynei, bet ne ilgiau kaip 12 mėn., ir neturintis tikslo joje mokytis ar dirbti apmokamo darbo. Nakvynė – kiekviena naktis, kurią turistas faktiškai praleidžia (miega ar būna) ar būna įregistruotas (jo fizinis buvimas nebūtinas) apgyvendinimo įstaigoje. Numeris (kambarys) – apgyvendinimui skirtame pastate specialiai įrengta patalpa ar patalpų grupė, apgyvendinimo paslaugų teikėjo siūloma asmenims nuomotis kaip nedaloma visuma. Numerių (kambarių) užimtumas – užimtų numerių (kambarių) ir apgyvendinimui paruoštų numerių (kambarių) skaičiaus santykis, išreikštas procentais. Vietų skaičius – lovų skaičius, kuris nustatomas numeriuose (kambariuose) ar atskirose patalpose pagal asmenų skaičių, kuriems gali būti suteikta nakvynė (dvigulė lova yra dvi vietos). Vietų užimtumas – nakvynių skaičiaus ir apgyvendinimui paruoštų vietų skaičiaus santykis, išreikštas procentais. Statistinio stebėjimo vienetas - Apgyvendinimo įstaiga (vietos veiklos rūšies vienetas). Tiriamąją visumą (populiaciją) sudaro: juridiniai asmenys, teikiantys apgyvendinimo paslaugas, nepriklausomai nuo pagrindinės ekonominės veiklos rūšies pagal tokias EVRK 2 red. I sekcijos grupes: 55.1 – viešbučių ir panašių laikinų buveinių veikla, 55.2 – poilsiautojų ir kita trumpalaikio apgyvendinimo veikla, 55.3 – poilsinių transporto priemonių, priekabų aikštelių ir stovyklaviečių veikla (toliau – EVRK 2 red. I sekcija, grupės 55.1, 55.2, 55.3). fiziniai asmenys, dirbantys pagal verslo liudijimą (010, 043 kodai pagal „Verslo liudijimų klasifikatorių“) ar (ir) individualios veiklos pažymą ir teikiantys apgyvendinimo veiklos (EVRK 2 red. I sekcija, grupės 55.1, 55.2, 55.3) paslaugas turistams. \r\nGeografinė aprėptis - statistinė informacija rengiama šalies, regionų, apskričių ir savivaldybių lygmeniu.\r\nLaiko aprėptis - nuo 2012 m.', 'https://data.gov.lt/datasets/2442/'),
(41, 4, 'Išvykusių vienadienių lankytojų skaičius (pagal valstybę ketvirtiniai)', '2023-12-29', '2023-12-29', 'Duomenų rinkinys apie Lietuvos nuolatinių gyventojų (toliau – gyventojai), keliaujančių į užsienį, skaičių. \r\nPateikta per tikslo valstybės dimensiją. \r\nNaudojami klasifikatoriai: Pasaulio šalių ir teritorijų klasifikatorius. \r\nStatistinio stebėjimo vienetas: vyresni nei 15 metų amžiaus gyventojai, grįžtantys iš užsienio. \r\nStatistinė tiriamoji visuma: tiriamąją visumą sudaro gyventojų, grįžtančių iš užsienio, kelionės. \r\nNeįskaitomos asmenų kelionės, kurių tikslas lankomoje teritorijoje yra apmokamas darbas. \r\nGeografinė aprėptis: visa šalies ekonominė teritorija. \r\nLaiko aprėptis: nuo 2005m.\r\nPeriodiškumas: ketvirtinis.', 'https://data.gov.lt/datasets/2476/'),
(42, 4, 'Didmeninės prekybos įmonių apyvartos (be PVM) indeksai palyginamosiomis kainomis (2015 m. – 100)', '2023-12-27', '2024-01-02', 'Rinkinyje pateikiami duomenys apie  trumpalaikius didmeninės prekybos įmonių, išskyrus prekybą variklinėmis transporto priemonėmis ir motociklais, apyvartos (be PVM) pokyčius. Pateikta per Ekonominės veiklos rūšies (EVRK 2 red.), išlyginimo ir lyginimo dimensijas. Naudojamas ekonominės veiklos rūšių klasifikatorius (EVRK 2 red.).\r\nStatistinio stebėjimo vienetas: įmonė. \r\nStatistinė tiriamoji visuma: visų rūšių ir dydžių veikiančios įmonės, kurių pagrindinė ekonominė veikla įvardyta EVRK 2 red. G sekcijos 46 skyriuje. \r\nGeografinė aprėptis: visa šalies ekonominė teritorija. \r\nLaiko aprėptis: nuo 2010 m. sausio mėn. \r\nPeriodiškumas – mėnesinis.', 'https://data.gov.lt/datasets/2473/'),
(43, 4, 'Mažmeninės prekybos, variklinių transporto priemonių, maitinimo įmonių apyvartos (be PVM) indeksai palyginamosiomis kainomis (2015 m. – 100)', '2023-12-27', '2023-12-27', 'Rinkinyje pateikiami duomenys apie trumpalaikius mažmeninės prekybos, variklinių transporto priemonių, maitinimo įmonių apyvartos (be PVM) pokyčius. \r\nPateikta per Ekonominės veiklos rūšies (EVRK 2 red.), išlyginimo ir lyginimo dimensijas. Naudojamas ekonominės veiklos rūšių klasifikatorius (EVRK 2 red.). \r\nStatistinio stebėjimo vienetas: įmonė. \r\nStatistinė tiriamoji visuma: visų rūšių ir dydžių veikiančios įmonės, kurių pagrindinė ekonominė veikla įvardyta EVRK 2 red. G sekcijos 45, 46, 47 skyriuose ir I sekcijos 56 skyriuje. \r\nGeografinė aprėptis: visa šalies ekonominė teritorija. \r\nLaiko aprėptis: nuo 1998 m. sausio mėn. \r\nPeriodiškumas – mėnesinis.', 'https://data.gov.lt/datasets/2471/'),
(44, 4, 'Energijos srautų ištekliai', '2023-12-27', '2023-12-27', 'Rinkinyje pateikiami duomenys apie gamtinių energijos išteklių, energetikos produktų, energetinių liekanų fizinius energijos srautų išteklius. \r\nNaudojami klasifikatoriai: ekonominės veiklos rūšių klasifikatorius (EVRK 2 red.). \r\nStatistinio stebėjimo vienetas: ūkio subjektas, įskaitant namų ūkį. \r\nStatistinė tiriamoji visuma: šalies vienetai rezidentai ir ne rezidentai, kurie gali būti ir juridiniai vienetai, ir fiziniai asmenys. \r\nGeografinė aprėptis: statistiniai rodikliai yra skaičiuojami ekonominės teritorijos mastu, įvertinant šalies vienetų rezidentų kuro ir energijos sunaudojimą užsienyje ir vienetų ne rezidentų kuro ir energijos sunaudojimą Lietuvos teritorijoje.\r\nLaiko aprėptis: nuo 2014 m. \r\nPeriodiškumas – metinis.', 'https://data.gov.lt/datasets/2466/'),
(45, 4, 'Statybos sąnaudų elementų kainų indeksai (2015 m. – 100)', '2023-12-27', '2024-01-02', 'Rinkinyje pateikiami duomenys įvairių laikotarpių statybos sąnaudų elementų kainų indeksą (SSKI). SSKI skaičiavimo tikslas – nustatyti naujos statybos pagrindinių statybos sąnaudų elementų bendrąjį kainų pokytį per mėnesio laikotarpį. SSKI reikalingas įvairiems rodikliams palyginamosiomis kainomis skaičiuoti, ekonomikos raidai analizuoti, statybos infliaciniams procesams vertinti. Skaičiuojami bendrasis SSKI bei atskirų statybos sąnaudų elementų kainų indeksai ir kainų pokyčiai. Pateikta per statinių pagal tipą klasifikatoriaus (CC) dimensiją. \r\nNaudojami klasifikatoriai: statinių pagal tipą klasifikatorius (CC).\r\nStatistinio stebėjimo vienetas: statistinis vienetas pagal veiklos rūšį. \r\nStatistinė tiriamoji visuma: statistiniame tyrime aprėpiamos visų nuosavybės formų veikiančios statybos įmonės, kurių naujos statybos darbų apimtis bendroje savo jėgomis atliktų statybos darbų apimtyje vertine išraiška yra ne mažesnė nei 50 proc. (EVRK 2 red. Sekcija F) ir prekybos įmonės, reprezentuojančios esamą prekybos statybinėmis medžiagomis ir gaminiais įmonių tinklą (EVRK 2 red. Sekcija G).\r\nGeografinė aprėptis: Visa šalies ekonominė teritorija. \r\nLaiko aprėptis: nuo 1998 m. sausio mėn. \r\nPeriodiškumas – mėnesinis.', 'https://data.gov.lt/datasets/2470/'),
(46, 4, 'Energijos srautų panaudojimas', '2023-12-27', '2024-01-03', 'Rinkinyje pateikiami duomenys apie gamtinių energijos išteklių, energetikos produktų, energetinių liekanų fizinį energijos srautų panaudojimą. \r\nNaudojami klasifikatoriai: ekonominės veiklos rūšių klasifikatorius (EVRK 2 red.). \r\nStatistinio stebėjimo vienetas: ūkio subjektas, įskaitant namų ūkį. \r\nStatistinė tiriamoji visuma: šalies vienetai rezidentai ir ne rezidentai, kurie gali būti ir juridiniai vienetai, ir fiziniai asmenys. \r\nGeografinė aprėptis: statistiniai rodikliai yra skaičiuojami ekonominės teritorijos mastu, įvertinant šalies vienetų rezidentų kuro ir energijos sunaudojimą užsienyje ir vienetų ne rezidentų kuro ir energijos sunaudojimą Lietuvos teritorijoje. \r\nLaiko aprėptis: nuo 2014 m. \r\nPeriodiškumas – metinis.', 'https://data.gov.lt/datasets/2467/'),
(47, 4, 'Energijos srautai', '2023-12-27', '2023-12-27', 'Rinkinyje pateikiami duomenys apie gamtinių energijos išteklių, energetikos produktų, energetinių liekanų gavybą, gamybą, suvartojimą ir sunaudojimą. \r\nNaudojami klasifikatoriai: ekonominės veiklos rūšių klasifikatorius (EVRK 2 red.). \r\nStatistinio stebėjimo vienetas: ūkio subjektas, įskaitant namų ūkį. \r\nStatistinė tiriamoji visuma: šalies vienetai rezidentai ir ne rezidentai, kurie gali būti ir juridiniai vienetai, ir fiziniai asmenys. \r\nGeografinė aprėptis: statistiniai rodikliai yra skaičiuojami ekonominės teritorijos mastu, įvertinant šalies vienetų rezidentų kuro ir energijos sunaudojimą užsienyje ir vienetų ne rezidentų kuro ir energijos sunaudojimą Lietuvos teritorijoje. \r\nLaiko aprėptis: nuo 2014 m. \r\nPeriodiškumas – metinis.', 'https://data.gov.lt/datasets/2444/'),
(48, 4, 'Nakvynių skaičius apgyvendinimo įstaigose', '2023-12-22', '2024-01-09', 'Duomenų rinkinys apie apgyvendinimo paslaugų tiekėjų skaičių pagal apgyvendinimo tipus, numerių ir vietų skaičių, jų užimtumą, apgyvendintų turistų ir jų nakvynių skaičių pagal atvykusių turistų gyvenamąją šalį. \r\nNaudojami klasifikatoriai:\r\n- Ekonominės veiklos rūšių klasifikatorius (EVRK 2 red.); \r\n- Pasaulio šalių ir teritorijų klasifikatorius; \r\n- Lietuvos Respublikos administracinių vienetų ir gyvenamųjų vietovių klasifikatorius (LR AVGVK 2018); \r\n- Verslo liudijimų klasifikatorius; \r\n- Teritorinių statistinių vienetų klasifikatorius (NUTS). \r\nStatistinio stebėjimo vienetas: apgyvendinimo įstaiga (vietos veiklos rūšies vienetas). \r\nStatistinė tiriamoji visuma: juridiniai asmenys, teikiantys apgyvendinimo paslaugas, nepriklausomai nuo pagrindinės ekonominės veiklos rūšies pagal tokias EVRK 2 red. I sekcijos grupes: 55.1 – viešbučių ir panašių laikinų buveinių veikla, 55.2 – poilsiautojų ir kita trumpalaikio apgyvendinimo veikla, 55.3 – poilsinių transporto priemonių, priekabų aikštelių ir stovyklaviečių veikla (toliau – EVRK 2 red. I sekcija, grupės 55.1, 55.2, 55.3). Fiziniai asmenys, dirbantys pagal verslo liudijimą (010, 043 kodai pagal „Verslo liudijimų klasifikatorių“) ar (ir) individualios veiklos pažymą ir teikiantys apgyvendinimo veiklos (EVRK 2 red. I sekcija, grupės 55.1, 55.2, 55.3) paslaugas turistams. \r\nGeografinė aprėptis: visa šalies ekonominė teritorija.\r\nLaiko aprėptis: nuo 2012m.\r\nPeriodiškumas: ketvirtinis.', 'https://data.gov.lt/datasets/2479/'),
(49, 4, 'Išvykusių vienadienių lankytojų išlaidos', '2023-12-22', '2023-12-22', 'Duomenų rinkinys apie Lietuvos nuolatinių gyventojų (toliau – gyventojai), keliaujančių į užsienį, skaičių, jų kelionių, nakvynių skaičių ir tikslus, naudojamą pagrindinę transporto priemonės rūšį ir apgyvendinimo tipą kelionėje bei kelionių išlaidas. \r\nPateikta per tikslo valstybės dimensiją. \r\nNaudojami klasifikatoriai: Pasaulio šalių ir teritorijų klasifikatorius. \r\nStatistinio stebėjimo vienetas: vyresni nei 15 metų amžiaus gyventojai, grįžtantys iš užsienio. Statistinė tiriamoji visuma: tiriamąją visumą sudaro gyventojų, grįžtančių iš užsienio, kelionės. Neįskaitomos asmenų kelionės, kurių tikslas lankomoje teritorijoje yra apmokamas darbas. Geografinė aprėptis: visa šalies ekonominė teritorija. \r\nLaiko aprėptis: nuo 2005m.\r\nPeriodiškumas: ketvirtinis.', 'https://data.gov.lt/datasets/2477/'),
(50, 4, 'Išvykusių Lietuvos gyventojų ir atvykusių užsieniečių kelionių skaičius', '2023-12-22', '2023-12-22', 'Duomenų rinkinys apie Lietuvos nuolatinių gyventojų (toliau – gyventojai), keliaujančių į užsienį, skaičių, jų kelionių, nakvynių skaičių ir tikslus, naudojamą pagrindinę transporto priemonės rūšį ir apgyvendinimo tipą kelionėje bei kelionių išlaidas.\r\nNaudojami klasifikatoriai: Pasaulio šalių ir teritorijų klasifikatorius. \r\nStatistinio stebėjimo vienetas: Atvykstančio užsieniečio ar išvykstančio Lietuvos Respublikos nuolatinio gyventojo kelionė, kurios metu asmuo kerta Lietuvos Respublikos pasienio kontrolės punktą ar Lietuvos Respublikos teritorijos ribas sausumoje, oro erdvėje, vandenyse. \r\nStatistinė tiriamoji visuma: Tiriamąją visumą sudaro visų asmenų, kertančių Lietuvos Respublikos teritorijos ribas, kelionės. Stebimi visi asmenys, kertantys Lietuvos Respublikos teritorijos ribas, neatsižvelgiant į jų amžių. Neįskaitomos pasienyje dirbančių darbuotojų kelionės. \r\nGeografinė aprėptis: Visos Lietuvos Respublikos pasienio ribos. \r\nLaiko aprėptis: nuo 2007 m.\r\nPeriodiškumas: metinis.', 'https://data.gov.lt/datasets/2478/'),
(51, 4, 'Būsto kainų indeksai', '2023-12-22', '2023-12-22', 'Rinkinyje pateikiami duomenys apie būsto kainų indeksą. Būsto kainų indeksas (BKI) – santykinis rodiklis, kuriuo išreiškiamas namų ūkių įsigyjamų būstų, įskaitant žemę, bendrasis kainų pokytis per tam tikrą laikotarpį. Būsto kainų indekso (toliau – BKI) sudarymo tikslas – turėti su kitomis Europos Sąjungos (ES) valstybėmis narėmis metodologiškai suderintą rodiklį būsto kainų pokyčiams išmatuoti. BKI reikalingas formuojant pinigų politiką, rengiant infliacijos prognozes ir konvergencijos ataskaitas, vertinant finansinį stabilumą, atliekant tarptautinius palyginimus. Sudarant BKI namų ūkių išlaidos būstui įsigyti klasifikuojamos į tokias išlaidų kategorijas: H.1. Būstų įsigijimas; H.1.1. Naujo būsto įsigijimas; H.1.2. Esamų būstų įsigijimas. Statistinio stebėjimo vienetas - namų ūkio būstas ir kartu su juo įsigyjama žemė. Tiriamoji visuma - Šalies rezidentų ir ne rezidentų namų ūkių šalies teritorijoje įsigyjami būstai. Namų ūkių sektorius apima visus asmenis ar asmenų grupes, neatsižvelgiant į tai, kur jie gyvena, kokią vietą užima pajamų pasiskirstyme, jų tautybę bei pilietybę. Duomenys renkami iš visos šalies ekonominės teritorijos nuo 2006m. I ketvirčio ir atnaujinami kas ketvirtį. BKI bazinis laikotarpis yra 2015 m. (2015 m. – 100). Kitas BKI bazinio laikotarpio keitimas numatytas 2026 m., buvusi laiko eilutė bus perskaičiuota į naują indekso bazinį laikotarpį ir paskelbta apskaičiavus 2026 m. I ketv. BKI. Pagrindinis statistinių duomenų šaltinis BKI apskaičiuoti yra VĮ Registrų centro Nekilnojamojo turto registro ir Sandorių duomenų bazių duomenys.', 'https://data.gov.lt/datasets/2526/'),
(52, 4, 'Išvykusių vienadienių lankytojų kelionių skaičius', '2023-12-22', '2023-12-29', 'Duomenų rinkinys apie Lietuvos nuolatinių gyventojų (toliau – gyventojai), keliaujančių į užsienį, skaičių, jų kelionių, nakvynių skaičių ir tikslus, naudojamą pagrindinę transporto priemonės rūšį ir apgyvendinimo tipą kelionėje bei kelionių išlaidas. \r\nNaudojami klasifikatoriai: Pasaulio šalių ir teritorijų klasifikatorius. Statistinio stebėjimo vienetas: vyresni nei 15 metų amžiaus gyventojai, grįžtantys iš užsienio. \r\nStatistinė tiriamoji visuma: tiriamąją visumą sudaro gyventojų, grįžtančių iš užsienio, kelionės. Neįskaitomos asmenų kelionės, kurių tikslas lankomoje teritorijoje yra apmokamas darbas. Geografinė aprėptis: visa šalies ekonominė teritorija.\r\nLaiko aprėptis: nuo 2005 m.\r\nPeriodiškumas: metinis ir ketvirtinis.', 'https://data.gov.lt/datasets/2445/'),
(53, 4, 'Išmetamųjų teršalų jungiamieji rodikliai', '2023-12-20', '2023-12-20', 'Į orą išmetamų teršalų sąskaitose nurodomi duomenys apie šalies vienetų rezidentų, kaip jie yra apibrėžti Europos nacionalinių ir regioninių sąskaitų sistemoje (ESS), išmetamų likutinių dujinių ir kietųjų dalelių medžiagų srautus.\r\nĮ orą išmetami teršalai – iš nacionalinio ūkio (gamybos ar vartojimo procesų) į atmosferą (kuri yra aplinkos dalis) patenkantis fizinis dujinių ar kietųjų dalelių medžiagų srautas.\r\n\r\nNaudojami klasifikatoriai:\r\nRemiantis Europos Parlamento ir Tarybos Reglamentu (ES) Nr. 691/2011 dėl Europos aplinkos ekonominių sąskaitų, rengiami statistiniai duomenys apie šiuos į orą išmetamus teršalus: anglies dioksidą (CO2), išskyrus išsiskiriantį iš biomasės; anglies dioksidą iš biomasės (biomasės CO2); azoto oksidą (N2O); metaną (CH4); perfluorangliavandenilius (PFCs); hidrofluorangliavandenilius (HFCs); sieros heksafluoridą (SF6); azoto oksidus (NOx); nemetano lakiuosius organinius junginius (NMVOCs); anglies monoksidą (CO); kietąsias daleles < 10 mikronų (PM10); kietąsias daleles < 2,5 mikronų (PM2,5); sieros dioksidą (SO2); amoniaką (NH3).\r\n\r\nGeografinė aprėptis: Visa šalies teritorija\r\n\r\nLaiko aprėptis: Nuo 2008 m.', 'https://data.gov.lt/datasets/2440/'),
(54, 4, 'Numerių, kuriais gali naudotis riboto judumo asmenys, skaičius', '2023-12-20', '2024-01-08', 'Pateikta statistinė informacija apie numerių, kuriais gali naudotis riboto judumo asmenys, skaičių apgyvendinimo įstaigose pagal apgyvendinimo įstaigos tipus, laikotarpį. Statistinio stebėjimo vienetas - apgyvendinimo įstaiga (vietos veiklos rūšies vienetas). Naudojamas Ekonominės veiklos rūšių klasifikatorius (EVRK 2 red.). Tiriamąją visumą (populiaciją) sudaro: 1) juridiniai asmenys, teikiantys apgyvendinimo paslaugas, nepriklausomai nuo pagrindinės ekonominės veiklos rūšies pagal EVRK 2 red. I sekcijos grupę 55.1 – viešbučių ir panašių laikinų buveinių veikla; 2) fiziniai asmenys, dirbantys pagal individualios veiklos pažymą ir teikiantys apgyvendinimo veiklos (EVRK 2 red. I sekcija, grupė 55.1) paslaugas turistams. Statistinė informacija rengiama šalies lygmeniu. Laiko aprėptis - nuo 2012 m.', 'https://data.gov.lt/datasets/2454/'),
(55, 4, 'Apgyvendinimo įstaigų skaičius', '2023-12-19', '2023-12-29', 'Ketvirtiniai, metiniai apgyvendinimo paslaugų tiekėjų kiekiai pagal administracinę teritoriją, apgyvendinimo tipą ir viešbučio kategoriją. \r\nNaudojami klasifikatoriai: Lietuvos Respublikos administracinių vienetų ir gyvenamųjų vietovių klasifikatorius (LR AVGVK 2018);\r\nApibrėžtys: Apgyvendinimo įstaiga – vietos veiklos rūšies vienetas, teikiantis mokamas trumpalaikio apgyvendinimo paslaugas turistui. Statistinė tiriamoji visuma juridiniai asmenys, teikiantys apgyvendinimo paslaugas, nepriklausomai nuo pagrindinės ekonominės veiklos rūšies pagal tokias EVRK 2 red. I sekcijos grupes: 55.1 – viešbučių ir panašių laikinų buveinių veikla, 55.2 – poilsiautojų ir kita trumpalaikio apgyvendinimo veikla, 55.3 – poilsinių transporto priemonių, priekabų aikštelių ir stovyklaviečių veikla (toliau – EVRK 2 red. I sekcija, grupės 55.1, 55.2, 55.3). Fiziniai asmenys, dirbantys pagal verslo liudijimą (010, 043 kodai pagal „Verslo liudijimų klasifikatorių“) ar (ir) individualios veiklos pažymą ir teikiantys apgyvendinimo veiklos (EVRK 2 red. I sekcija, grupės 55.1, 55.2, 55.3) paslaugas turistams. \r\nGeografinė aprėptis: statistinė informacija rengiama šalies, regionų, apskričių ir savivaldybių lygmeniu.\r\nLaiko aprėptis: nuo 2012 m.', 'https://data.gov.lt/datasets/2443/'),
(56, 4, 'BVP, palyginamosiomis kainomis (grandininio susiejimo metodu)', '2023-12-18', '2024-01-05', 'Statistinės informacijos aprašymas: bendrasis vidaus produktas (BVP) – vienas iš pagrindinių nacionalinių sąskaitų sistemos (NSS) rodiklių, apibūdinančių šalies ekonomikos išsivystymo lygį. BVP, jo kitimo tempas ir bendrosios nacionalinės pajamos (BNP) plačiai naudojami tarptautiniams palyginimams ir ekonominei analizei atlikti. Statistinio stebėjimo vienetas: nacionalinės sąskaitos apimančios ekonomiką, kaip visumą, kurią sudaro skirtingi instituciniai vienetai. Statistinę (tiriamąją) visumą sudaro visi statistiniai stebėjimo vienetai rezidentai. Lietuvos nacionalinės sąskaitos yra išsamios, t. y., visi statistiniai vienetai rezidentai yra apimami tiesiogiai duomenų šaltinių (tyrimų, administracinių duomenų) pagrindu arba per išsamumo korekcijas.\r\nGeografinė aprėptis: šalies ekonominė teritorija. \r\nLaiko aprėptis: nuo 1995 m. \r\nMatavimo vienetas (-ai): palyginamosios kainos – mln. EUR \r\nAtaskaitinis laikotarpis: kalendorinis ketvirtis.', 'https://data.gov.lt/datasets/2469/'),
(57, 4, 'Užimtumas (ESS 2010)', '2023-12-18', '2024-01-05', 'Pateikiama statistinė informacija -užimtumas pagal ekonominės veiklos rūšį, apskritis, užimtųjų klasifikaciją (metinis). Užimtumo sąvokai priskiriami visi asmenys, vykdantys nacionalinių sąskaitų gamybos sričiai priskiriamą gamybinę veiklą. Naudojamas Ekonominės veiklos rūšių klasifikatorius (https://osp.stat.gov.lt/klasifikatoriai?portletFormName=FPKL500&classifier-version=50&tab=version), teritorinių statistinių vienetų klasifikatorius (NUTS). Statistinę (tiriamąją) visumą sudaro visi šalies ekonominėje teritorijoje dirbantys asmenys – samdomieji darbuotojai arba savarankiškai dirbantys asmenys (rezidentai ir ne rezidentai), įskaitant šauktinius ir atskaitant šalies gyventojus – samdomuosius darbuotojus, dirbančius laikiną darbą kitose šalyse. \r\nGeografinė aprėptis - šalies ekonominė teritorija. \r\nLaiko aprėptis - nuo 2000 m.', 'https://data.gov.lt/datasets/2468/'),
(58, 4, 'BVP išlaidų metodu, palyginamosiomis kainomis (grandininio susiejimo metodu)', '2023-12-18', '2024-01-05', 'Statistinės informacijos aprašymas: bendrasis vidaus produktas (BVP) – vienas iš pagrindinių nacionalinių sąskaitų sistemos (NSS) rodiklių, apibūdinančių šalies ekonomikos išsivystymo lygį. BVP, jo kitimo tempas ir bendrosios nacionalinės pajamos (BNP) plačiai naudojami tarptautiniams palyginimams ir ekonominei analizei atlikti. Statistinio stebėjimo vienetas: nacionalinės sąskaitos apimančios ekonomiką kaip visumą, kurią sudaro skirtingi instituciniai vienetai. Statistinę (tiriamąją) visumą sudaro visi statistiniai stebėjimo vienetai rezidentai. Lietuvos nacionalinės sąskaitos yra išsamios, t. y., visi statistiniai vienetai rezidentai yra apimami tiesiogiai duomenų šaltinių (tyrimų, administracinių duomenų) pagrindu arba per išsamumo korekcijas.\r\nGeografinė aprėptis: šalies ekonominė teritorija. \r\nLaiko aprėptis: nuo 1995 m. \r\nMatavimo vienetas (-ai): palyginamosios kainos – mln. EUR.\r\nAtaskaitinis laikotarpis: kalendorinis ketvirtis.', 'https://data.gov.lt/datasets/2465/'),
(59, 4, 'Metinis: Užimtumo lygis (pagal tikslines amžiaus grupes ir lytį)', '2023-12-18', '2024-01-03', 'Pateikta statistinė informacija apie gyventojų užimtumą pagal amžiaus grupes, lytį ir gyvenamą vietovę. Informacija pateikiama kas ketvirtį nuo 1998 metų. Tiriamoji visuma – visi nuolatiniai Lietuvos gyventojai. Statistinio stebėjimo vienetas - privatus namų ūkis bei jo narys. \r\nTyrimo apibrėžtis - užimti gyventojai, asmenys, dirbantys bet kokį darbą, gaunantys už jį atlygį pinigais ar natūra arba turintys iš jo pajamų ar pelno. Tyrime užimtais gyventojais laikomi 15–89 metų gyventojai, tiriamąją savaitę ne trumpiau kaip valandą dirbę bet kokį darbą, už kurį gavo darbo užmokestį pinigais ar atlygį natūra ar iš kurio turėjo pelno ar pajamų, taip pat gyventojai, kurie turėjo darbą, bet tiriamąją savaitę laikinai nedirbo.', 'https://data.gov.lt/datasets/2520/'),
(60, 4, 'Ekvivalentinių disponuojamųjų pajamų Gini koeficientas', '2023-12-18', '2023-12-20', 'Pateikta statistinė informacija apie namų ūkių disponuojamų pajamų Gini koeficientus.\r\nTyrimo apibrėžtis tai disponuojamosios namų ūkio pajamos – bendrosios namų ūkio pajamos atskaičius pajamų mokestį, nuolatinius turto mokesčius, darbuotojų, savarankiškai dirbančių asmenų ir bedarbių (jei taikoma) privalomojo socialinio draudimo įmokas ir reguliarius pervedimus kitiems namų ūkiams. Statistinio stebėjimo vienetas - privatus namų ūkis. Laiko aprėptis – nuo 2008 m., metinis.', 'https://data.gov.lt/datasets/2519/'),
(61, 4, 'Sveikatos priežiūros finansavimo programų išlaidos funkcijoms', '2023-12-18', '2023-12-20', 'Pateikta statistinė informacija apie sveikatos priežiūros išlaidas programų funkcijoms. Tyrimo statistinio stebėjimo vienetas institucinis vienetas, renkantis lėšas sveikatos priežiūros finansavimo programoms. Informacija kaupiama nuo 2007 metų (metinis) ir apima visus šalies ekonominės teritorijos sveikatos priežiūros paslaugų ir prekių teikėjus. Tyrimo apibrėžtis - asmenų ir visuomenės grupių sveikatos priežiūros poreikiams patenkinti skirtos sveikatos priežiūros paslaugų ir (arba) prekių grupės (gydymas, reabilitacija, slauga ir pan.). \r\nTyrime naudojama sveikatos priežiūros funkcijų klasifikacija (ICHA-HC).', 'https://data.gov.lt/datasets/2518/'),
(62, 4, 'Sveikatos priežiūros finansavimo programų išlaidos teikėjams', '2023-12-18', '2024-01-08', 'Pateikta statistinė informacija apie sveikatos priežiūros išlaidas programų teikėjams. Tyrimo statistinio stebėjimo vienetas institucinis vienetas, renkantis lėšas sveikatos priežiūros finansavimo programoms. Informacija kaupiama nuo 2007 metų (metinis) ir apima visus šalies ekonominės teritorijos sveikatos priežiūros paslaugų ir prekių teikėjus. Tyrimo apibrėžtis - lėšų, skirtų sveikatos priežiūros prekėms ir paslaugoms finansuoti, padidėjimas taikant specifinius finansavimo mechanizmus. Tyrime naudojama sveikatos priežiūros finansavimo programų pajamų (ICHA-FS) ir sveikatos priežiūros finansavimo programų klasifikacijos (ICHA-HF).', 'https://data.gov.lt/datasets/2517/'),
(63, 4, 'Išlaidos sveikatos priežiūros funkcijoms ir teikėjams', '2023-12-18', '2023-12-20', 'Pateikta statistinė informacija apie sveikatos priežiūros išlaidas funkcijoms ir teikėjams. Tyrimo statistinio stebėjimo vienetas tai įmonė, teikianti galutinio vartojimo sveikatos priežiūros prekes ir (arba) paslaugas. Informacija kaupiama nuo 2007 metų (metinis) ir apima visus šalies ekonominės teritorijos sveikatos priežiūros paslaugų ir prekių teikėjus. Geografinė aprėptis - visa ekonominė šalies teritorija.\r\nTyrime naudojama sveikatos priežiūros funkcijų ICHA-HC ir sveikatos priežiūros paslaugų teikėjų klasifikacijos ICHA-HP.', 'https://data.gov.lt/datasets/2516/');
INSERT INTO `rinkinys` (`RINKINYS_ID`, `ORGANIZACIJA_ID`, `RINKINYS_PAVADINIMAS`, `RINKINYS_IKEL_DATA`, `RINKINYS_ATNAUJ_DATA`, `RINKINYS_APRASAS`, `RINKINYS_NUORODA`) VALUES
(64, 4, 'Kūdikių mirtingumo rodiklis', '2023-12-18', '2023-12-22', 'Pateikta statistinė informacija apie Lietuvos Respublikos negyvų gimusių kūdikių skaičių pagal gyvenamąją vietovę, lytį, laikotarpį ir išnešiojimo amžių. Tyrimas apima Lietuvos Respublikoje negyvus gimusius kūdikius, kurių motinos yra nuolatinės Lietuvos Respublikos gyventojos. Statistinio stebėjimo vienetas - negyvas gimęs kūdikis. Laiko aprėptis – nuo 2000 m., metinis.\r\nTyrime naudojami klasifikatoriai:\r\nPasaulio šalių ir teritorijų klasifikatorius (https://osp.stat.gov.lt/lt/web/guest/pasaulio-saliu-ir-teritoriju-klasifikatorius)\r\nLietuvos Respublikos administracinių vienetų ir gyvenamųjų vietovių klasifikatorius (LR AVGVK 2018) (https://osp.stat.gov.lt/klasifikatoriai?portletFormName=FPKL500&classifier-version=861&tab=version)\r\nTeritorinių statistinių vienetų klasifikatorius (NUTS)(https://osp.stat.gov.lt/lt/web/guest/teritoriniu-statistiniu-vienetu-klasifikatorius-nuts)', 'https://data.gov.lt/datasets/2515/'),
(65, 4, 'Bendrasis mirtingumo rodiklis', '2023-12-18', '2023-12-22', 'Pateikta statistinė informacija apie mirusių Lietuvos Respublikos nuolatinių gyventojų skaičių pagal gyvenamąją vietovę, administracinę teritoriją, lytį ir laikotarpį. Tyrimas apima mirusius Lietuvos Respublikos nuolatinius gyventojus. Statistinio stebėjimo vienetas – miręs asmuo. Laiko aprėptis - nuo 1950 m., metinis.\r\nTyrime naudojami klasifikatoriai:\r\nPasaulio šalių ir teritorijų klasifikatorius (https://osp.stat.gov.lt/lt/web/guest/pasaulio-saliu-ir-teritoriju-klasifikatorius)\r\nLietuvos Respublikos administracinių vienetų ir gyvenamųjų vietovių klasifikatorius (LR AVGVK 2018) (https://osp.stat.gov.lt/klasifikatoriai?portletFormName=FPKL500&classifier-version=861&tab=version)\r\nTeritorinių statistinių vienetų klasifikatorius (NUTS)(https://osp.stat.gov.lt/lt/web/guest/teritoriniu-statistiniu-vienetu-klasifikatorius-nuts)', 'https://data.gov.lt/datasets/2514/'),
(66, 4, 'Išvykusių turistų vidutinės vienos kelionės išlaidos', '2023-12-18', '2023-12-21', 'Duomenų rinkinys apie Lietuvos nuolatinių gyventojų (toliau – gyventojai), keliaujančių į užsienį, skaičių, jų kelionių, nakvynių skaičių ir tikslus, naudojamą pagrindinę transporto priemonės rūšį ir apgyvendinimo tipą kelionėje bei vidutines vienos kelionės išlaidas.\r\n\r\nNaudojami klasifikatoriai: \r\n\r\nPasaulio šalių ir teritorijų klasifikatorius.\r\n\r\nStatistinio stebėjimo vienetas: vyresni nei 15 metų amžiaus gyventojai, grįžtantys iš užsienio..\r\n\r\nStatistinė tiriamoji visuma: tiriamąją visumą sudaro gyventojų, grįžtančių iš užsienio, kelionės. Neįskaitomos asmenų kelionės, kurių tikslas lankomoje teritorijoje yra apmokamas darbas.\r\n\r\nGeografinė aprėptis: visa šalies ekonominė teritorija.\r\n\r\nLaiko aprėptis: nuo 2005m., ketvirtiniai ir metiniai.', 'https://data.gov.lt/datasets/2513/'),
(67, 4, 'Išvykusių turistų vidutinės dienos išlaidos', '2023-12-18', '2023-12-21', 'Duomenų rinkinys apie Lietuvos nuolatinių gyventojų (toliau – gyventojai), keliaujančių į užsienį, skaičių, jų kelionių, nakvynių skaičių ir tikslus, naudojamą pagrindinę transporto priemonės rūšį ir apgyvendinimo tipą kelionėje bei vidutines vienos dienos kelionių išlaidas.\r\n\r\nNaudojami klasifikatoriai: \r\n\r\nPasaulio šalių ir teritorijų klasifikatorius.\r\n\r\nStatistinio stebėjimo vienetas: vyresni nei 15 metų amžiaus gyventojai, grįžtantys iš užsienio..\r\n\r\nStatistinė tiriamoji visuma: tiriamąją visumą sudaro gyventojų, grįžtančių iš užsienio, kelionės. Neįskaitomos asmenų kelionės, kurių tikslas lankomoje teritorijoje yra apmokamas darbas.\r\n\r\nGeografinė aprėptis: visa šalies ekonominė teritorija.\r\n\r\nLaiko aprėptis: nuo 2005m., ketvirtiniai ir metiniai.', 'https://data.gov.lt/datasets/2512/'),
(68, 4, 'Parduota gaminių', '2023-12-18', '2023-12-27', 'Duomenų rinkinys apie pramoninių gaminių gamybą ir pardavimą natūrine ir vertine išraiška. Pateikta per apskrities, rinkos, dalies, gaminių rūšies dimensijas. \r\n\r\nNaudojami klasifikatoriai: \r\n\r\nProduktų, gaminių ir paslaugų klasifikatoriaus (PGPK 2022 II dalis (PRODCOM)) versijos patvirtinimas (2022 m. sausio 26 d. Nr. DĮ - 32);\r\n\r\nLietuvos Respublikos administracinių vienetų ir gyvenamųjų vietovių klasifikatorius (LR AVGVK 2018);\r\n\r\nStatistinio stebėjimo vienetas: įmonė.\r\n\r\nStatistinė tiriamoji visuma: visos veikiančios įmonės, kurių pagrindinė ekonominė veikla yra pramoninė veikla (EVRK 2 red. B ir C sekcijos, E sekcijos 38 skyrius) ir nepramoninės įmonės, vykdančios pramoninę veiklą.\r\n\r\nGeografinė aprėptis: Statistinė informacija rengiama šalies, Sostinės regiono ir Vidurio ir vakarų Lietuvos regiono, apskričių lygmeniu.\r\n\r\nLaiko aprėptis: nuo 2005m., metinis.', 'https://data.gov.lt/datasets/2510/'),
(69, 4, 'Pagaminta gaminių natūriniais vienetais', '2023-12-18', '2023-12-22', 'Duomenų rinkinys apie pramoninių gaminių gamybą ir pardavimą natūrine ir vertine išraiška. Pateikta per apskrities, dalies, gaminių rūšies dimensijas. \r\n\r\nNaudojami klasifikatoriai: \r\n\r\nProduktų, gaminių ir paslaugų klasifikatoriaus (PGPK 2022 II dalis (PRODCOM)) versijos patvirtinimas (2022 m. sausio 26 d. Nr. DĮ - 32);\r\n\r\nLietuvos Respublikos administracinių vienetų ir gyvenamųjų vietovių klasifikatorius (LR AVGVK 2018);\r\n\r\nStatistinio stebėjimo vienetas: įmonė.\r\n\r\nStatistinė tiriamoji visuma: visos veikiančios įmonės, kurių pagrindinė ekonominė veikla yra pramoninė veikla (EVRK 2 red. B ir C sekcijos, E sekcijos 38 skyrius) ir nepramoninės įmonės, vykdančios pramoninę veiklą.\r\n\r\nGeografinė aprėptis: Statistinė informacija rengiama šalies, Sostinės regiono ir Vidurio ir vakarų Lietuvos regiono, apskričių lygmeniu.\r\n\r\nLaiko aprėptis: nuo 2005m., metinis.', 'https://data.gov.lt/datasets/2509/'),
(70, 4, 'Atliekų susidarymas ir tvarkymas', '2023-12-18', '2023-12-22', 'Duomenų rinkinys apie kiek per ataskaitinius metus Lietuvoje susidarė ir buvo surinkta atliekų bei kiek ir kokiomis atliekų tvarkymo veiklomis atliekos buvo sutvarkytos Lietuvoje ar išvežtos (eksportuotos) tvarkyti į kitas valstybes. Pateikta per atliekų rūšies ir atliekų tvarkymo būdų dimensijas. \r\n\r\nNaudojami klasifikatoriai: \r\nAtliekų kodų sąrašas – oficialiai skelbiamas Atliekų tvarkymo taisyklių, patvirtintų Lietuvos Respublikos aplinkos ministro 1999-07-14 įsakymu Nr. 217 „Dėl Atliekų tvarkymo taisyklių patvirtinimo“ (toliau – Atliekų tvarkymo taisyklės), 1 priede;\r\n\r\nAtliekų statistinis klasifikatorius – oficialiai skelbiamas Europos Parlamento ir Tarybos Reglamento (EB) Nr. 2150/2002 dėl atliekų statistikos III priede;\r\n\r\nAtliekų tvarkymo veiklų sąrašas – oficialiai skelbiamas Atliekų tvarkymo taisyklių 2 priede.\r\n\r\nStatistinio stebėjimo vienetas: ūkio subjektas, vykdantis atliekų susidarymo ir (ar) tvarkymo apskaitą.\r\n\r\nStatistinė tiriamoji visuma: Lietuvos Respublikos teritorijoje veiklą vykdantys ūkio subjektai (atliekų darytojai ir atliekų tvarkytojai), kurie teisės aktų nustatyta tvarka privalo vykdyti atliekų susidarymo ir (ar) tvarkymo apskaitą.\r\n\r\nGeografinė aprėptis: visa šalies teritorija\r\n\r\nLaiko aprėptis: nuo 2016m., metinis.', 'https://data.gov.lt/datasets/2508/'),
(71, 4, 'Atliekų susidarymas ir tvarkymas žemės ūkyje, miškininkystėje ir žuvininkystėje', '2023-12-18', '2023-12-27', 'Duomenų rinkinys apie atliekų susidarymą ir tvarkymą žemės ūkyje, miškininkystėje ir žuvininkystėje. Pateikta per atliekų rūšies ir atliekų tvarkymo būdų dimensijas.\r\n\r\nNaudojami klasifikatoriai: Ekonominės veiklos rūšių klasifikatorius (EVRK 2 red.)\r\n\r\nStatistinio stebėjimo vienetas: visų rūšių žemės ūkio, miškininkystės ir žuvininkystės įmonės, ūkininkų ir šeimos ūkiai\r\n\r\nStatistinė tiriamoji visuma: tyrimo populiaciją sudaro ūkininkų ir šeimos ūkiai, visų teisinių formų įmonės, vykdančios žemės ūkio, miškininkystės ir žuvininkystės ekonominę veiklą, kuriose dirba 5 ir daugiau darbuotojų. Tyrimas apima įmones, kurių pagrindinė ekonominė veikla priskiriama EVRK 2 red. A sekcijos 01–03 skyriams.\r\n\r\nGeografinė aprėptis: statistinė informacija rengiama šalies lygmeniu.\r\n\r\nLaiko aprėptis: nuo 2006m., kas du metus.', 'https://data.gov.lt/datasets/2507/'),
(72, 4, 'Įmonių pajamos iš šalutinių produktų aplinkos tausojimui', '2023-12-18', '2023-12-21', 'Duomenų rinkinys apie įmonių pajamas iš šalutinių produktų aplinkos tausojimui. Pateikta per ekonominės veiklos rūšies, aplinkos apsaugos veiklos  dimensijas.\r\n\r\nNaudojami klasifikatoriai: \r\nEkonominės veiklos rūšių klasifikatorius (EVRK 2 red.);\r\nAplinkos apsaugos veiklos ir išlaidų klasifikatorius (CEPA 2000).\r\n\r\nStatistinio stebėjimo vienetas: įmonė\r\n\r\nStatistinė tiriamoji visuma: Tyrimo populiaciją sudaro visos per ataskaitinį laikotarpį veikusios akcinės ir uždaros akcinės bendrovės, valstybės ir savivaldybės įmonės, užsienio įmonių filialai, žemės ūkio ir kooperatinės bendrovės, turinčios 5 ir daugiau darbuotojų. Tyrimas apima kasybos ir karjerų eksploatavimo, apdirbamosios gamybos, elektros, dujų, garo tiekimo ir oro kondicionavimo, vandens tiekimo, nuotekų valymo, atliekų tvarkymo ir regeneravimo, statybos, transporto ir saugojimo veiklos rūšis pagal EVRK 2 red.\r\n\r\nGeografinė aprėptis: statistinė informacija rengiama šalies lygmeniu.\r\n\r\nLaiko aprėptis: nuo 2008m., metinis.', 'https://data.gov.lt/datasets/2506/'),
(73, 4, 'Įmonių einamosios išlaidos aplinkos tausojimui', '2023-12-18', '2023-12-20', 'Duomenų rinkinys apie įmonių išlaidas aplinkos tausojimui. Pateikta per ekonominės veiklos rūšies, aplinkos apsaugos veiklos ir išlaidų rūšies dimensijas.\r\n\r\nNaudojami klasifikatoriai: \r\nEkonominės veiklos rūšių klasifikatorius (EVRK 2 red.);\r\nAplinkos apsaugos veiklos ir išlaidų klasifikatorius (CEPA 2000).\r\n\r\nStatistinio stebėjimo vienetas: įmonė\r\n\r\nStatistinė tiriamoji visuma: Tyrimo populiaciją sudaro visos per ataskaitinį laikotarpį veikusios akcinės ir uždaros akcinės bendrovės, valstybės ir savivaldybės įmonės, užsienio įmonių filialai, žemės ūkio ir kooperatinės bendrovės, turinčios 5 ir daugiau darbuotojų. Tyrimas apima kasybos ir karjerų eksploatavimo, apdirbamosios gamybos, elektros, dujų, garo tiekimo ir oro kondicionavimo, vandens tiekimo, nuotekų valymo, atliekų tvarkymo ir regeneravimo, statybos, transporto ir saugojimo veiklos rūšis pagal EVRK 2 red.\r\n\r\nGeografinė aprėptis: statistinė informacija rengiama šalies lygmeniu.\r\n\r\nLaiko aprėptis: nuo 2008m., metinis.', 'https://data.gov.lt/datasets/2505/'),
(74, 4, 'Įmonių investicijos aplinkos tausojimui', '2023-12-18', '2023-12-22', 'Duomenų rinkinys apie įmonių išlaidas aplinkos tausojimui. Pateikta per ekonominės veiklos rūšies, aplinkos apsaugos veiklos ir investicijų krypties dimensijas.\r\n\r\nNaudojami klasifikatoriai: \r\nEkonominės veiklos rūšių klasifikatorius (EVRK 2 red.);\r\nAplinkos apsaugos veiklos ir išlaidų klasifikatorius (CEPA 2000).\r\n\r\nStatistinio stebėjimo vienetas: įmonė\r\n\r\nStatistinė tiriamoji visuma: Tyrimo populiaciją sudaro visos per ataskaitinį laikotarpį veikusios akcinės ir uždaros akcinės bendrovės, valstybės ir savivaldybės įmonės, užsienio įmonių filialai, žemės ūkio ir kooperatinės bendrovės, turinčios 5 ir daugiau darbuotojų. Tyrimas apima kasybos ir karjerų eksploatavimo, apdirbamosios gamybos, elektros, dujų, garo tiekimo ir oro kondicionavimo, vandens tiekimo, nuotekų valymo, atliekų tvarkymo ir regeneravimo, statybos, transporto ir saugojimo veiklos rūšis pagal EVRK 2 red.\r\n\r\nGeografinė aprėptis: statistinė informacija rengiama šalies lygmeniu.\r\n\r\nLaiko aprėptis: nuo 2008m., metinis.', 'https://data.gov.lt/datasets/2504/'),
(75, 4, 'Pervesta aplinkos apsaugai', '2023-12-18', '2023-12-20', 'Duomenų rinkinys apie aplinkos apsaugos išlaidų sąskaitose pateikiamus duomenis apie išlaidas aplinkos apsaugai, t.y. ekonominius išteklius, kuriuos šalies ūkio subjektai skiria aplinkos apsaugai. Pateikta per aplinkosaugos veiklos rūšies, pervedimų aplinkos apsaugai rūšies, sandorio ir sektoriaus dimensijas.\r\n\r\nNaudojami klasifikatoriai: Aplinkos apsaugos veiklos ir išlaidų klasifikatorius  (CEPA 2000).\r\n\r\nStatistinio stebėjimo vienetas: ūkio subjektai, įskaitant namų ūkius.\r\n\r\nStatistinė tiriamoji visuma: namų ūkiai, nefinansinės bendrovės, valdžios sektorius, likusio pasaulio sektorius: \r\n\r\n– valdžios sektorius ir nefinansinės bendrovės kaip aplinkos apsaugos paslaugas teikiantys instituciniai sektoriai;\r\n\r\n– namų ūkiai, valdžios sektorius ir nefinansinės bendrovės kaip aplinkos apsaugos paslaugų vartotojai;\r\n\r\n– likusio pasaulio sektorius kaip aplinkos apsaugai skirtų pervedimų gavėjas arba mokėtojas.\r\n\r\nTiriami šalies ūkio subjektai, vykdantys kasybos ir karjerų eksploatavimo (sekcija B), apdirbamosios gamybos (sekcija C), elektros, dujų, garo tiekimo ir oro kondicionavimo (sekcija D), vandens tiekimo, nuotekų valymo, atliekų tvarkymo ir regeneravimo (sekcija E), statybos (sekcija F), transporto ir saugojimo (sekcija H) veiklos rūšis pagal EVRK 2 red. Kitų ekonominės veiklos rūšių (išskyrus valdžios sektorių) pagal EVRK 2 red. aplinkos apsaugos išlaidos nėra vertinamos.\r\n\r\nGeografinė aprėptis: visa šalies ekonominė teritorija.\r\n\r\nLaiko aprėptis: nuo 2010m., metinis.', 'https://data.gov.lt/datasets/2503/'),
(76, 4, 'Investicijos į aplinkos apsaugą', '2023-12-18', '2023-12-20', 'Duomenų rinkinys apie aplinkos apsaugos išlaidų sąskaitose pateikiamus duomenis apie išlaidas aplinkos apsaugai, t.y. ekonominius išteklius, kuriuos šalies ūkio subjektai skiria aplinkos apsaugai. Pateikta per aplinkosaugos veiklos rūšies ir investicijų į aplinkos apsaugą rūšies dimensijas.\r\n\r\nNaudojami klasifikatoriai: Aplinkos apsaugos veiklos ir išlaidų klasifikatorius  (CEPA 2000).\r\n\r\nStatistinio stebėjimo vienetas: ūkio subjektai, įskaitant namų ūkius.\r\n\r\nStatistinė tiriamoji visuma: namų ūkiai, nefinansinės bendrovės, valdžios sektorius, likusio pasaulio sektorius: \r\n\r\n– valdžios sektorius ir nefinansinės bendrovės kaip aplinkos apsaugos paslaugas teikiantys instituciniai sektoriai;\r\n\r\n– namų ūkiai, valdžios sektorius ir nefinansinės bendrovės kaip aplinkos apsaugos paslaugų vartotojai;\r\n\r\n– likusio pasaulio sektorius kaip aplinkos apsaugai skirtų pervedimų gavėjas arba mokėtojas.\r\n\r\nTiriami šalies ūkio subjektai, vykdantys kasybos ir karjerų eksploatavimo (sekcija B), apdirbamosios gamybos (sekcija C), elektros, dujų, garo tiekimo ir oro kondicionavimo (sekcija D), vandens tiekimo, nuotekų valymo, atliekų tvarkymo ir regeneravimo (sekcija E), statybos (sekcija F), transporto ir saugojimo (sekcija H) veiklos rūšis pagal EVRK 2 red. Kitų ekonominės veiklos rūšių (išskyrus valdžios sektorių) pagal EVRK 2 red. aplinkos apsaugos išlaidos nėra vertinamos.\r\n\r\nGeografinė aprėptis: visa šalies ekonominė teritorija.\r\n\r\nLaiko aprėptis: nuo 2010m., metinis.', 'https://data.gov.lt/datasets/2502/'),
(77, 4, 'Aplinkos apsaugos paslaugų vartojimas', '2023-12-18', '2023-12-20', 'Duomenų rinkinys apie aplinkos apsaugos išlaidų sąskaitose pateikiamus duomenis apie išlaidas aplinkos apsaugai, t.y. ekonominius išteklius, kuriuos šalies ūkio subjektai skiria aplinkos apsaugai. Pateikta per aplinkosaugos veiklos rūšies ir aplinkos apsaugos paslaugų vartojimo rūšies dimensijas.\r\n\r\nNaudojami klasifikatoriai: Aplinkos apsaugos veiklos ir išlaidų klasifikatorius  (CEPA 2000).\r\n\r\nStatistinio stebėjimo vienetas: ūkio subjektai, įskaitant namų ūkius.\r\n\r\nStatistinė tiriamoji visuma: namų ūkiai, nefinansinės bendrovės, valdžios sektorius, likusio pasaulio sektorius: \r\n\r\n– valdžios sektorius ir nefinansinės bendrovės kaip aplinkos apsaugos paslaugas teikiantys instituciniai sektoriai;\r\n\r\n– namų ūkiai, valdžios sektorius ir nefinansinės bendrovės kaip aplinkos apsaugos paslaugų vartotojai;\r\n\r\n– likusio pasaulio sektorius kaip aplinkos apsaugai skirtų pervedimų gavėjas arba mokėtojas.\r\n\r\nTiriami šalies ūkio subjektai, vykdantys kasybos ir karjerų eksploatavimo (sekcija B), apdirbamosios gamybos (sekcija C), elektros, dujų, garo tiekimo ir oro kondicionavimo (sekcija D), vandens tiekimo, nuotekų valymo, atliekų tvarkymo ir regeneravimo (sekcija E), statybos (sekcija F), transporto ir saugojimo (sekcija H) veiklos rūšis pagal EVRK 2 red. Kitų ekonominės veiklos rūšių (išskyrus valdžios sektorių) pagal EVRK 2 red. aplinkos apsaugos išlaidos nėra vertinamos.\r\n\r\nGeografinė aprėptis: visa šalies ekonominė teritorija.\r\n\r\nLaiko aprėptis: nuo 2010m., metinis.', 'https://data.gov.lt/datasets/2501/'),
(78, 4, 'Aplinkos apsaugos paslaugų produkcija', '2023-12-18', '2023-12-19', 'Duomenų rinkinys apie aplinkos apsaugos išlaidų sąskaitose pateikiamus duomenis apie išlaidas aplinkos apsaugai, t.y. ekonominius išteklius, kuriuos šalies ūkio subjektai skiria aplinkos apsaugai. Pateikta per aplinkosaugos veiklos rūšies ir aplinkos apsaugos paslaugų produkcijos rūšies dimensijas.\r\n\r\nNaudojami klasifikatoriai: Aplinkos apsaugos veiklos ir išlaidų klasifikatorius  (CEPA 2000).\r\n\r\nStatistinio stebėjimo vienetas: ūkio subjektai, įskaitant namų ūkius.\r\n\r\nStatistinė tiriamoji visuma: namų ūkiai, nefinansinės bendrovės, valdžios sektorius, likusio pasaulio sektorius: \r\n\r\n– valdžios sektorius ir nefinansinės bendrovės kaip aplinkos apsaugos paslaugas teikiantys instituciniai sektoriai;\r\n\r\n– namų ūkiai, valdžios sektorius ir nefinansinės bendrovės kaip aplinkos apsaugos paslaugų vartotojai;\r\n\r\n– likusio pasaulio sektorius kaip aplinkos apsaugai skirtų pervedimų gavėjas arba mokėtojas.\r\n\r\nTiriami šalies ūkio subjektai, vykdantys kasybos ir karjerų eksploatavimo (sekcija B), apdirbamosios gamybos (sekcija C), elektros, dujų, garo tiekimo ir oro kondicionavimo (sekcija D), vandens tiekimo, nuotekų valymo, atliekų tvarkymo ir regeneravimo (sekcija E), statybos (sekcija F), transporto ir saugojimo (sekcija H) veiklos rūšis pagal EVRK 2 red. Kitų ekonominės veiklos rūšių (išskyrus valdžios sektorių) pagal EVRK 2 red. aplinkos apsaugos išlaidos nėra vertinamos.\r\n\r\nGeografinė aprėptis: visa šalies ekonominė teritorija.\r\n\r\nLaiko aprėptis: nuo 2010m., metinis.', 'https://data.gov.lt/datasets/2500/'),
(79, 4, 'BVP išlaidų metodu, to meto kainomis', '2023-12-18', '2024-01-05', 'Statistinės informacijos aprašymas: bendrasis vidaus produktas (BVP) – vienas iš pagrindinių nacionalinių sąskaitų sistemos (NSS) rodiklių, apibūdinančių šalies ekonomikos išsivystymo lygį. BVP, jo kitimo tempas ir bendrosios nacionalinės pajamos (BNP) plačiai naudojami tarptautiniams palyginimams ir ekonominei analizei atlikti. Statistinio stebėjimo vienetas: nacionalinės sąskaitos, apimančios ekonomiką kaip visumą, kurią sudaro skirtingi instituciniai vienetai. Statistinę (tiriamąją) visumą sudaro visi statistiniai stebėjimo vienetai rezidentai. \r\nGeografinė aprėptis - šalies ekonominė teritorija.\r\nLaiko aprėptis - nuo 1995 m. \r\nMatavimo vienetas (-ai): BVP to meto kainomis – mln. EUR ir indeksai – proc.; Ataskaitinis laikotarpis: kalendoriniai metai.', 'https://data.gov.lt/datasets/2451/'),
(80, 4, 'BVP pajamų metodu, to meto kainomis', '2023-12-18', '2024-01-05', 'Statistinės informacijos aprašymą sudaro bendrasis vidaus produktas (BVP) – vienas iš pagrindinių nacionalinių sąskaitų sistemos (NSS) rodiklių, apibūdinančių šalies ekonomikos išsivystymo lygį. BVP, jo kitimo tempas ir bendrosios nacionalinės pajamos (BNP) plačiai naudojami tarptautiniams palyginimams ir ekonominei analizei atlikti.\r\nNaudojami klasifikatorius: ekonominės veiklos rūšių klasifikatorius\r\nStatistinio stebėjimo vienetas: nacionalinės sąskaitos apima ekonomiką, kaip visumą, kurią sudaro skirtingi instituciniai vienetai.\r\nStatistinę (tiriamąją) visumą sudaro visi statistiniai stebėjimo vienetai rezidentai. Lietuvos nacionalinės sąskaitos yra išsamios; t. y. visi statistiniai vienetai rezidentai yra apimami tiesiogiai duomenų šaltinių (tyrimų, administracinių duomenų) pagrindu arba per išsamumo korekcijas.\r\nGeografinė aprėptis: šalies ekonominė teritorija.\r\nLaiko aprėptis:	nuo 2000 m. iki 2020 m.\r\nMatavimo vienetas (-ai): BVP to meto kainomis – mln. EUR;\r\nAtaskaitinis laikotarpis: kalendoriniai metai', 'https://data.gov.lt/datasets/2461/'),
(81, 4, 'Bendrojo pagrindinio kapitalo formavimas pagal turto ir ekonominės veiklos rūšis (EVRK 2 red., 21), palyginamosiomis kainomis(grandininio susiejimo metodu) (metinis)', '2023-12-18', '2023-12-20', 'Pateikiama statistinė informacija - bendrojo pagrindinio kapitalo formavimas,  palyginamosiomis kainomis (metinis). Bendrojo pagrindinio kapitalo formavimas apima per tam tikrą laikotarpį gamintojų rezidentų įsigytą ilgalaikį turtą, atėmus pardavimus / perleidimus ir pridėjus tam tikrus nesukurto turto vertės padidėjimus dėl gamintojo arba institucinių vienetų gamybinės veiklos. Ilgalaikis turtas yra sukurtas turtas, daugiau nei vienus metus naudojamas gamybai. Naudojamas Ekonominės veiklos rūšių klasifikatorius (https://osp.stat.gov.lt/klasifikatoriai?portletFormName=FPKL500&classifier-version=50&tab=version). Statistinę (tiriamąją) visumą sudaro visi statistiniai stebėjimo vienetai rezidentai. Geografinė aprėptis - šalies ekonominė teritorija.  Laiko aprėptis nuo 1995 m.', 'https://data.gov.lt/datasets/2460/'),
(82, 4, 'Bendrojo pagrindinio kapitalo formavimas pagal turto ir ekonominės veiklos rūšis (EVRK 2 red., 21), to meto kainomis  (metinis)', '2023-12-18', '2023-12-20', 'Pateikiama statistinė informacija - bendrojo pagrindinio kapitalo formavimas, to meto kainomis, pagal turto rūšį, ekonominės veiklos rūšį (metinis). Bendrojo pagrindinio kapitalo formavimas apima per tam tikrą laikotarpį gamintojų rezidentų įsigytą ilgalaikį turtą, atėmus pardavimus / perleidimus ir pridėjus tam tikrus nesukurto turto vertės padidėjimus dėl gamintojo arba institucinių vienetų gamybinės veiklos. Ilgalaikis turtas yra sukurtas turtas, daugiau nei vienus metus naudojamas gamybai. Naudojamas Ekonominės veiklos rūšių klasifikatorius (https://osp.stat.gov.lt/klasifikatoriai?portletFormName=FPKL500&classifier-version=50&tab=version). Statistinę (tiriamąją) visumą sudaro visi statistiniai stebėjimo vienetai rezidentai. Geografinė aprėptis - šalies ekonominė teritorija.  Laiko aprėptis nuo 1995 m.', 'https://data.gov.lt/datasets/2459/'),
(83, 4, 'Bendrojo pagrindinio kapitalo formavimas pagal ekonominės veiklos rūšis (EVRK 2 red., 10) ir regionus, to meto kainomis (metinis)', '2023-12-18', '2023-12-20', 'Pateikiama statistinė informacija - bendrojo pagrindinio kapitalo formavimas, to meto kainomis, regionais, ekonominės veiklos rūšį (metinis). Bendrojo pagrindinio kapitalo formavimas apima per tam tikrą laikotarpį gamintojų rezidentų įsigytą ilgalaikį turtą, atėmus pardavimus / perleidimus ir pridėjus tam tikrus nesukurto turto vertės padidėjimus dėl gamintojo arba institucinių vienetų gamybinės veiklos. Ilgalaikis turtas yra sukurtas turtas, daugiau nei vienus metus naudojamas gamybai. Naudojamas Ekonominės veiklos rūšių klasifikatorius (https://osp.stat.gov.lt/klasifikatoriai?portletFormName=FPKL500&classifier-version=50&tab=version). Statistinę (tiriamąją) visumą sudaro visi statistiniai stebėjimo vienetai rezidentai. Geografinė aprėptis - šalies ekonominė teritorija.  Laiko aprėptis nuo 1995 m.', 'https://data.gov.lt/datasets/2458/'),
(84, 4, 'Išvykusių turistų nakvynių skaičius', '2023-12-18', '2024-01-05', 'Duomenų rinkinys apie Lietuvos nuolatinių gyventojų (toliau – gyventojai), keliaujančių į užsienį, skaičių, jų kelionių, nakvynių skaičių ir tikslus, naudojamą pagrindinę transporto priemonės rūšį ir apgyvendinimo tipą kelionėje bei kelionių išlaidas, lytį, amžių. Pateikta per valstybės, kelionės tikslo, apgyvendinimo įstaigos tipo, laikotarpio, amžiaus dimensijas.\r\n\r\nNaudojami klasifikatoriai: \r\n\r\nLietuvos Respublikos administracinių vienetų ir gyvenamųjų vietovių klasifikatorius (LR AVGVK 2018);\r\n\r\nPasaulio šalių ir teritorijų klasifikatorius.\r\n\r\nStatistinio stebėjimo vienetas: vyresni nei 15 metų amžiaus gyventojai, grįžtantys iš užsienio.\r\n\r\nStatistinė tiriamoji visuma: tiriamąją visumą sudaro gyventojų, grįžtančių iš užsienio, kelionės. Neįskaitomos asmenų kelionės, kurių tikslas lankomoje teritorijoje yra apmokamas darbas.\r\n\r\nGeografinė aprėptis: visa šalies ekonominė teritorija.\r\n\r\nLaiko aprėptis: nuo 2005m., metiniai.', 'https://data.gov.lt/datasets/2448/'),
(85, 4, 'Bendrasis vidaus produktas vienam gyventojui pagal apskritis, to meto kainomis (metinis)', '2023-12-18', '2023-12-27', 'Pateikiama statistinė informacija - bendrasis vidaus produktas tenkantis vienam gyventojui, to meto kainomis (metinis) , pagal apskritis. Statistinę (tiriamąją) visumą sudaro visi statistiniai stebėjimo vienetai rezidentai. Geografinė aprėptis - šalies ekonominė teritorija.  Laiko aprėptis nuo 2000 m.', 'https://data.gov.lt/datasets/2525/'),
(86, 4, 'Išvykusių turistų kelionių skaičius', '2023-12-18', '2023-12-27', 'Duomenų rinkinys apie Lietuvos nuolatinių gyventojų (toliau – gyventojai), keliaujančių į užsienį, skaičių, jų kelionių, nakvynių skaičių ir tikslus, pagal lytį, pagal amžių,pagal naudojamą pagrindinę transporto priemonės rūšį ir apgyvendinimo įstaigos  tipą ir valstybę bei kelionių išlaidas. Pateikta per tikslo valstybės, kelionės tikslo, apgyvendinimo įstaigos tipo, laikotarpio, amžiaus dimensijas. Naudojami klasifikatoriai: Pasaulio šalių ir teritorijų klasifikatorius. Statistinio stebėjimo vienetas: vyresni nei 15 metų amžiaus gyventojai, grįžtantys iš užsienio.. Statistinė tiriamoji visuma: tiriamąją visumą sudaro gyventojų, grįžtančių iš užsienio, kelionės. Neįskaitomos asmenų kelionės, kurių tikslas lankomoje teritorijoje yra apmokamas darbas. Geografinė aprėptis: visa šalies ekonominė teritorija. Laiko aprėptis: nuo 2005m., ketvirtiniai ir metiniai.', 'https://data.gov.lt/datasets/2446/'),
(87, 4, 'Išvykusių turistų skaičius', '2023-12-18', '2023-12-21', 'Duomenų rinkinys apie Lietuvos nuolatinių gyventojų (toliau – gyventojai), keliaujančių į užsienį, skaičių, jų kelionių, nakvynių skaičių ir tikslus, naudojamą pagrindinę transporto priemonės rūšį ir apgyvendinimo tipą kelionėje bei kelionių išlaidas. Pateikta per tikslo valstybės, lyties, kelionės tikslo dimensijas.\r\n\r\nNaudojami klasifikatoriai: \r\n\r\nPasaulio šalių ir teritorijų klasifikatorius.\r\n\r\nStatistinio stebėjimo vienetas: vyresni nei 15 metų amžiaus gyventojai, grįžtantys iš užsienio..\r\n\r\nStatistinė tiriamoji visuma: tiriamąją visumą sudaro gyventojų, grįžtančių iš užsienio, kelionės. Neįskaitomos asmenų kelionės, kurių tikslas lankomoje teritorijoje yra apmokamas darbas.\r\n\r\nGeografinė aprėptis: visa šalies ekonominė teritorija.\r\n\r\nLaiko aprėptis: nuo 2005m., ketvirtiniai ir metiniai.', 'https://data.gov.lt/datasets/2511/'),
(88, 4, 'Išvykusių turistų išlaidos', '2023-12-18', '2024-01-05', 'Duomenų rinkinys apie Lietuvos nuolatinių gyventojų (toliau – gyventojai), keliaujančių į užsienį, kelionių tikslus ir kelionių išlaidas bei apgyvendinimo trukmę, valstybes. Pateikta per tikslo valstybės dimensijas.\r\nNaudojami klasifikatoriai: \r\nLietuvos Respublikos administracinių vienetų ir gyvenamųjų vietovių klasifikatorius (LR AVGVK 2018);\r\nPasaulio šalių ir teritorijų klasifikatorius.\r\nStatistinio stebėjimo vienetas: vyresni nei 15 metų amžiaus gyventojai, grįžtantys iš užsienio.\r\nStatistinė tiriamoji visuma: tiriamąją visumą sudaro gyventojų, grįžtančių iš užsienio, kelionės. Neįskaitomos asmenų kelionės, kurių tikslas lankomoje teritorijoje yra apmokamas darbas.\r\nGeografinė aprėptis: visa šalies ekonominė teritorija.\r\nLaiko aprėptis: nuo 2005m., ketvirtiniai.', 'https://data.gov.lt/datasets/2524/'),
(89, 4, 'BVP, to meto kainomis', '2023-12-18', '2023-12-27', 'Pateikiama statistinė informacija - bendrasis vidaus produktas to meto kainomis pagal apskritis ir išlyginimą (ketvirtinis, metinis). Statistinę (tiriamąją) visumą sudaro visi statistiniai stebėjimo vienetai rezidentai. Geografinė aprėptis - šalies ekonominė teritorija.  Laiko aprėptis nuo 1995m', 'https://data.gov.lt/datasets/2455/'),
(90, 4, 'Pajamos už suteiktas apgyvendinimo paslaugas (be PVM)', '2023-12-18', '2023-12-29', 'Kas ketvirtinės apgyvendinimo paslaugų tiekėjų pajamos (be pvm) pagal apgyvendinimo tipus.\r\nApibrėžtys:\r\nApgyvendinimo įstaiga – vietos veiklos rūšies vienetas, teikiantis mokamas trumpalaikio apgyvendinimo paslaugas turistui. Pajamos už apgyvendinimo paslaugas – apgyvendinimo įstaigos pajamos, uždirbtos per ataskaitinį laikotarpį už suteiktas apgyvendinimo paslaugas turistams. Įskaitomos pajamos už maitinimo, gydymo, reabilitacijos ir kitas turistams suteiktas paslaugas, jeigu jos įskaitytos į apgyvendinimo paslaugos kainą. Juridiniai asmenys, teikiantys apgyvendinimo paslaugas, nepriklausomai nuo pagrindinės ekonominės veiklos rūšies pagal tokias EVRK 2 red. I sekcijos grupes: 55.1 – viešbučių ir panašių laikinų buveinių veikla, 55.2 – poilsiautojų ir kita trumpalaikio apgyvendinimo veikla, 55.3 – poilsinių transporto priemonių, priekabų aikštelių ir stovyklaviečių veikla (toliau – EVRK 2 red. I sekcija, grupės 55.1, 55.2, 55.3). Fiziniai asmenys, dirbantys pagal verslo liudijimą (010, 043 kodai pagal „Verslo liudijimų klasifikatorių“) ar (ir) individualios veiklos pažymą ir teikiantys apgyvendinimo veiklos (EVRK 2 red. I sekcija, grupės 55.1, 55.2, 55.3) paslaugas turistams. \r\nLaiko aprėptis nuo 2012 m.', 'https://data.gov.lt/datasets/2449/'),
(91, 4, 'Vietų skaičius apgyvendinimo įstaigose', '2023-12-18', '2023-12-27', 'Pateikta statistinė informacija apie vietų skaičių apgyvendinimo įstaigose, viešbučio kategoriją, apgyvendinimo tipą, administracinę teritoriją, laikotarpį (metus). Statistinio stebėjimo vienetas - apgyvendinimo įstaiga (vietos veiklos rūšies vienetas). Tiriamąją visumą (populiaciją) sudaro: juridiniai asmenys, teikiantys klasifikuojamąsias* apgyvendinimo paslaugas, nepriklausomai nuo pagrindinės ekonominės veiklos rūšies pagal tokias EVRK 2 red. I sekcijos grupes: 55.1 – viešbučių ir panašių laikinų buveinių veikla, 55.3 – poilsinių transporto priemonių, priekabų aikštelių ir stovyklaviečių veikla (toliau – EVRK 2 red. I sekcija, grupės 55.1, 55.3). Statistinė informacija rengiama šalies lygmeniu. Laiko aprėptis - nuo 2012 m.\r\n\r\n*Pagal Turizmo įstatymo 31 straipsnį apgyvendinimo paslaugos skirstomos į: \r\n1) klasifikuojamąsias apgyvendinimo paslaugas: motelio paslaugas, kempingo paslaugas, svečių namų paslaugas, viešbučio paslaugas; 2) neklasifikuojamąsias apgyvendinimo paslaugas: jaunimo nakvynės namų (angl. hostel) paslaugas, kaimo turizmo paslaugas, poilsio namų paslaugas, privataus apgyvendinimo paslaugas, sanatorijos apgyvendinimo paslaugas, turistinio laivo apgyvendinimo paslaugas, turistinės stovyklos paslaugas. Klasifikuojamąsias apgyvendinimo paslaugas gali teikti apgyvendinimo paslaugų teikėjas, turintis šio įstatymo 33 straipsnyje nustatyta tvarka išduotą galiojantį apgyvendinimo paslaugų klasifikavimo pažymėjimą. Minimalus klasifikuojamųjų apgyvendinimo paslaugų klasifikuojamo objekto (toliau – klasifikuojamas objektas) kambarių ar aikštelių skaičius – ne mažiau kaip 5 kambariai ar aikštelės. Klasifikuojamosios apgyvendinimo paslaugos klasifikuojamos pagal ekonomikos ir inovacijų ministro patvirtintus atitinkamų apgyvendinimo paslaugų klasifikavimo reikalavimus. Pagal teikiamų paslaugų kokybę ir įvairovę klasifikuojamųjų apgyvendinimo paslaugų kokybės lygis ženklinamas žvaigždutėmis, kurių didesnis skaičius reiškia aukštesnį kokybės lygį. Aukščiausias klasifikuojamųjų apgyvendinimo paslaugų kokybės lygis žymimas penkiomis žvaigždutėmis. Viešbučio paslaugų kokybės lygis papildomai gali būti ženklinamas pliuso ženklu.', 'https://data.gov.lt/datasets/2453/'),
(92, 4, 'Numerių skaičius apgyvendinimo įstaigose', '2023-12-18', '2024-01-03', 'Pateikta statistinė informacija apie vietų skaičių apgyvendinimo įstaigose pagal apgyvendinimo tipą, administracinę teritoriją, viešbučio kategoriją, laikotarpį (ketvirtį, metinį). Statistinio stebėjimo vienetas - apgyvendinimo įstaiga (vietos veiklos rūšies vienetas). Naudojami klasifikatoriai: 1) Ekonominės veiklos rūšių klasifikatorius (EVRK 2 red.); 2) Lietuvos Respublikos administracinių vienetų ir gyvenamųjų vietovių klasifikatorius (LR AVGVK 2018); 3) Verslo liudijimų klasifikatorius. Tiriamąją visumą (populiaciją) sudaro: 1) juridiniai asmenys, teikiantys apgyvendinimo paslaugas, nepriklausomai nuo pagrindinės ekonominės veiklos rūšies pagal tokias EVRK 2 red. I sekcijos grupes: 55.1 – viešbučių ir panašių laikinų buveinių veikla, 55.2 – poilsiautojų ir kita trumpalaikio apgyvendinimo veikla, 55.3 – poilsinių transporto priemonių, priekabų aikštelių ir stovyklaviečių veikla (toliau – EVRK 2 red. I sekcija, grupės 55.1, 55.2, 55.3); 2) fiziniai asmenys, dirbantys pagal verslo liudijimą (010, 043 kodai pagal „Verslo liudijimų klasifikatorių“) ar (ir) individualios veiklos pažymą ir teikiantys apgyvendinimo veiklos (EVRK 2 red. I sekcija, grupės 55.1, 55.2, 55.3) paslaugas turistams. Statistinė informacija rengiama šalies, regionų, apskričių ir savivaldybių lygmeniu. Laiko aprėptis - nuo 2012 m.', 'https://data.gov.lt/datasets/2452/'),
(93, 4, 'Savininkų užimtų būstų kainų indekso svoriai', '2023-12-18', '2023-12-22', 'Rinkinyje pateikiama informacija apie savininkų užimtų būstų kainų indekso svorius. Svoris – procentais arba promilėmis išreikšta namų ūkių piniginių išlaidų lyginamoji dalis tam tikrai BKI elementariajai visumai priklausantiems būstams su žeme įsigyti. Kuo didesnis svoris, tuo didesnė tam tikro būsto su žeme klasifikavimo lygio kainų pokyčio įtaka aukštesnio būsto su žeme klasifikavimo lygio kainų pokyčiui. Svorių bazinis laikotarpis – laikotarpis, kurio duomenimis remiantis skaičiuojami indekso svoriai. SUBKI svorių duomenų šaltiniai – nacionalinių sąskaitų duomenys apie bendrojo pagrindinio kapitalo formavimą naujiems būstams, VĮ Registrų centro Nekilnojamojo turto registro ir Sandorių duomenų bazės, Lietuvos banko duomenys apie būsto draudimo įmokas ir išmokas, eksperto parengta gyvenamųjų pastatų sąmatinė dokumentacija. SUBKI svorių bazinis laikotarpis yra t–2 metai, o BKI – t–1 metai.', 'https://data.gov.lt/datasets/2523/'),
(94, 4, 'Savininkų užimtų būstų kainų indeksai', '2023-12-18', '2023-12-22', 'Savininkų užimtų būstų kainų indeksas (toliau – SUBKI) – santykinis rodiklis, kuriuo išreiškiamas namų ūkių sektoriui naujų būstų ir kitų prekių ir paslaugų, kurias namų ūkiai perka kaip būsto savininkai, bendrasis kainų pokytis. SUBKI sudarymo tikslas – turėti su kitomis Europos Sąjungos (ES) valstybėmis narėmis metodologiškai suderintą ir palyginamą rodiklį savininkų užimtų būstų ir su būstų įsigijimu ir nuosavybe susijusių prekių ir paslaugų kainų pokyčiams vertinti. SUBKI reikalingas pinigų politikai formuoti, infliacijos prognozėms rengti ir šalies finansiniam stabilumui vertinti. Sudarant SUBKI namų ūkių išlaidos būstams bei su jų įsigijimu ir nuosavybe susijusioms prekėms ir paslaugoms įsigyti klasifikuojamos į išlaidų kategorijas, nurodytas 2020 m. liepos 31 d. Komisijos reglamente (ES) Nr. 2020/1148, kuriuo pagal Europos Parlamento ir Tarybos reglamentą (ES) 2016/792 nustatomos suderintų vartotojų kainų indeksų ir būsto kainų indekso metodinės ir techninės specifikacijos. SUBKI komponentų kainų subindeksams skaičiuoti naudojami šie klasifikatoriai: Ekonominės veiklos rūšių klasifikatorius (EVRK 2 red.); Statinių pagal tipą klasifikatorius (CC); Europos individualaus vartojimo išlaidų pagal paskirtį klasifikatorius (ECOICOP). Statistinio stebėjimo vienetas - namų ūkio iš kitų sektorių (juridinio asmens, valstybės, savivaldybių) šalies ekonominėje teritorijoje įsigytas ar savininko pastatytas būstas ir su jo įsigijimu ir nuosavybe susijusios prekės ir paslaugos. Būstų tiriamąją visumą sudaro šalies rezidentų ir nerezidentų namų ūkių iš kitų sektorių šalies ekonominėje teritorijoje įsigyjami ar pačių savininkų pastatyti būstai. Įmonių tiriamąją visumą sudaro įmonės, savo jėgomis vykdančios gyvenamųjų namų statybos ir kapitalinio remonto darbus, prekybos įmonės, reprezentuojančios esamą prekybos statybinėmis medžiagomis ir gaminiais įmonių tinklą, paslaugų įmonės, teikiančios su būsto įsigijimu ir nuosavybe susijusias paslaugas (pvz., draudimo). Prekių ir paslaugų statistinę visumą sudaro su būsto įsigijimu ir nuosavybe susijusios prekės ir paslaugos. Duomenys renkami iš visos šalies ekonominės teritorijos nuo 2006m. I ketv. ir atnaujinami kas ketvirtį. Pagrindinis statistinių duomenų šaltinis SUBKI skaičiuoti yra VĮ Registrų centro Nekilnojamojo turto registro ir Sandorių duomenų bazių, papildomai naudojami vartotojų kainų, statybos sąnaudų elementų kainų, statybos darbų kainų statistinių tyrimų duomenys, šalies teises aktai, kurie nustato su būstų įsigijimu ir nuosavybe susijusių paslaugų kainas.', 'https://data.gov.lt/datasets/2522/'),
(95, 4, 'Būsto kainų indekso svoriai', '2023-12-18', '2023-12-22', 'Rinkinyje pateikiami būsto kainų indekso svoriai. Svoris – procentais arba promilėmis išreikšta namų ūkių piniginių išlaidų lyginamoji dalis tam tikrai BKI elementariajai visumai priklausantiems būstams su žeme įsigyti. Kuo didesnis svoris, tuo didesnė tam tikro būsto su žeme klasifikavimo lygio kainų pokyčio įtaka aukštesnio būsto su žeme klasifikavimo lygio kainų pokyčiui. Svorių bazinis laikotarpis – laikotarpis, kurio duomenimis remiantis skaičiuojami indekso svoriai. Atliekamos tokios gautų statistinių duomenų tikrinimo ir redagavimo procedūros: atmetami sandoriai, kuriais įsigyti būstai dėl nepakankamo baigtumo lygio (< 80 proc.) yra netinkami gyventi, analizuojami kiekvienai elementariajai visumai priskirtų būstų pirkimo–pardavimo sandorių duomenys, palyginti su ankstesnių ketvirčių duomenimis. Duomenų redagavimas ir patvirtinimas atliekamas naudojant kompiuterinę kainų statistinių duomenų tikrinimo programą. Gautos kainų kitimo tendencijos lyginamos su nekilnojamojo turto agentūrų užfiksuotomis būsto kainų kitimo tendencijomis. Informacija apie veiksnius, turinčius įtaką būsto kainų pasikeitimui, reguliariai stebima spaudoje, kitų įmonių ir institucijų skelbiamose apžvalgose ir ataskaitose. Pagrindinis statistinių duomenų šaltinis BKI apskaičiuoti yra VĮ Registrų centro Nekilnojamojo turto registro ir Sandorių duomenų bazių duomenys. Šaltinio duomenys gaunami kas ketvirtį. BKI bazinis laikotarpis yra 2015 m. (2015 m. – 100). Kitas BKI bazinio laikotarpio keitimas numatytas 2026 m., buvusi laiko eilutė bus perskaičiuota į naują indekso bazinį laikotarpį ir paskelbta apskaičiavus 2026 m. I ketv. BKI.', 'https://data.gov.lt/datasets/2521/'),
(96, 4, 'Suderinto vartotojų kainų indekso svoriai', '2023-12-15', '2023-12-22', 'Rinkinyje pateikiami suderinto vartotojų kainų indeksos svoriai. Svoris – promilėmis išreikšta namų ūkių piniginių vartojimo išlaidų lyginamoji dalis tam tikrai SVKI elementariajai visumai priklausančioms prekėms ir paslaugoms įsigyti. Kuo didesnis svoris, tuo didesnė tam tikro prekių ir paslaugų klasifikavimo lygio kainų pokyčio įtaka aukštesnio prekių ir paslaugų kainų klasifikavimo lygio kainų pokyčiui. Pagrindiniai šaltiniai lyginamųjų svorių sistemai parengti yra nacionalinių sąskaitų ir namų ūkių biudžetų statistinio tyrimo duomenys apie namų ūkių pinigines išlaidas vartojimo prekėms ir paslaugoms įsigyti. Lyginamųjų svorių sistemai parengti naudojami ir kiti statistinių duomenų šaltiniai: neapskaitytoms namų ūkių išlaidoms įvertinti – vidaus prekybos, transporto, turizmo, energetikos, socialinės statistikos, kitų institucijų ir įmonių statistinė informacija; šalies namų ūkių ir lankytojų iš užsienio piniginėms vartojimo išlaidoms detalizuoti – pramonės, vidaus ir užsienio prekybos, švietimo, transporto, turizmo statistikos, kitų įmonių ir institucijų statistiniai duomenys ir informacija. SVKI svoriai apskaičiuojami nuo 1996 m. sausio mėn. ir apdorojami kas mėnesį.', 'https://data.gov.lt/datasets/2499/'),
(97, 4, 'Metinis nedarbo lygis', '2023-12-15', '2023-12-22', 'Metinė visų nuolatinių Lietuvos gyventojų statistinė informacija apie bedarbių ir ekonomiškai neaktyvių gyventojų skaičių, jų pasiskirstymą pagal amžiaus grupes, lytį, gyvenamąją vietą ir regioną nuo 1998 metų. Rodiklis išreiškiamas bedarbių ir darbo jėgos santykiu. Naudojami LR Administracinių vienetų ir gyvenamųjų vietovių klasifikatorius (LR AVGVK 2018) ir Bendras teritorinių statistinių vienetų klasifikatorius (NUTS).', 'https://data.gov.lt/datasets/2463/'),
(98, 4, 'S1 Visos ekonomikos nefinansinės sąskaitos', '2023-12-15', '2024-01-10', 'Statistinės informacijos aprašymą sudaro nacionalinės sąskaitos – tarptautiniu mastu pripažinta standartizuota statistinių rodiklių sistema, suteikianti galimybę išsamiai atspindėti nacionalinės ekonomikos būklę bei pokyčius ir metinės nefinansinės institucinių sektorių sąskaitos (toliau – „sąskaitos“), sudaromos pagal tarptautiniu mastu pripažintą standartinių statistinių rodiklių sistemą, kuri išsamiai nusako nacionalinės ekonomikos vystymąsi. Pagrindiniai sąskaitų rodikliai vertinami remiantis Europos nacionalinių ir regioninių sąskaitų sistema ESS 2010 (Europos Parlamento ir Tarybos reglamentas (ES) Nr. 549/2013 priedas A). Sąskaitos, apima nefinansines sąskaitas, kurios apibūdina įvairius ekonominio proceso etapus: gamybos, pajamų formavimo, pajamų paskirstymo, pajamų perskirstymo, pajamų panaudojimo ir nefinansinio kaupimo.\r\nKlasifikatoriai: institucinių sektorių ir subsektorių klasifikatorius (Europos Parlamento ir Tarybos reglamento (ES) Nr. 549/2013 A priedas).\r\nStatistinę (tiriamąją) visumą sudaro visi statistiniai stebėjimo vienetai rezidentai; ekonomika kaip visuma, sudaryta iš įvairių institucinių vienetų.\r\nLietuvos nacionalinės sąskaitos yra išsamios; t. y. visi statistiniai vienetai rezidentai yra apimami tiesiogiai duomenų šaltinių (tyrimų, administracinių duomenų) pagrindu arba per išsamumo korekcijas.\r\nGeografinė aprėptis: visa šalies ekonominė teritorija.\r\nMatavimo vienetas (-ai): rodikliai išreiškiami milijonais eurų. \r\nLaiko aprėptis: nuo 1995 m.; nuo 2000 m. iki 2020 m. \r\nAtaskaitinis laikotarpis: kalendoriniai metai.', 'https://data.gov.lt/datasets/2498/'),
(99, 4, 'Suderinti vartotojų kainų indeksai (2015 m. - 100)', '2023-12-15', '2024-01-08', 'Suderintas vartotojų kainų indeksas (SVKI) apskaičiuojamas pagal su kitomis Europos Sąjungos (ES) valstybėmis narėmis suderintą metodologiją. SVKI naudojami infliacijai ES matuoti, palyginimams tarp ES valstybių narių atlikti, Europos centrinio banko pinigų politikai vykdyti, Europos, pinigų sąjungos, Europos ekonominės erdvės vartotojų kainų indeksams skaičiuoti, ES valstybių narių atitikčiai kainų stabilumo kriterijui vertinti (pagal Sutarties dėl Europos Sąjungos veikimo 140 straipsnio 1 dalį ir Protokolą Nr. 13 „Dėl konvergencijos kriterijų“). Rinkinyje naudojamas Europos individualaus vartojimo išlaidų pagal paskirtį (ECOICOP) klasifikatorius. Į rinkinį įtraukti visi šalyje esantys namų ūkiai, įskaitant šalyje nuolat negyvenančius asmenis ir lankytojus iš užsienio; vartojimo prekės ir paslaugos, kurias įsigyja namų ūkiai. Statistinio stebėjimo vienetas - vartojimo prekės ir paslaugos, kurias šalies nuolatiniai ir nenuolatiniai gyventojai įsigyja prekybos ir paslaugų įmonėse ir vietos vienetuose individualiems vartojimo poreikiams tenkinti. Įmonių ir vietos vienetų tiriamąją visumą sudaro visų nuosavybės formų, įvairių tipų, įvairaus dydžio prekybos ir paslaugų įmonės ir vietos vienetai (2023 m. tiriamąją imtį sudaro apie 4 400 atrinktų įmonių ir vietos vienetų). Prekių ir paslaugų statistinę visumą sudaro namų ūkių šalies ekonominėje teritorijoje įsigyjamos vartojimo prekės ir paslaugos (2023 m. tiriamąją imtį sudaro 982 reprezentatyvioji prekė ir paslauga). Namų ūkių statistinė visuma yra visi šalyje esantys namų ūkiai įskaitant institucinius namų ūkius, šalyje nuolat negyvenančius asmenis ir lankytojus iš užsienio. Namų ūkių sektorius apima visus asmenis ar asmenų grupes, neatsižvelgiant į tai, kur jie gyvena, kokią vietą užima pajamų pasiskirstyme, jų tautybę bei pilietybę. SVKI aprėpia namų ūkių pinigines vartojimo išlaidas šalies ekonominėje teritorijoje. SVKI apima visą šalies ekonominę teritoriją. Ją sudaro šalies geografinė teritorija, kurią administruoja šalies vyriausybė ir kurioje laisvai juda asmenys, prekės ir kapitalas. Lietuvos ekonominę teritoriją SVKI reprezentuoja 18 teritorinių vienetų (10 apskričių ir 8 rajonų centrai), atrinktų kainoms tirti. Kainos renkamos mažuose, vidutiniuose ir 5 didžiausiuose šalies miestuose, kurių gyventojų skaičius sudaro nuo 5,5 tūkst. (mažų miestų) iki 540 tūkst. (didžiųjų miestų) gyventojų. Maisto produktų, nealkoholinių ir alkoholinių gėrimų bei tabako gaminių kainos papildomai registruojamos 10 kaimo vietovių. Bazinis laikotarpis yra 2015 m. (2015 m. – 100).', 'https://data.gov.lt/datasets/2497/'),
(100, 4, 'Suderinti vartotojų kainų indeksai pagal pastovius mokesčių tarifus (2015 m. – 100)', '2023-12-15', '2023-12-22', 'Suderintas vartotojų kainų indeksas (SVKI) apskaičiuojamas pagal su kitomis Europos Sąjungos (ES) valstybėmis narėmis suderintą metodologiją. Rinkinyje pateikiamas SVKI pagal pastovius mokesčių tarifus. SVKI naudojami infliacijai ES matuoti, palyginimams tarp ES valstybių narių atlikti, Europos centrinio banko pinigų politikai vykdyti, Europos, pinigų sąjungos, Europos ekonominės erdvės vartotojų kainų indeksams skaičiuoti, ES valstybių narių atitikčiai kainų stabilumo kriterijui vertinti (pagal Sutarties dėl Europos Sąjungos veikimo 140 straipsnio 1 dalį ir Protokolą Nr. 13 „Dėl konvergencijos kriterijų“). Rinkinyje naudojamas Europos individualaus vartojimo išlaidų pagal paskirtį (ECOICOP) klasifikatorius. Į rinkinį įtraukti visi šalyje esantys namų ūkiai, įskaitant šalyje nuolat negyvenančius asmenis ir lankytojus iš užsienio; vartojimo prekės ir paslaugos, kurias įsigyja namų ūkiai. Statistinio stebėjimo vienetas - vartojimo prekės ir paslaugos, kurias šalies nuolatiniai ir nenuolatiniai gyventojai įsigyja prekybos ir paslaugų įmonėse ir vietos vienetuose individualiems vartojimo poreikiams tenkinti. Įmonių ir vietos vienetų tiriamąją visumą sudaro visų nuosavybės formų, įvairių tipų, įvairaus dydžio prekybos ir paslaugų įmonės ir vietos vienetai (2023 m. tiriamąją imtį sudaro apie 4 400 atrinktų įmonių ir vietos vienetų). Prekių ir paslaugų statistinę visumą sudaro namų ūkių šalies ekonominėje teritorijoje įsigyjamos vartojimo prekės ir paslaugos (2023 m. tiriamąją imtį sudaro 982 reprezentatyvioji prekė ir paslauga). Namų ūkių statistinė visuma yra visi šalyje esantys namų ūkiai įskaitant institucinius namų ūkius, šalyje nuolat negyvenančius asmenis ir lankytojus iš užsienio. Namų ūkių sektorius apima visus asmenis ar asmenų grupes, neatsižvelgiant į tai, kur jie gyvena, kokią vietą užima pajamų pasiskirstyme, jų tautybę bei pilietybę. SVKI aprėpia namų ūkių pinigines vartojimo išlaidas šalies ekonominėje teritorijoje. SVKI apima visą šalies ekonominę teritoriją. Ją sudaro šalies geografinė teritorija, kurią administruoja šalies vyriausybė ir kurioje laisvai juda asmenys, prekės ir kapitalas. Lietuvos ekonominę teritoriją SVKI reprezentuoja 18 teritorinių vienetų (10 apskričių ir 8 rajonų centrai), atrinktų kainoms tirti. Kainos renkamos mažuose, vidutiniuose ir 5 didžiausiuose šalies miestuose, kurių gyventojų skaičius sudaro nuo 5,5 tūkst. (mažų miestų) iki 540 tūkst. (didžiųjų miestų) gyventojų. Maisto produktų, nealkoholinių ir alkoholinių gėrimų bei tabako gaminių kainos papildomai registruojamos 10 kaimo vietovių. Bazinis laikotarpis yra 2015 m. (2015 m. – 100).', 'https://data.gov.lt/datasets/2496/'),
(101, 4, 'Aplinkosaugos ir aplinkai palankių prekių ir paslaugų sektoriaus užimtumas', '2023-12-15', '2024-01-03', 'Aplinkosaugos ir aplinkai palankių prekių ir paslaugų sektoriaus užimtumas. 	\r\nŽaliųjų prekių ir paslaugų sektoriaus sąskaitų rengimo tikslas yra rinkti ir skelbti nacionalinių ūkių gamybinės veiklos, kurią vykdant sukuriami žalieji produktai, statistiką pagal šiuos rodiklius:\r\n– rinkos produkcija, iš kurios eksportas, ne rinkos produkcija ir pagalbinės veiklos produkcija,\r\n– rinkos veiklos, ne rinkos veiklos ir pagalbinės veiklos pridėtinė vertė,\r\n– rinkos veiklos, ne rinkos veiklos ir pagalbinės veiklos užimtumas. \r\nNaudojami klasifikatoriai:\r\nEkonominės veiklos rūšių klasifikatorius (EVRK 2 red.);\r\nAplinkos apsaugos veiklos ir išlaidų klasifikatorius  (CEPA 2000);\r\nIšteklių valdymo veiklos klasifikatorius (CReMA)\r\nGeografinė aprėptis: Visa šalies ekonominė teritorija\r\nLaiko aprėptis: Nuo 2010 m.', 'https://data.gov.lt/datasets/2490/'),
(102, 4, 'Aplinkosaugos ir aplinkai palankių prekių ir paslaugų sektoriaus produkcija', '2023-12-15', '2024-01-03', 'Aplinkosaugos ir aplinkai palankių prekių ir paslaugų sektoriaus produkcija. 	\r\nŽaliųjų prekių ir paslaugų sektoriaus sąskaitų rengimo tikslas yra rinkti ir skelbti nacionalinių ūkių gamybinės veiklos, kurią vykdant sukuriami žalieji produktai, statistiką pagal šiuos rodiklius:\r\n– rinkos produkcija, iš kurios eksportas, ne rinkos produkcija ir pagalbinės veiklos produkcija,\r\n– rinkos veiklos, ne rinkos veiklos ir pagalbinės veiklos pridėtinė vertė,\r\n– rinkos veiklos, ne rinkos veiklos ir pagalbinės veiklos užimtumas.\r\nNaudojami klasifikatoriai:\r\nEkonominės veiklos rūšių klasifikatorius (EVRK 2 red.);\r\nAplinkos apsaugos veiklos ir išlaidų klasifikatorius  (CEPA 2000);\r\nIšteklių valdymo veiklos klasifikatorius (CReMA)\r\nGeografinė aprėptis: Visa šalies ekonominė teritorija\r\nLaiko aprėptis: Nuo 2010 m.', 'https://data.gov.lt/datasets/2489/');
