(103, 4, 'Aplinkosaugos ir aplinkai palankių prekių ir paslaugų sektoriaus eksportas', '2023-12-15', '2024-01-03', 'Aplinkosaugos ir aplinkai palankių prekių ir paslaugų sektoriaus eksportas. 	\r\nŽaliųjų prekių ir paslaugų sektoriaus sąskaitų rengimo tikslas yra rinkti ir skelbti nacionalinių ūkių gamybinės veiklos, kurią vykdant sukuriami žalieji produktai, statistiką pagal šiuos rodiklius:\r\n– rinkos produkcija, iš kurios eksportas, ne rinkos produkcija ir pagalbinės veiklos produkcija,\r\n– rinkos veiklos, ne rinkos veiklos ir pagalbinės veiklos pridėtinė vertė,\r\n– rinkos veiklos, ne rinkos veiklos ir pagalbinės veiklos užimtumas.\r\nNaudojami klasifikatoriai:\r\nEkonominės veiklos rūšių klasifikatorius (EVRK 2 red.);\r\nAplinkos apsaugos veiklos ir išlaidų klasifikatorius  (CEPA 2000);\r\nIšteklių valdymo veiklos klasifikatorius (CReMA)\r\nGeografinė aprėptis: Visa šalies ekonominė teritorija\r\nLaiko aprėptis: Nuo 2010 m.', 'https://data.gov.lt/datasets/2488/'),
(104, 4, 'Aplinkosaugos ir aplinkai palankių prekių ir paslaugų sektoriaus bendroji pridėtinė vertė', '2023-12-15', '2024-01-03', 'Aplinkosaugos ir aplinkai palankių prekių ir paslaugų sektoriaus bendroji pridėtinė vertė. 	\r\nŽaliųjų prekių ir paslaugų sektoriaus sąskaitų rengimo tikslas yra rinkti ir skelbti nacionalinių ūkių gamybinės veiklos, kurią vykdant sukuriami žalieji produktai, statistiką pagal šiuos rodiklius:\r\n– rinkos produkcija, iš kurios eksportas, ne rinkos produkcija ir pagalbinės veiklos produkcija,\r\n– rinkos veiklos, ne rinkos veiklos ir pagalbinės veiklos pridėtinė vertė,\r\n– rinkos veiklos, ne rinkos veiklos ir pagalbinės veiklos užimtumas.\r\nNaudojami klasifikatoriai:\r\nEkonominės veiklos rūšių klasifikatorius (EVRK 2 red.);\r\nAplinkos apsaugos veiklos ir išlaidų klasifikatorius  (CEPA 2000);\r\nIšteklių valdymo veiklos klasifikatorius (CReMA)\r\nGeografinė aprėptis: Visa šalies ekonominė teritorija\r\nLaiko aprėptis: Nuo 2010 m.', 'https://data.gov.lt/datasets/2487/'),
(105, 4, 'Su aplinka susiję vartotojų mokesčiai', '2023-12-15', '2023-12-22', 'Su aplinka susiję vartotojų mokesčiai (pagal vartotojų grupes). \r\nSu aplinka susijęs mokestis – mokestis, kurio mokesčio bazė yra tam tikro įrodyto specifinio neigiamą poveikį aplinkai turinčio reiškinio fizinis vienetas (ar fizinio vieneto pakaitinis rodiklis) ir kuris pagal Europos sąskaitų sistemą (ESS) yra priskiriamas mokesčiams. \r\nSu aplinka susiję mokesčiai priskiriami šioms ESS 2010 kategorijoms: \r\n- gamybos ir importo mokesčiai (D.2); \r\n- einamieji pajamų, turto mokesčiai ir kt. (D.5); \r\n- kapitalo mokesčiai (D.91). \r\nNaudojami klasifikatoriai: \r\nEkonominės veiklos rūšių klasifikatorius (EVRK 2 red.);\r\nGeografinė aprėptis: Visa šalies ekonominė teritorija. \r\nLaiko aprėptis: Nuo 2008 m.', 'https://data.gov.lt/datasets/2486/'),
(106, 4, 'Su aplinka susiję mokesčiai', '2023-12-15', '2023-12-22', 'Su aplinka susiję mokesčiai pagal EVRK kodus. \r\nSu aplinka susijęs mokestis – mokestis, kurio mokesčio bazė yra tam tikro įrodyto specifinio neigiamą poveikį aplinkai turinčio reiškinio fizinis vienetas (ar fizinio vieneto pakaitinis rodiklis) ir kuris pagal Europos sąskaitų sistemą (ESS) yra priskiriamas mokesčiams. \r\nSu aplinka susiję mokesčiai priskiriami šioms ESS 2010 kategorijoms: \r\n- gamybos ir importo mokesčiai (D.2); \r\n- einamieji pajamų, turto mokesčiai ir kt. (D.5); \r\n- kapitalo mokesčiai (D.91). \r\nNaudojami klasifikatoriai: \r\nEkonominės veiklos rūšių klasifikatorius (EVRK 2 red.);\r\nGeografinė aprėptis: Visa šalies ekonominė teritorija. \r\nLaiko aprėptis: Nuo 2008 m.', 'https://data.gov.lt/datasets/2485/'),
(107, 4, 'Medžiagų vidaus vartojimas', '2023-12-15', '2023-12-22', 'Medžiagų vidaus vartojimas (bendras, metinis). \r\nMedžiagų vidaus vartojimas (MVV) parodo vienetų rezidentų bendrą suvartojamų medžiagų kiekį.\r\nGeografinė aprėptis: Visa šalies ekonominė teritorija\r\nLaiko aprėptis: Nuo 2008 m.', 'https://data.gov.lt/datasets/2484/'),
(108, 4, 'Medžiagų srautų sąskaitos', '2023-12-15', '2023-12-22', 'Medžiagų srautų sąskaitos (pagal žaliavų ir medžiagų rūšis).\r\nŠalies ūkio medžiagų srautų sąskaitų (ŠŪ-MSS) sudarymo tikslas yra parengti su kitomis Europos Sąjungos (ES) valstybėmis narėmis palyginamus rodiklius. ŠŪ-MSS tiesiogiai prisideda prie ES politikos prioritetų, susijusių su Žaliojo augimo strategija ir efektyvaus išteklių naudojimo iniciatyva, ir, pagal suderintą su JT nacionalinių sąskaitų sistemą (NSS) ir jos Europos versiją (ESS), teikia informaciją apie medžiagų srautus. ŠŪMSS tinka integruotos aplinkos ir ekonomikos sąveikos analizei ir modeliavimui.\r\nMedžiagų vidaus vartojimas (MVV) parodo vienetų rezidentų bendrą suvartojamų medžiagų kiekį.\r\nVidaus medžiagų gavyba (VMG) – metinis kietųjų, skystųjų ir dujinių medžiagų (išskyrus vandenį) vienetų rezidentų gautų iš gamtinės aplinkos ir skirtų naudoti ekonominėje veikloje, kiekis.\r\nPrekių ir paslaugų eksportas (PPE) – prekių ir paslaugų sandoriai (pardavimas, mainai, dovanojimas), kai rezidentai perleidžia ekonominės nuosavybės teises nerezidentams.\r\nPrekių ir paslaugų importas (PPI) – prekių ir paslaugų sandoriai (pardavimas, mainai, dovanojimas), kai nerezidentai perleidžia ekonominės nuosavybės teises rezidentams.\r\nTiesioginės medžiagų sąnaudos (TMS) – visos gamybai ir paslaugoms sunaudojamos medžiagos, įskaitant medžiagas, sunaudotas importuojamiems gaminiams.\r\nNaudojami klasifikatoriai:\r\nŠŪ-MSS Medžiagų tipų klasifikatorius, pateikiamas 2011 m. liepos 6 d. Europos Parlamento ir Tarybos reglamento (ES) Nr. 691/2011 dėl Europos aplinkos ekonominių sąskaitų III priede.\r\nGeografinė aprėptis: Visa šalies ekonominė teritorija\r\nLaiko aprėptis: Nuo 2008 m.', 'https://data.gov.lt/datasets/2483/'),
(109, 4, 'Medžiagų srautų pėdsakas (žaliavų ekvivalentais)', '2023-12-15', '2023-12-22', 'Duomenų rinkinys tiesiogiai prisideda prie ES politikos prioritetų, susijusių su Žaliojo augimo strategija ir efektyvaus išteklių naudojimo iniciatyva, ir, pagal suderintą su JT nacionalinių sąskaitų sistemą (NSS) ir jos Europos versiją (ESS), teikia informaciją apie medžiagų srautus.\r\nNaudojami klasifikatoriai: ŠŪ-MSS Medžiagų tipų klasifikatorius, pateikiamas 2011 m. liepos 6 d. Europos Parlamento ir Tarybos reglamento (ES) Nr. 691/2011 dėl Europos aplinkos ekonominių sąskaitų III priede.\r\nStatistinio stebėjimo vienetas: šalies ūkis\r\nStatistinė tiriamoji visuma: į ŠŪ-MSS įtraukiamos visos kietosios, dujinės ir skystosios medžiagos, išskyrus oro ir vandens srautus, kurios matuojamos tūkstančiais tonų per metus.\r\nŠŪ-MSS sistemoje yra du medžiagų srautų, kertančių sistemos ribas, tipai: \r\nmedžiagų srautai tarp nacionalinio ūkio ir jo gamtinės aplinkos. Tai medžiagų (t. y. žalių, grynų ar neapdorotų) gavyba iš gamtinės aplinkos ir medžiagų (dažnai vadinamų atliekomis) šalinimas šioje aplinkoje;\r\nmedžiagų srautai tarp šalies ūkio ir kitų pasaulio šalių ūkių. Tai apima importą ir eksportą. Į ŠŪ-MSS įtraukiami šias sistemų ribas kertantys srautai, taip pat žmonių sukurtų atsargų papildymai. Visi kiti šalies ūkio medžiagų srautai ŠŪ-MSS nenurodomi. Tai reiškia, kad ŠŪ-MSS sistemoje nacionalinis ūkis laikomas visuma ir, pavyzdžiui, produktų pristatymas iš vieno sektoriaus į kitą nėra aprašomas. Taip pat neįtraukiami ir natūralūs srautai gamtinėje aplinkoje. \r\nEkonomikos sektorius traktuojamas kaip „juodoji dėžė“ ir medžiagų srautų transformacija ar persiskirstymas jos viduje neanalizuojamas, o apsiribojama tik įeinančiais ir išeinančiais medžiagų srautais.\r\nGeografinė aprėptis: visa šalies ekonominė teritorija\r\nLaiko aprėptis: nuo 2008 m.', 'https://data.gov.lt/datasets/2482/'),
(110, 4, 'Teršalų išmetimas į atmosferą', '2023-12-15', '2023-12-20', 'Teršalų išmetimas į atmosferą pagal EVRK kodus. Į orą išmetami teršalai – iš nacionalinio ūkio (gamybos ar vartojimo procesų) į atmosferą (kuri yra aplinkos dalis) patenkantis fizinis dujinių ar kietųjų dalelių medžiagų srautas.\r\n\r\nNaudojami klasifikatoriai:\r\nEkonominės veiklos rūšių klasifikatorius (EVRK 2 red.)\r\n\r\nRemiantis Europos Parlamento ir Tarybos Reglamentu (ES) Nr. 691/2011 dėl Europos aplinkos ekonominių sąskaitų, rengiami statistiniai duomenys apie šiuos į orą išmetamus teršalus: anglies dioksidą (CO2), išskyrus išsiskiriantį iš biomasės; anglies dioksidą iš biomasės (biomasės CO2); azoto oksidą (N2O); metaną (CH4); perfluorangliavandenilius (PFCs); hidrofluorangliavandenilius (HFCs); sieros heksafluoridą (SF6); azoto oksidus (NOx); nemetano lakiuosius organinius junginius (NMVOCs); anglies monoksidą (CO); kietąsias daleles < 10 mikronų (PM10); kietąsias daleles < 2,5 mikronų (PM2,5); sieros dioksidą (SO2); amoniaką (NH3).\r\n\r\nGeografinė aprėptis: Visa šalies teritorija\r\n\r\nLaiko aprėptis: Nuo 2008 m.', 'https://data.gov.lt/datasets/2481/'),
(111, 4, 'Namų ūkių teršalų kiekis, išmestas į atmosferą', '2023-12-15', '2023-12-20', 'Namų ūkių teršalų kiekis, išmestas į atmosferą. Į orą išmetami teršalai – iš nacionalinio ūkio (gamybos ar vartojimo procesų) į atmosferą (kuri yra aplinkos dalis) patenkantis fizinis dujinių ar kietųjų dalelių medžiagų srautas.\r\n\r\nNaudojami klasifikatoriai:\r\nRemiantis Europos Parlamento ir Tarybos Reglamentu (ES) Nr. 691/2011 dėl Europos aplinkos ekonominių sąskaitų, rengiami statistiniai duomenys apie šiuos į orą išmetamus teršalus: anglies dioksidą (CO2), išskyrus išsiskiriantį iš biomasės; anglies dioksidą iš biomasės (biomasės CO2); azoto oksidą (N2O); metaną (CH4); perfluorangliavandenilius (PFCs); hidrofluorangliavandenilius (HFCs); sieros heksafluoridą (SF6); azoto oksidus (NOx); nemetano lakiuosius organinius junginius (NMVOCs); anglies monoksidą (CO); kietąsias daleles < 10 mikronų (PM10); kietąsias daleles < 2,5 mikronų (PM2,5); sieros dioksidą (SO2); amoniaką (NH3).\r\n\r\nGeografinė aprėptis: Visa šalies teritorija\r\n\r\nLaiko aprėptis: Nuo 2008 m.', 'https://data.gov.lt/datasets/2480/'),
(112, 4, 'BVP indeksai', '2023-12-15', '2024-01-05', 'Statistinės informacijos aprašymas: bendrasis vidaus produktas (BVP) – vienas iš pagrindinių nacionalinių sąskaitų sistemos (NSS) rodiklių, apibūdinančių šalies ekonomikos išsivystymo lygį. BVP, jo kitimo tempas ir bendrosios nacionalinės pajamos (BNP) plačiai naudojami tarptautiniams palyginimams ir ekonominei analizei atlikti. Statistinio stebėjimo vienetas: nacionalinės sąskaitos, apimančios ekonomiką, kaip visumą, kurią sudaro skirtingi instituciniai vienetai. Statistinę (tiriamąją) visumą sudaro visi statistiniai stebėjimo vienetai rezidentai. Lietuvos nacionalinės sąskaitos yra išsamios, t. y., visi statistiniai vienetai rezidentai yra apimami tiesiogiai duomenų šaltinių (tyrimų, administracinių duomenų) pagrindu arba per išsamumo korekcijas. Geografinė aprėptis: šalies ekonominė teritorija. \r\nLaiko aprėptis: nuo 1995 m. I ketvirčio. \r\nMatavimo vienetas (-ai): indeksai – proc.\r\nAtaskaitinis laikotarpis: kalendorinis ketvirtis.', 'https://data.gov.lt/datasets/2472/'),
(113, 13, 'Hidrologiniai stebėjimai', '2023-12-14', '2024-02-27', 'Prieiga prie 95 vandens matavimo stočių 30 dienų hidrologinių stebėjimų duomenų. Duomenis sudaro valandiniai vandens lygio ir vandens temperatūros duomenys. Daugiau informacijos – api.meteo.lt', 'https://data.gov.lt/datasets/2462/'),
(114, 4, 'B1g Bendroji pridėtinė vertė,  palyginamosiomis kainomis (grandininio susiejimo metodu)', '2023-12-14', '2023-12-20', 'Pateikiama statistinė informacija - bendroji pridėtinė vertė (BPV) , palyginamosiomis kainomis (grandininio susiejimo metodu) pagal ekonominės veiklos rūšis, išlygininmą (ketvirtinis, metinis) . Naudojamas Ekonominės veiklos rūšių klasifikatorius (https://osp.stat.gov.lt/klasifikatoriai?portletFormName=FPKL500&classifier-version=50&tab=version). Statistinę (tiriamąją) visumą sudaro visi statistiniai stebėjimo vienetai rezidentai. Geografinė aprėptis - šalies ekonominė teritorija.  Laiko aprėptis nuo 1995 m.', 'https://data.gov.lt/datasets/2457/'),
(115, 4, 'B1g Bendroji pridėtinė vertė, to meto kainomis', '2023-12-14', '2023-12-27', 'Pateikiama statistinė informacija - bendroji pridėtinė vertė (BPV) , palyginamosiomis kainomis (grandininio susiejimo metodu), pagal ekonominės veiklos rūšį, apskritis išlyginimą, (ketvirtinis, metinis). Naudojamas Ekonominės veiklos rūšių klasifikatorius (https://osp.stat.gov.lt/klasifikatoriai?portletFormName=FPKL500&classifier-version=50&tab=version). Statistinę (tiriamąją) visumą sudaro visi statistiniai stebėjimo vienetai rezidentai. Geografinė aprėptis - šalies ekonominė teritorija.  Laiko aprėptis nuo 1995 m.', 'https://data.gov.lt/datasets/2456/'),
(116, 4, 'Energijos suvartojimas', '2023-12-14', '2023-12-22', 'Fizinių energijos srautų sąskaitų (FESS) rengimo tikslas – parengti tikslią ir palyginamą statistinę informaciją apie gamtinių energijos išteklių, energetikos produktų, energetinių liekanų fizinius energijos srautus, patenkančius į nacionalinį ūkį, cirkuliuojančius ūkyje ir patenkančius į kitus ūkius arba į aplinką. Tyrimas aprėpia visas ekonominės veiklos rūšis pagal EVRK 2 red. Statistinio stebėjimo vienetas - ūkio subjektas, įskaitant namų ūkį. Statistinė tiriamoji visuma - šalies venetai rezidentai ir nerezidentai, kurie gali būti ir juridiniai vienetai, ir fiziniai asmenys.', 'https://data.gov.lt/datasets/2441/'),
(117, 14, 'AB „Kelių priežiūra\" karjerai', '2023-12-13', '2023-12-13', 'AB „Kelių priežiūra\" veikloje eksploatuojamų karjerų lokacijų duomenys.', 'https://data.gov.lt/datasets/2439/'),
(118, 14, 'Lietuvos valstybinių kelių priežiūros lygiai.', '2023-12-12', '2023-12-12', 'Duomenys yra apie „Kelių priežiūros“ prižiūrimus valstybinės reikšmės kelius. Savivaldybių vietinės reikšmės kelių informacijos duomenyse nėra. \r\n\r\nKelių priežiūra vykdoma pagal Lietuvos automobilių kelių direkcijos parengtus reikalavimus – Kelių priežiūros vadovą.\r\n\r\nLietuvos valstybinės reikšmės keliai, atsižvelgiant į eismo intensyvumą ir svarbą, yra suskirstyti į: magistralinius, krašto ir rajoninius kelius. Žiemos priežiūros darbai skirstomi į priežiūros lygius: I, II ir III.\r\n\r\n---\r\nhttp://kpl.keliuprieziura.lt/', 'https://data.gov.lt/datasets/2438/'),
(119, 8, 'Statiniai ir su jais susiję dokumentai Lietuvos Respublikos statybos leidimų ir statybos valstybinės priežiūros informacinėje sistemoje „Infostatyba“', '2023-12-05', '2023-12-05', 'Atveriamų duomenų objektas - IS \"Infostatyba\"statiniai ir su jais susiję projektų duomenys bei kiti su statiniais susiję dokumentai.', 'https://data.gov.lt/datasets/1000/'),
(120, 15, 'Ataskaita apie perkančiųjų organizacijų įvykdytus pirkimus per CPO LT el. katalogą 2023 m. III ketv.', '2023-12-04', '2023-12-04', '', 'https://data.gov.lt/datasets/2386/'),
(121, 16, 'SARS-CoV-2 copy number in wastewater samples', '2023-11-24', '2023-11-30', '', 'https://data.gov.lt/datasets/2384/'),
(122, 17, 'Respublikinio Priklausomybės Ligų Centro studentų, atliekančių praktiką gydymo įstaigoje, duomenys', '2023-11-08', '2023-12-01', 'Šiame duomenų rinkinyje pateikiami studentų atlikusių praktiką ar savanorišką veiklą RPLC duomenys.', 'https://data.gov.lt/datasets/2383/'),
(123, 17, 'Respublikinio Priklausomybės Ligų Centro Vilniaus filialo stacionaro skyriuose gydytų pacientų duomenys', '2023-11-08', '2023-12-12', 'Šiame duomenų rinkinyje  pateikiami RPLC Vilniaus filiale stacionarines paslaugas gavusių pacientų duomenys.', 'https://data.gov.lt/datasets/2382/'),
(124, 17, 'Respublikinio Priklausomybės Ligų Centro Vilniaus filialo ambulatorinių skyrių pacientų apsilankymų duomenys', '2023-11-08', '2023-12-12', 'Šiame duomenų rinkinyje  pateikiami RPLC Vilniaus filiale ambulatorines paslaugas gavusių pacientų duomenys.', 'https://data.gov.lt/datasets/2381/'),
(125, 4, 'Gamintojų parduotos pramonės produkcijos kainų indeksai (2015 m. - 100)', '2023-10-30', '2023-12-27', 'Rinkinyje pateikiami duomenys apie Lietuvos gamintojų parduotos pramonės produkcijos bendrą kainų pokytį per mėnesio laikotarpį. Rinkinys reikalingas įvairiems rodikliams palyginamosiomis kainomis skaičiuoti, ekonomikos raidai analizuoti, Lietuvos gamintojų parduotos pramonės produkcijos kainų pokyčiams vertinti. Pateikta per Ekonominės veiklos rūšies (EVRK 2 red.) ir rinkos dimensijas. \r\nNaudojami klasifikatoriai: \r\n1) Produktų, gaminių ir paslaugų klasifikatorius (PGPK 2019); \r\n2) Ekonominės veiklos rūšių klasifikatorius (EVRK 2 red.); \r\n3) Pasaulio šalių ir teritorijų klasifikatorius. \r\nStatistinio stebėjimo vienetas: įmonė. \r\nStatistinė tiriamoji visuma: atrenkamos įvairių nuosavybės formų įmonės, kurios vykdo pramoninę veiklą. Tai įmonės gamintojos, kurių parduotos Lietuvos ir ne Lietuvos rinkoje pramonės produkcijos apimtis sudaro didelę atitinkamos gaminių kategorijos (10 ženklų lygiu pagal PGPK 2019) parduotos produkcijos dalį. \r\nGeografinė aprėptis: Visa šalies ekonominė teritorija. \r\nLaiko aprėptis: nuo 1998 m. sausio mėn. \r\nPeriodiškumas – mėnesinis.', 'https://data.gov.lt/datasets/2379/'),
(126, 18, 'Humanitarinės pagalbos teikimas trečiosioms šalims', '2023-10-26', '2023-11-29', 'Sveikatos apsaugos ministerijos Ekstremalių sveikatai situacijų centras atsižvelgdamas į šalių, kurios susiduria su nenumatytomis grėsmėmis ir krizėmis bei negali pačios susidoroti su jų padariniais savo jėgomis, pagalbos prašymus, inicijuoja humanitarinę ir civilinę pagalbą medicinos įranga, asmens apsaugos priemonėmis, vaistais bei vakcinomis. Duomenys apie suteiktą humanitarinę ar civilinę pagalbą atveriami du kartus per metus. Šalių ir institucijų bendradarbiavimas, dalijimasis patirtimi ir ištekliais padeda greičiau ir veiksmingiau reaguoti į ekstremalias situacijas. Atveriami duomenys suteikia galimybę įvertinti kaip yra panaudojami valstybės resursai, paskirstomos lėšos, užtikrinti, kad parama būtų teikiama nešališkai ir skaidriai. Paramos teikimo metu įgytos žinios padeda gerinti humanitarinės ir civilinės pagalbos teikimo mechanizmą Lietuvoje.', 'https://data.gov.lt/datasets/2378/'),
(127, 18, 'Gyventojų aprūpinimas stabiliojo jodo preparatais pagal savivaldybes', '2023-10-18', '2023-11-29', 'Sveikatos apsaugos ministerijos Ekstremalių sveikatai situacijų centras, vykdydamas gyventojų aprūpinimo kalio jodidu stebėseną, ne rečiau kaip kartą per šešis mėnesius (einamųjų metų balandžio 1 d. ir spalio 1 d.)  surenka informaciją apie gyventojų aprūpinimą kalio jodidu iš 16 savivaldybių, kurių teritorijos patenka į skubių apsaugomųjų veiksmų zoną (30 km) ir į išplėstinio planavimo atstumą nuo Baltarusijos atominės elektrinės.', 'https://data.gov.lt/datasets/2371/'),
(128, 2, 'Nestatutinių valstybės tarnautojų pareigybių statistika', '2023-10-13', '2023-11-06', 'Aktuali nestatutinių valstybės tarnautojų pareigybių statistika pagal Valstybės ir savivaldybių institucijas bei įstaigas. Pareigybių statistika skaičiuojama kaip įsteigtų pareigybių suma (sumuojant etatus, nes pareigybė gali sudaryti ir ne pilną etatą). Pareigybės - tai įstaigos turimos ar suplanuotos, bet nebūtinai užpildytos įvairių tipų darbo pozicijos; įsteigtų pareigybių skaičius gali skirtis nuo užimtų pareigybių skaičiaus ar tarnautojų skaičiaus. Nestatutiniai valstybės tarnautojai - tai, pvz., įstaigų vadovai, patarėjai, padėjėjai, specialistai; dažniausiai tai nėra visi įstaigoje dirbantys darbuotojai. Duomenų šaltinis - VATIS ir VATARAS. Rodomos tik šiuo metu egzistuojančios įstaigos, turinčios bent vieną tokio tipo pareigybę. Dėl techninių klausimų kreiptis į atverimas@stat.gov.lt.', 'https://data.gov.lt/datasets/1240/'),
(129, 2, 'Aktualūs darbo skelbimai viešajame sektoriuje', '2023-10-13', '2023-11-06', 'Valstybės tarnybos portale viešinami konkursai bei atrankos į valstybės ir savivaldybių institucijų bei įstaigų laisvas darbo pozicijas. Trys darbo skelbimų kategorijos: 1) Konkursų į karjeros valstybės tarnautojų pareigas skelbimai; 2) Atrankų į pakaitinių valstybės tarnautojų pareigas skelbimai; 3) Konkursų į darbuotojų, dirbančių pagal darbo sutartį, pareigas skelbimai. Pateikiami tik galiojantys (aktualūs) skelbimai. Lentelė atnaujinama kas dieną. Atlyginimo apskaičiavime naudojamas 2023 m. pareiginės algos bazinis dydis (nuo 2024 m. keisis skaičiavimo metodika). Detalesnę skelbimų informaciją galima surasti https://portalas.vtd.lt/, ieškant pagal skelbimo numerį. Duomenų šaltinis - VATIS ir VATARAS. Dėl techninių klausimų kreiptis į atverimas@stat.gov.lt.', 'https://data.gov.lt/datasets/1241/'),
(130, 2, 'Valstybės ir savivaldybių institucijos bei įstaigos, jų pavaldumas', '2023-10-13', '2023-11-06', 'Aktualus ir išsamus valstybės ir savivaldybių institucijų bei įstaigų sąrašas, šių įstaigų pavaldumas viena kitai. Duomenų šaltinis - VATIS ir VATARAS. Pateikiamos tik šiuo metu egzistuojančios įstaigos. Dėl techninių klausimų kreiptis į atverimas@stat.gov.lt.', 'https://data.gov.lt/datasets/1239/'),
(131, 19, 'Azartinių lošimų verslo loterijų ir lošimų mokesčio duomenys', '2023-10-11', '2024-01-10', 'Azartinių lošimų organizatorių  deklaruotų šios veiklos mokesčių (formų FR0584) duomenys', 'https://data.gov.lt/datasets/1923/'),
(132, 20, 'Kelių naudotojo mokesčio sumokėjimo duomenys', '2023-10-11', '2024-02-15', 'Transporto priemonių, už kurias sumokėtas kelių naudotojo mokestis, duomenys: transporto priemonės registracijos šalis, transporto priemonės techniniai parametrai\n--\nhttps://keliumokestis.lt', 'https://data.gov.lt/datasets/1256/'),
(133, 19, 'Juridinių asmenų sumokėti mokesčiai', '2023-10-11', '2024-02-14', 'Duomenys apie juridinių asmenų sumokėtus praėjusiais metais ir einamaisiais metais į Valstybinės mokesčių inspekcijos biudžeto pajamų surenkamąsias sąskaitas deklaruojamus mokesčius ir rinkliavas, kurie nurodyti Lietuvos Respublikos Mokesčių administravimo įstatymo 13 straipsnyje. Einamaisiais metais sumokėtos mokesčių sumos skaičiuojamos kaupimo būdu nuo metų pradžios iki ataskaitinio laikotarpio pabaigos. Duomenys atnaujinami vieną kartą per mėnesį.', 'https://data.gov.lt/datasets/673/'),
