(211, 36, 'Atvirų duomenų atvėrimo pažangos ir poveikio vertinimo apklausos duomenys', '2023-08-24', '2024-01-19', 'Siekiant  įvertinti esamą duomenų atvėrimo progresą ir nustatyti  esamą duomenų atvėrimo situaciją viešojo sektoriaus institucijose ir savivaldybėse, Ekonomikos ir inovacijų ministerija ir Informacinės visuomenės plėtros komitetas atliko duomenų atvėrimo pažangos ir poveikio vertinimo apklausą. Apklausos vykdymo laikas 2022 m. gegužės-rugsėjo mėn. Apklausoje dalyvavo 165 valstybės ir savivaldybių institucijos bei įstaigos.', 'https://data.gov.lt/datasets/2359/'),
