(214, 2, 'Kelių eismo taisyklių pažeidimai ir pažeidėjai', '2023-08-14', '2023-11-06', 'Administracinių nusižengimų registro (ANR) duomenų neagreguota lentelė (mikroduomenys), kurioje įtraukti tik tie nusižengimai, kurių sudėtį nustatantys Administracinių nusižengimų kodekso (ANK) straipsniai yra susiję su Kelių eismo taisyklių (KET) pažeidimais (straipsniai 414-433, 439-441, 463). Viena eilutė yra vieno administracinio nusižengimo vieno straipsnio viena dalis, tad vienas nusižengimas gali kartotis daugelyje eilučių. Kievienam nusižengimui yra priskirtas pažeidėjas (tačiau būna nemažai atvejų, kuomet pažeidėjo duomenų nėra). Pažeidėjo duomenys nėra laikytini griežtai patikimais. Dėl techninių klausimų kreiptis į atverimas@stat.gov.lt.', 'https://data.gov.lt/datasets/1234/'),
(215, 2, 'Administracinių nusižengimų detali mėnesinė statistika', '2023-08-14', '2023-11-06', 'Administracinių nusižengimų registro (ANR) mėnesiniai statistiniai duomenys apie registruotus administracinius nusižengimus. Tai yra agreguota lentelė: pateikiami nusižengimų skaičiai Administracinių nusižengimų kodekso (ANK) straipsnio bei nusižengimo registracijos mėnesio grupėse. Vieno nusižengimo sudėtyje gali būti keli ANK straipsniai, todėl stulpelio „count“ negalima sumuoti, prasminga yra skaičiuoti „count“/“total“ santykį. Dėmesio: tai nėra oficialioji statistika, čia naudojama eksperimentinė duomenų paruošimo metodika (pvz., neatsižvelgiama į galimus tolimesnius nusižengimo statuso pasikeitimus). Rinkinio paskirtis - bendroms laiko tendencijoms stebėti. Dėl techninių klausimų kreiptis į atverimas@stat.gov.lt.', 'https://data.gov.lt/datasets/1232/'),
(216, 36, 'Viešosios nuomonės tyrimas apie 2014–2020 m. Europos Sąjungos investicijas', '2023-08-10', '2023-10-14', 'Tyrimo tikslas – nustatyti tarpines komunikacijos rodiklių, nurodytų Komunikacijos plane, reikšmes, pateikti tyrimo rezultatus ir įvertinti esamą situaciją atsižvelgiant į 2014–2020 m. Europos Sąjungos fondų investicijų komunikacijos rodiklius, už kuriuos yra atsakinga Ekonomikos ir inovacijų ministerija.\nTikslinės grupės: Įmonių vadovai ir Įmonių atstovai. Visos tikslinės grupės skirstomos pagal kriterijus: Labai mažos, mažos ir vidutinės įmonės; Didelės įmonės; Pagal apskritis ir jose esančias savivaldybes; Pagal veiklą (paslaugų įmonė, gamybos įmonė, prekybos įmonė ar kita veikla).\nApklausos metodas - Kombinuotas tyrimo metodas: CAWI (Computer Assisted Web Interview) ir CATI (Computer Assisted Telephone Interview). \nAtranka - Tyrime naudojamas kvotinės atrankos metodas, taikant įmonės dydžio, veiklos srities ir lokacijos (apskritis) kvotas.\nImtis - 500 įmonių vadovų ir 500 įmonių atstovų (darbuotojų).\nRezultatai - pateikiamos ataskaitos pdf formatu ir apibendrintų duomenų lentelės.\nTyrimo laikotarpis - 2016-2023 m.', 'https://data.gov.lt/datasets/2358/'),
(217, 38, 'Licencijų verstis mažmenine prekyba tabako gaminiais sąrašas', '2023-08-10', '2023-10-14', 'Licencijų verstis mažmenine prekyba tabako gaminiais sąrašas', 'https://data.gov.lt/datasets/2357/'),
(218, 38, 'Licencijų verstis mažmenine prekyba alkoholiniais gėrimais sąrašas', '2023-08-10', '2023-10-14', 'Licencijų verstis mažmenine prekyba alkoholiniais gėrimais sąrašas', 'https://data.gov.lt/datasets/2356/'),
(219, 2, 'Administracinių nusižengimų bylose paskirtos baudos', '2023-08-04', '2024-03-12', 'Administracinių nusižengimų registro (ANR) duomenų neagreguota lentelė (mikroduomenys), kurioje viena eilutė yra vienas administracinis nusižengimas, už kurį yra paskirta bauda (administracinės nuobaudos rūšis). Šiuo metu yra įtraukiami tik tokie nusižengimai, kurių sudėtyje yra tik vienas Administracinių nusižengimų kodekso (ANK) straipsnis ir tik viena piniginė bauda. Paskirtos baudos nebūtinai yra apmokėtos. Taip pat dalis į imtį patenkančių nusižengimų yra tie, dėl kurių priimti nutarimai gali būti apskųsti, nutraukti ar perkvalifikuoti (ši informacija nepateikiama). Dėmesio: tai nėra oficialioji statistika, naudojama eksperimentinė duomenų paruošimo metodika (pvz., neatsižvelgiama į galimus tolimesnius nusižengimo statuso pasikeitimus). Dėl techninių klausimų kreiptis į atverimas@stat.gov.lt.', 'https://data.gov.lt/datasets/2355/'),
(220, 39, 'Vilniaus miesto adresų duomenys', '2023-08-03', '2023-10-14', 'Vilniaus miesto gatvių duomenų rinkinys iš Vilniaus savivaldybės adresų registro. Duomenų geografinė imtis - Vilniaus miestas.', 'https://data.gov.lt/datasets/2353/'),
(221, 39, 'Vilniaus miesto dokumentų valdymo sistemos gaunami dokumentai', '2023-08-03', '2023-10-14', 'Duomenų rinkinys apima į Vilniaus miesto dokumentų valdymo sistemą gaunamus dokumentus, suteikiančius vertingų įžvalgų apie administracinius procesus ir komunikaciją miesto valdyme.', 'https://data.gov.lt/datasets/2354/'),
