(298, 5, 'Nekilnojamojo turto registre įregistruotų patalpų duomenys pagal savivaldybes', '2023-07-24', '2024-03-04', 'Nekilnojamojo turto registre (NTR) įregistruotų patalpų duomenys pagal savivaldybes (rinkinių grupė, viso 60 vnt.). NTR įregistruotų patalpų kadastro duomenys apie paskirtį, plotą ir. t. t.', 'https://data.gov.lt/datasets/1813/'),
(299, 5, 'Nekilnojamojo turto registre įregistruotų inžinerinių statinių duomenys pagal savivaldybes', '2023-07-24', '2024-03-04', 'Nekilnojamojo turto registre (NTR) įregistruotų inžinerinių statinių duomenys pagal savivaldybes (rinkinių grupė, viso 60 vnt.). NTR įregistruotų inžinerinių statinių kategorija (rūšis pagal Statybos įstatymą), tipas, paskirtis, įvairūs plotai, ilgiai, gyliai, diametrai (pagal paskirtį) statybos ir modernizavimo metai, konstrukcinių dalių medžiagos.', 'https://data.gov.lt/datasets/1814/'),
(300, 5, 'Nekilnojamojo turto registre įregistruotų pastatų duomenys pagal savivaldybes', '2023-07-24', '2024-03-04', 'Nekilnojamojo turto registre (NTR) įregistruotų pastatų duomenys pagal savivaldybes (rinkinių grupė, viso 60 vnt.). NTR įregistruotų pastatų kategorija (rūšis pagal Statybos įstatymą), tipas, paskirtis, įvairūs plotai (užstatytas, bendras, naudingas, gyvenamas, verslo, pagalbinis nenaudingas ir t. t.), patalpų skaičius pagal paskirtį, aukštų skaičius, statybos ir modernizavimo metai, energetinė klasė, konstrukcinių dalių medžiagos, būtiniausi gerbūvio elementų duomenys.', 'https://data.gov.lt/datasets/1812/'),
(301, 5, 'Nekilnojamojo turto registre įregistruotų žemės sklypų duomenys pagal savivaldybes', '2023-07-24', '2024-03-04', 'Nekilnojamojo turto registre (NTR) įregistruotų žemės sklypų duomenys pagal savivaldybes (rinkinių grupė, viso 60 vnt.). NTR įregistruotų žemės sklypų paskirtis, naudojimo būdas, bendrojo ploto pasiskirstymas bei naudmenų našumo balas.', 'https://data.gov.lt/datasets/1811/'),
