INSERT INTO `rinkinys` (`RINKINYS_ID`, `ORGANIZACIJA_ID`, `RINKINYS_PAVADINIMAS`, `RINKINYS_IKEL_DATA`, `RINKINYS_ATNAUJ_DATA`, `RINKINYS_APRASAS`, `RINKINYS_NUORODA`) VALUES
(363, 4, 'Mirties priežastys pagal skaitmeninius medicininius mirties liudijimus', '2023-07-15', '2023-12-01', 'DUOMENŲ ŠALTINIS:\nNaudojami eSveikatos (ESPBI IS) skaitmeninių medicininių mirties liudijimų (forma E106) duomenys, kuriuos Registrų centras kasdien teikia į Valstybės duomenų agentūros (VDA) Valstybės duomenų valdysenos informacinę sistemą (VDV IS). \n\nIMTIS, APIMTIS, ATNAUJINIMAS:\nDėl bet kokių priežasčių mirę asmenys, kurių mirtis yra dokumentuota skaitmeniniame medicininame mirties liudijime (forma E106) eSveikatos sistemoje. Palikti tik validų lietuvišką asmens kodą (pagal struktūrą ir kontrolinį skaitmenį) mirties liudijime turintys asmenys. Pateikiamos mirtys, įvykusios nuo 2018 metų sausio 1 d. iki septintos dienos prieš lentelės atnaujinimo datą. Duomenys atnaujinami trečią kiekvieno mėnesio dieną.\n\nLENTELĖS STRUKTŪRA:\nLentelė yra agreguota pagal penkis požymius: mirties metus, mirties mėnesį, mirusiojo amžiaus grupę, lytį, nerevizuotą pagrindinę mirties priežastį (triženklį TLK-10-AM diagnozės kodą). Tad kiekviena eilutė yra unikali šių penkių požymių kombinacija. Paskutinis stulpelis (mirusiųjų skaičius) niekada nėra lygus 0, t. y. jeigu konkrečiais metais, konkretų mėnesį, konkrečioje amžiaus ir lyties grupėje dėl konkrečios priežasties nemirė nei vienas asmuo - tokia eilutė tiesiog nėra įtraukiama į lentelę. \n\nMIRTIES PRIEŽASTYS:\nĮ Medicininio mirties liudijimo pagrindinės mirties priežasties eilutę gydytojo įrašytas TLK-10-AM kodas. \n\nPASITEIRAVIMUI:\nValstybės duomenų agentūros duomenų atvėrimo komanda: atverimas@stat.gov.lt.\n\nSVARBIOS PASTABOS: \n[1] Tai nėra oficialioji mirties priežasčių statistika, kurią rengia Higienos institutas. Šioje lentelėje mirties priežastys yra nerevizuotos, tai yra tokios, kokias jas medicininiame mirties liudijime įrašė sveikatos priežiūros specialistas. Šie įrašai vėliau Mirties atvejų ir jų priežasčių valstybės registre yra revizuojami ir sukoduojami ir pagal tarptautines Pasaulio sveikatos organizacijos (PSO) taisykles išrenkama pagrindinė mirties priežastis. Plačiau apie sąvokas \"pagrindinė mirties priežastis\", \"tarpinė mirties priežastis\" ir \"tiesioginė mirties priežastis\" skaitykite čia: https://hi.lt/uploads/pdf/padaliniai/MPR/MML_rekomendacijos.pdf. \n\n[2] Šiuose duomenys retais atvejais duomenys gali būti retrospektyviai atnaujinami (pvz., dėl Valstybinės teismo medicinos tarnybos vykdomos ekspertizės). \n\n[3] Šiuose duomenyse neapskaitomos perinatalinės mirtys (medicininiai perinatalinės mirties liudijimai, forma E106-2-1). \n\n[4] Šie duomenys skirsis nuo tikslesnės Higienos instituto (HI) vykdomos mirčių apskaitos: HI apskaito ir neskaitmeninius (\"popierinius\") medicininius mirties liudijimus, kurių gali būti apie 1%; tačiau šioje lentelėje yra tik skaitmeniniai medicininiai mirties liudijimai. \n\n[5] Šie duomenys nežymiai skirsis nuo VDA rengiamos oficialiosios mirtingumo statistikos, kurioje apskaitomi tik nuolatiniai gyventojai, o einamiesiems metams naudojama ne faktinė mirties data (naudojama data, kuomet apie mirtį sužinota); tačiau šioje lentelėje į apimtį gali patekti ir Lietuvos teritorijoje mirę ne Lietuvos piliečiai ar asmenys, kurie nėra nuolatiniai Lietuvos gyventojai, taip pat naudojama faktinė mirties data. \n\n[6] Taip pat duomenyse yra pašalinti mirusieji, kurie medicininiame mirties liudijime neturėjo validaus lietuviško asmens kodo.', 'https://data.gov.lt/datasets/2026/'),
