(371, 42, 'EB svarbių vietovių geografinė informacija už 2021 m.', '2023-07-14', '2023-10-14', 'Pateikiama informacija apie 2019 m. EB svarbes vietoves, išskiriant pagal šias kategorijas: - Medžių grupė, miškas - Tvenkinys su pakrantės augmenija - Pūdymas, kurio plotas ir konfigūracija nesikeičia 3 ir daugiau metų - Azotą kaupiančių augalų laukas, kurio plotas ir konfigūracija nesikeičia 3 ir daugiau metų - Pasėlių laukas, kurio plotas ir konfigūracija nesikeičia 3 ir daugiau metų - Lauko paraštės, kurių plotas ir konfigūracija nesikeičia 3 ir daugiau metų - Trumpos rotacijos plantacijos - Griovys, kanalas nuo 1 m pločio', 'https://data.gov.lt/datasets/2342/'),
