(376, 36, 'Priežiūros institucijų pažangos vertinimo duomenys', '2023-07-14', '2023-10-14', 'Duomenys, kaip ūkio subjektų veiklos priežiūrą atliekančios institucijos įgyvendina pažangias verslo priežiūros priemones ir kaip diegia su tai susietas kitas moderniąsias veiklos praktikas. Periodiškai atliekamas tyrimas leidžia stebėti individualią priežiūros institucijų daromą pažangą, taip pat atskleidžia ir sistemines srities problemas ir priežiūros veiklos organizavimo trūkumus.\nDuomenys: priežiūros institucijos  atliekamų patikrinimų (planinių ir neplaninių) skaičius, priežiūros veiklai skirtas biudžetinės lėšos, priežiūros specialistų skaičius, prižiūrimų ūkio subjektų skaičius, bendras priežiūros institucijų veiklos pažangumo vertinimas (balais) ir detalizuojamas vertinimas pagal šias kategorijas: veiklos rodiklių diegimas, rizikos vertinimas ir valdymas, kontrolinių klausimynų naudojimas, patikrinimų vykdymas, konsultavimo veikla, poveikio priemonių taikymas, „verslo naujoko“ statuso taikymas, mažareikšmiškumo instituto taikymas, bei vykdomos ūkio subjektų grįžtamojo ryšio (apklausų) priemonės.\nPeriodiškumas – kas 2 metai.\nDaugiau informacijos apie metodiką bei duomenų pagrindu parengtą švieslentę galima rasti adresu: https://eimin.lrv.lt/lt/veiklos-sritys/verslo-aplinka/verslo-prieziuros-politika/svieslente', 'https://data.gov.lt/datasets/1698/'),
(377, 43, 'Viešojo sektoriaus svetainių atitikimo reikalavimams tyrimai', '2023-07-11', '2023-12-14', 'Valstybės ir savivaldybių institucijų ir įstaigų interneto svetainių atitikimo bendriesiems reikalavimams tyrimas. Pateikiami einamųjų metų tyrimo rezultatai, tyrimų ataskaitos.', 'https://data.gov.lt/datasets/1002/'),
(378, 38, 'KLAIPĖDOS RAJONO SAVIVALDYBĖS TERITORIJOJE DAUGIABUČIŲ NAMŲ BENDROJO NAUDOJIMO OBJEKTŲ ADMINISTRATORIAI', '2023-07-11', '2023-10-14', 'Jei daugiabučių gyvenamųjų namų butų ir kitų patalpų savininkai nesteigia bendrijos ir neinicijuoja jungtinės veiklos sutarties, savivaldybė, vadovaudamasi įstatymais, skiria bendrojo naudojimo objektų administratorių. Gyventojai administratorių gali rinktis iš administruojančių įmonių sąrašo', 'https://data.gov.lt/datasets/2336/'),
(379, 4, 'COVID-19 pandemijos duomenys', '2023-07-03', '2024-01-24', 'Lietuvos statistikos departamento rengiami COVID-19 pandemijos atvirų duomenų rinkiniai: sergamumas, hospitalizacijos, mirštamumas, skiepijimas, testavimas, moksleiviai, studentai, neįgalieji, darbovietės, švieslenčių statistikos duomenys. Atnaujinama kasdien.', 'https://data.gov.lt/datasets/1670/'),
(380, 44, 'Biobankas', '2023-07-03', '2023-12-15', 'Biobankas – moderni aukšto technologinio lygio infrastruktūra, kurioje saugomi standartizuotai surinkti biologiniai žmogaus mėginiai ir su jais susijusi klinikinė informacija, skirta Lietuvos ir pasaulio mokslinei bei industrinei bendruomenei, siekiant plėtoti modernius biomedicininius tyrimus, kurti naujas gydymo bei diagnostikos priemones bei technologijas. Nacionalinio vėžio instituto Biobanko duomenų rinkinyje pateikimi šie su ėminiais ar jų šaltiniais (pacientais) susiję duomenys: ėminio nr., paėmimo data, lytis, amžius, TLK-10 kodas (susirgimo kodas pagal Tarpautinę ligų klasifikaciją (10 leidimas)), pTNM (Ligos išplitimo vertinimas pagal TNM sistemą (patologinis)).', 'https://data.gov.lt/datasets/2332/'),
(381, 31, 'Mokamos sumos už medicinos priemonių (prietaisų) nuomą', '2023-06-30', '2023-12-12', 'Informacija apie PSDF biudžeto išlaidas medicinos priemonių (prietaisų) nuomai', 'https://data.gov.lt/datasets/2280/'),
(382, 31, 'PSDF biudžeto išlaidų straipsnių sąrašas', '2023-06-30', '2023-12-12', 'Privalomojo sveikatos draudimo fondo biudžeto straipsnių pagal VLK direktoriaus 2005 m. birželio 30 d. įsakymą Nr. 1K-81 \"Dėl asmens sveikatos priežiūros paslaugų ir sveikatos programose numatytų paslaugų, už kurias mokama iš Privalomojo sveikatos draudimo fondo biudžeto, klasifikatoriaus patvirtinimo\" klasifikatorius', 'https://data.gov.lt/datasets/2279/'),
(383, 31, 'Stacionarinės slaugos lovų poreikis', '2023-06-30', '2023-12-12', 'Informacija apie metinį stacionarinių slaugos lovų poreikį pagal savivaldybes', 'https://data.gov.lt/datasets/1588/'),
(384, 31, 'Numatomų teikti ambulatorinių asmens sveikatos priežiūros paslaugų sąrašas, pateikiamas gydymo įstaigų sutartyse', '2023-06-30', '2023-12-12', 'Informacija apie gydymo įstaigų PSDF lėšomis teikiamas ambulatorines asmens sveikatos priežiūros paslaugas (sutartyse su teritorinėmis ligonių kasomis nurodyta ambulatorinių asmens sveikatos priežiūros paslaugų nomenklatūra)', 'https://data.gov.lt/datasets/1536/'),
(385, 45, 'Metinių nuotekų tvarkymo apskaitos ataskaitų duomenys', '2023-06-30', '2023-11-24', 'Metinių nuotekų tvarkymo apskaitos ataskaitų duomenų rinkinyje pateikiami ūkio subjektų nuotekų tvarkymo apskaitos metinių ataskaitų duomenys apie ūkio subjektų su nuotekomis į aplinką išleistus teršalus, nuotekų kokybę, nuotekų valymo įrenginius, išleistuvus ir priimtuvus. Nuotekų tvarkymo apskaitos metines ataskaitas ūkio subjektai teikia Aplinkos apsaugos agentūrai per informacinę sistemą „Aplinkos informacijos valdymo integruota kompiuterinė sistema“ (AIVIKS), vadovaujantis Vandens naudojimo ir nuotekų tvarkymo apskaitos tvarkos aprašo reikalavimais.', 'https://data.gov.lt/datasets/1784/'),
(386, 31, 'DRG sąrašas', '2023-06-30', '2023-12-12', 'Informacija apie giminingų diagnozių grupes. Kiekvieną ADRG sudaro DRGs, kurios skiriasi pagal sunaudojamus išteklius. DRGs – tai detaliausias klasifikavimo lygmuo. ADRG dažniausiai skirstoma į DRGs pagal gydymo atvejo klinikinio sudėtingumo lygmenis.', 'https://data.gov.lt/datasets/1384/'),
(387, 31, 'Medicininių intervencijų sąrašas (ACHI)', '2023-06-30', '2023-12-18', 'Informacija apie medicinines intervencijas. ACHI – tai Australijos medicininių intervencijų klasifikacija. Jos devintasis leidimas pakeičia aštuntąjį, išleistą 2013 metais.', 'https://data.gov.lt/datasets/1383/'),
(388, 31, 'Ligų sąrašas (TLK-10-AM)', '2023-06-30', '2023-10-22', 'Ligų klasifikacija. TLK-10-AM – Tarptautinė statistinė ligų ir sveikatos sutrikimų klasifikacija, dešimtasis pataisytas ir papildytas leidimas, Australijos modifikacija (TLK-10-AM) – Sisteminis ligų sąrašas.', 'https://data.gov.lt/datasets/1259/'),
(389, 37, 'Miškų sveikumo monitoringo duomenys', '2023-06-29', '2023-12-12', 'Europos miškų sveikumo stebėsenos programa vykdoma dviem lygiais. Pirmasis lygis dėl savo regioninio pobūdžio vadinamas regionine miškų sveikumo stebėsena. Regioninės miškų sveikumo stebėsenos tikslas - gauti operatyvią informaciją apie atskirų valstybių miškų būklės kaitą teritoriniu ir laiko atžvilgiu, siekiant identifikuoti oro teršalų tolimųjų pernašų bei kitų stresinių veiksnių poveikį miškams. Duomenys teikiami apie 200 000 medžių beveik iš 16 000 barelių.\nI-ojo lygio miškų sveikumo monitoringo pagrindiniai vertinami rodikliai: medžio rūšis; medžio būklė, padaringumas; medžio krafto klasė; medžio stiebo perimetras 1,3 m aukštyje nuo šaknies kaklelio; viršūnės būklė; sausų šakų kiekis; derėjimo laipsnis (pušims ir eglėms); spyglių amžius (pušims); lajos pažeidžiamumo tipas; viršutinio lajos trečdalio defoliacija; visos lajos defoliacija; visos lajos dechromacija; pažeidimų vieta medyje; pažeidimų pavadinimai; pažeidimų intensyvumas', 'https://data.gov.lt/datasets/2306/'),
(390, 37, 'Valstybinės miškų apskaitos duomenys', '2023-06-29', '2023-12-12', 'Valstybinės miškų apskaitos tikslas – apibendrinti informaciją apie miško išteklius, jų kokybę, gamtinę ir ūkinę būklę. Apskaitos objektas – visi Lietuvos miškai. Apskaita atliekama kiekvienų metų sausio 1 d. būklei.', 'https://data.gov.lt/datasets/2305/'),
(391, 46, 'Asmenų specialiųjų poreikių duomenys', '2023-06-29', '2023-10-14', 'Specialieji poreikiai nustatomi vadovaujantis Lietuvos Respublikos socialinės apsaugos ir darbo ministro ir Lietuvos Respublikos sveikatos apsaugos ministro įsakymu patvirtintu Specialiojo nuolatinės slaugos, specialiojo nuolatinės priežiūros (pagalbos), specialiojo lengvojo automobilio įsigijimo ir jo techninio pritaikymo išlaidų kompensacijos poreikių nustatymo tvarkos aprašu, neatsižvelgiant į asmens amžių, neįgalumo lygį ar darbingumo lygį.', 'https://data.gov.lt/datasets/1820/'),
(392, 46, 'Asmenų neįgalumo lygio duomenys', '2023-06-29', '2023-10-14', 'Neįgalumo lygis, vadovaujantis sveikatos apsaugos, socialinės apsaugos ir darbo ir švietimo ministrų įsakymu patvirtintais Neįgalumo lygio nustatymo kriterijų ir tvarkos aprašu, nustatomas asmenims iki 18 metų, išskyrus asmenis, kurie yra (buvo) draudžiami valstybiniu socialiniu draudimu, kompleksiškai įvertinus asmens sveikatos būklę ir savarankiškumo kasdienėje veikloje ir galimybių ugdytis netekimo mastą.', 'https://data.gov.lt/datasets/1816/'),
(393, 46, 'Asmenų darbingumo lygio duomenys', '2023-06-29', '2023-10-14', 'Darbingumo lygis, vadovaujantis socialinės apsaugos ir darbo ir sveikatos apsaugos ministrų įsakymu patvirtintais Darbingumo lygio nustatymo kriterijų ir Darbingumo lygio nustatymo tvarkos aprašais, nustatomas asmenims iki 18 metų, kurie yra (buvo) draudžiami valstybiniu socialiniu draudimu, ir asmenims nuo 18 metų iki senatvės pensijos amžiaus, kompleksiškai įvertinus medicininius (t. y. asmens bazinį darbingumą), ir asmens veiklos ir gebėjimų dalyvauti kriterijus.', 'https://data.gov.lt/datasets/1817/'),
(394, 3, 'Išorinė reklama', '2023-06-29', '2024-01-15', 'Informacija (sąrašas) apie išduotus leidimus įrengti išorinę reklamą Kaišiadorių rajono savivaldybės teritorijoje', 'https://data.gov.lt/datasets/2331/'),
(395, 45, 'Ūkio subjektų aplinkos oro taršos šaltinių ir iš jų išmetamų teršalų inventorizacijų sąrašas', '2023-06-28', '2023-11-24', 'Kiekvienais metais pateikiamas atnaujintas ūkio subjektų, kurie atliko  aplinkos oro taršos šaltinių ir iš jų išmetamų teršalų inventorizaciją sąrašas.', 'https://data.gov.lt/datasets/1789/'),
(396, 45, 'Upių kategorijos vandens telkinių būklės duomenys', '2023-06-28', '2023-11-24', 'Rinkinyje pateikiama valstybinio aplinkos monitoringo duomenų pagrindu arba ekspertiniu vertinimu įvertinta upių kategorijos vandens telkinių ekologinė ir cheminė būklė. Ekologinė būklė nustatyta pagal fizikinių-cheminių, hidromorfologinių ir biologinių kokybės elementų rodiklius, vadovaujantis paviršinių vandens telkinių būklės nustatymo metodika. Cheminė būklė nustatyta vadovaujantis Nuotekų tvarkymo reglamentu.', 'https://data.gov.lt/datasets/497/'),
(397, 45, 'Ežerų kategorijos vandens telkinių būklės duomenys', '2023-06-28', '2023-11-24', 'Rinkinyje pateikiama valstybinio aplinkos monitoringo duomenų pagrindu arba ekspertiniu vertinimu įvertinta ežerų kategorijos vandens telkinių ekologinė ir cheminė būklė. Ekologinė būklė nustatyta pagal fizikinių-cheminių, hidromorfologinių ir biologinių kokybės elementų rodiklius, vadovaujantis paviršinių vandens telkinių būklės nustatymo metodika. Cheminė būklė nustatyta vadovaujantis Nuotekų tvarkymo reglamentu.', 'https://data.gov.lt/datasets/1782/'),
(398, 45, 'Upių, kanalų duomenys', '2023-06-28', '2023-11-24', 'Upių, kanalų duomenys: unikalus identifikatorius, identifikavimo kodas, pavadinimas, vandens telkinio registravimo ir redagavimo data, vandens telkinio kategorijos pavadinimo kodas, upės pabaseinio arba baseino, kuriame yra vandens objektas, kodas, vyresniosios upės, į kurią įteka upės, unikalus identifikatorius, žiočių centro X ir Y koordinatės LKS 94 koordinačių sistemoje, įtekėjimo į vyresniąją upę krantas, upės įtekėjimo eiliškumas, ilgis  Lietuvos teritorijoje, vidutinis daugiametis vandens debitas upės žiotyse.', 'https://data.gov.lt/datasets/1779/'),
(399, 45, 'Ežerų, tvenkinių ir dirbtinių nepratekamų paviršinio vandens telkinių duomenys', '2023-06-28', '2023-11-24', 'Ežerų, tvenkinių ir dirbtinių nepratekamų paviršinio vandens telkinių duomenys: pavadinimas, registravimo data, redagavimo data, centro koordinatė, vandens paviršiaus plotas Lietuvos teritorijoje, identifikavimo kodas, vandens telkinio kategorijos pavadinimo kodas, ežero kvadrato numeris, ežero numeris kvadrate, ežero rūšis, vandens telkinio ilgis, vidutinis plotis, kranto linijos ilgis, upės pabaseinio arba baseino, kuriame yra vandens objektas, kodas, tiesioginės upės unikalus identifikatorius, kiti duomenys.', 'https://data.gov.lt/datasets/1049/'),
(400, 47, 'Atestuotų dauginamosios medžiagos tiekėjų sąrašas', '2024-03-28', '2024-03-29', 'Atestuotų dauginamosios medžiagos tiekėjų sąrašas. Pateikiama informacija apie dauginamąją medžiagą tiekiančius ūkio subjektus.', 'https://data.gov.lt/datasets/2574/'),
(401, 1, 'Lietuvos Respublikos teritorijos skaitmeniniai erdviniai žemės paviršiaus lazerinio skenavimo taškų duomenys SEŽP_0,5LT', '2024-03-28', '2024-03-28', 'LR teritorijos skaitmeniniai erdviniai žemės paviršiaus lazerinio skenavimo taškų 2009-2010 m. duomenys. Tankis 0,5 tšk/kv.m.', 'https://data.gov.lt/datasets/2573/'),
(402, 1, 'Lietuvos Respublikos teritorijos multispektrinių žemės paviršiaus palydovinių nuotraukų (palydovo „Sentinel-2“) mozaikos (sutrumpintas pavadinimas – PNM)', '2024-03-28', '2024-03-28', 'Lietuvos Respublikos teritorijos multispektrinių žemės paviršiaus palydovinių nuotraukų („Sentinel-2“ palydovo) mozaikos (PNM). Duomenys teikiami .tif formatu. Europos Komisijos ir Europos Kosmoso agentūros informacinėje sistemoje pagal Copernicus programą 2022 m. pateiktos Lietuvos Respublikos teritoriją dengiančios Sentinel-2 L1C lygio palydovinės nuotraukos atrinktos, atlikta atmosferinė korekcija ir jos apdorotos iki L2A lygio. Palydovinių nuotraukų apdorojimui panaudoti automatizuoti duomenų apdorojimo algoritmai, leidžiantys eliminuoti subjektyvaus pobūdžio klaidas ir atlikti kokybišką palydovinių nuotraukų apdorojimą. Sutvarkius palydovines nuotraukas ir transformavus jas į LKS94 (EPSG:3346) projekciją, sukomponuotos keturios atskirų periodų visos Lietuvos Respublikos teritorijos Sentinel-2 palydovinių nuotraukų mozaikos. Iš palydovinių nuotraukų mozaikų eliminuoti su sensoriumi ir palydovo judėjimu susiję defektai. Mozaikų skiriamoji geba (pikselio dydis) ne daugiau 10 metrų.', 'https://data.gov.lt/datasets/2572/'),
(403, 1, 'Lietuvos Respublikos teritorijos žemės paviršiaus poliarimetrinių žemės paviršiaus palydovinių nuotraukų (palydovo „Sentinel-1“) mozaikos (sutrumpintas pavadinimas – PNP)', '2024-03-28', '2024-03-28', 'Lietuvos Respublikos teritorijos poliarimetrinių žemės paviršiaus palydovinių nuotraukų („Sentinel-1“ palydovo) mozaikos (PNP). Duomenys teikiami .tif formatu. Europos Komisijos ir Europos Kosmoso agentūros informacinėje sistemoje pagal Copernicus programą pateiktos Sentinel-1 palydovinės nuotraukos atrinktos, apdorotos ir panaudotos palydovinių Sentinel-1 nuotraukų mozaikų gamybai. Apdorojant Sentinel-1 palydovines nuotraukas atlikta orbitos parametrų korekcija, poliarimetrinio signalo kalibravimas, elektromagnetinio signalo korekcija pagal orbitos parametrus ir reljefo formas, palydovinių vaizdų ortorektifikavimas bei kiti darbai. Palydovinių nuotraukų sutvarkymui panaudoti automatizuoti duomenų apdorojimo algoritmai. Iš apdorotų 2022 m. sausio – lapkričio mėn. laikotarpio palydovinių nuotraukų sumontuota 11 atskirų kiekvieno mėnesio (sausio-lapkričio mėn.) Sentinel-1 palydovinių nuotraukų mozaikų. Mozaikos skiriamoji geba (pikselio dydis) ne daugiau 10 metrų.', 'https://data.gov.lt/datasets/2571/'),
(404, 48, 'Lietuvos leidėjai 2023', '2024-03-28', '2024-04-15', 'Pateikiama Lietuvos leidėjų informacija: pavadinimas, ISBN/ISSN/ISMN pradinis nr., įmonės kodas, teisinis statusas, būsena, tel. nr., el. paštas, svetainė, vadovas.', 'https://data.gov.lt/datasets/2570/'),
(405, 1, 'Lietuvos Respublikos apskričių centrų skaitmeniniai erdviniai žemės paviršiaus lazerinio skenavimo taškų duomenys (sutrumpintas pavadinimas – SEŽP)', '2024-03-28', '2024-03-28', 'Lietuvos Respublikos apskričių centrų skaitmeniniai erdviniai žemės paviršiaus lazerinio skenavimo taškų 2017 m. duomenys (sutrumpintas pavadinimas – SEŽP). Teikiama ASCII Simple Point Cloud (*.xyz) ir ESRI ArcGIS Binary Grid (*.adf) formatais.', 'https://data.gov.lt/datasets/2569/'),
(406, 1, 'Lietuvos Respublikos apskričių centrų  skaitmeniniai erdviniai objektų paviršiaus lazerinio skenavimo taškų duomenys (sutrumpintas pavadinimas – SEOP)', '2024-03-28', '2024-03-28', 'Skaitmeniniai erdviniai objektų paviršiaus lazerinio skenavimo taškų 2017 m. duomenys (sutrumpintas pavadinimas – SEOP). Teikiama ASCII Simple Point Cloud (*.xyz) ir ESRI ArcGIS Binary Grid (*.adf) formatais.', 'https://data.gov.lt/datasets/2568/'),
(407, 1, 'Lietuvos Respublikos apskričių centrų skaitmeniniai erdviniai lazerinio skenavimo taškų duomenys Lidar_DR', '2024-03-28', '2024-03-28', 'Lietuvos Respublikos apskričių centrų skaitmeniniai erdviniai lazerinio skenavimo taškų duomenys (sutrumpintas pavadinimas – Lidar_DR) (2017 m.). LiDAR taškų tankis >30 (vid. 45) tšk./kv. m Tikslumas: horizontalios padėties nustatymo - RMSE<30 cm, vertikalios - RMSE<10 cm. Taškai klasifikuoti, 13 klasių. Priskirtos RGB reikšmės. Teikiama ASPRS Lidar Data Exchange (*.las) formatu.', 'https://data.gov.lt/datasets/2567/'),
(408, 1, 'Lietuvos Respublikos teritorijos M 1:5 000 skaitmeninis rastrinis ortofotografinis žemėlapis ORT5LT', '2024-03-27', '2024-03-27', 'Lietuvos skaitmeninis ortofotografinis M 1:5000 žemėlapis ORT5LT apimantis visą Lietuvos Respublikos teritoriją. RMSE apie 0,4 m. Aerofotografavimas vykdytas skaitmenine fotokamera (CCD jutiklis), GSD – 0,2 m.  Dėl techninių galimybių ir atsižvelgiant į tai, kad ORT5LT tikslumas ir raiška yra tokie patys, kaip ORT10LT , siūlome atsisiuntimui arba peržiūros paslaugai užsisakyti ORT10LT žemėlapius, o dėl ORT5LT gavimo, prašome kreiptis į Nacionalinę žemės tarnybą.', 'https://data.gov.lt/datasets/2565/'),
(409, 1, 'Lietuvos Respublikos teritorijos M 1:10 000 skaitmeninis rastrinis ortofotografinis žemėlapis ORT10LT', '2024-03-27', '2024-03-27', 'Lietuvos Respublikos teritorijos ortofotgrafinis žemėlapis M 1:10000 žemėlapis ORT10LT apima Lietuvos Respublikos teritoriją. RMSE apie 0,4 m. Aerofotografavimas vykdytas skaitmenine fotokamera (CCD jutiklis), GSD – 0,2 m. Ortofotografinius žemėlapius galite atsisiųsti atskirais lapais LizardTech MrSID bei TIFF formatais.', 'https://data.gov.lt/datasets/2564/'),
(410, 1, 'Lietuvos Respublikos teritorijos M 1:250 000  georeferencinių erdvinių duomenų rinkinys pagal tarptautinio projekto EuroRegionalMap reikalavimus ERM_250LT', '2024-03-27', '2024-03-27', 'Lietuvos Respublikos teritorijos M 1:250 000 georeferencinių erdvinių duomenų rinkinys pagal tarptautinio projekto EuroRegionalMap reikalavimus. Šiam projektui vadovauja EuroGeographics - Europos valstybių nacionalinių kartografijos, geodezijos ir kadastro agentūrų asociacija.Duomenų bazę sudaro 8 temos: administracinės ribos ir administraciniai vienetai, hidrografija (upės, ežerai, tvenkiniai, jūra, užtvankos, šaltiniai, pelkės ), transporto tinklas (keliai, geležinkeliai, geležinkelių stotys, degalinės ir automagistralių pakelės poilsio aikštelės, keltų linijos, jūrų uostai, oro uostai, malūnsparnių nusileidimo aikštelės, valstybinės sienos kirtimo postai ), gyvenvietės (išreikštos plotais ir taškais), socialinės temos objektai (švietimo įstaigos, gydymo įstaigos, sąvartynai, elektros jėgainės ) augmenija ir pagrindinės žemėnaudos (miškai, dirbama žemė, pramoniniai sodai, atviri smėlynai ir akmenynai), fizinių geografinių regionų pavadinimų anotacijos (žemumos, aukštumos, lygumos ir pan.), įvairūs objektai ir orientyrai (produktotiekiai, naudingųjų iškasenų gavybos vietos, aukštos įtampos perdavimo linijos, nacionaliniai parkai, policijos nuovados, laisvalaikio ir pramogų parkai, populiariausi turistų traukos objektai - muziejai, istoriniai pastatai, paminklai).', 'https://data.gov.lt/datasets/2563/'),
(411, 1, 'Lietuvos Respublikos teritorijos M 1:100 000 georeferencinių erdvinių duomenų rinkinys pagal tarptautinio projekto „EuroBoundaryMap“ reikalavimus EBM_100LT', '2024-03-27', '2024-03-27', 'Lietuvos Respublikos teritorijos M 1:100 000 georeferencinių erdvinių duomenų rinkinys pagal tarptautinio projekto EuroBoundaryMap reikalavimus - EBM_100LT.Ši duomenų bazė yra sudaryta iš administracinių ribų linijų vektoriaus, administracinių vienetų plotų vektoriaus bei taškų vektoriaus. Linijos kaupia tam tikrą atributinę informaciją apie ribą, jos hierarchiją ir kitą informaciją. Plotai ir taškai kaupia atributinę informaciją apie administracinių vienetų hierarchiją bei kodus.', 'https://data.gov.lt/datasets/2562/'),
(412, 49, 'Į Pabėgėlių priėmimo centrą atvykstantys pabėgėliai', '2024-04-05', '2024-04-05', 'Pabėgėlių priėmimo centras (toliau – Centras) - biudžetinė įstaiga, teikianti socialines paslaugas, priėmimą, apgyvendinimą ir valstybės paramą:\r\n- nelydimiems nepilnamečiams,\r\n- prieglobsčio prašytojams;\r\n- neteisėtai sieną kirtusiems migrantams;\r\n- prekybos žmonėmis aukoms;\r\n- perkeltiems asmenims;\r\n- prieglobsčio gavėjams.\r\n\r\n\r\nPabėgėlių priėmimo centre tiek Rukloje, tiek Naujininkų pabėgėlių stovykloje Vilniuje priimami apgyvendinimui pažeidžiami asmenys:\r\nNelydimi nepilnamečiai;\r\nNėščios moterys;\r\nAsmenys, patyrę kankinimus;\r\nAsmenys, turintys psichikos sutrikimų;\r\nAsmenys, turintys sveikatos sutrikimų;\r\nPensinio amžiaus asmenys;\r\nVienas iš tėvų, auginantis nepilnamečius vaikus;\r\nŠeimos, auginančios nepilnamečius vaikus.\r\n \r\nPagrindinė Centro funkcija – įgyvendinti prieglobstį gavusių užsieniečių socialinės integracijos programą. Oficialus Centro atidarymas įvyko 1998 m. gegužės 14 d.  Per tą laiką Pabėgėlių priėmimo centras prisidėjo prie užsieniečių sėkmingos integracijos visuomenėje bei darbo rinkoje.', 'https://data.gov.lt/datasets/2566/'),
(413, 9, 'ATC Lietuva - Latvija (MW)', '2024-04-15', '2024-04-15', 'Nurodomi tarpsisteminiai pralaidumai (iš Lietuvos į Latviją kryptimi) prekybai dienos eigoje. Valandiniai duomenys.\r\nATC – maksimalus galimas pjūvio pralaidumas (angl. Available Transfer Capacities), įvertinus iš anksto paskirstytą pralaidumą.\r\nAtverta pagal Komisijos reglamentą (ES) Nr. 543/2013, 2013 m. birželio 14 d., dėl duomenų teikimo ir skelbimo elektros energijos rinkose, iš dalies keičiantis Europos Parlamento ir Tarybos reglamento (EB) Nr. 714/2009 I priedą. Daugiau informacijos: litgrid.eu', 'https://data.gov.lt/datasets/2581/'),
