(431, 4, 'Lietuvos Respublikos Seime vykusių renginių transliacijų YouTube duomenys', '2024-04-15', '2024-04-16', 'Rinkinyje pateikiami duomenys apie Seime vykdytas YouTube transliacijas iš komitetų posėdžių, konferencijų, spaudos konferencijų, kongresų, diskusijų ir pan. Taip pat pateikiama informacija apie transliacijos pradžios ir pabaigos  laiko žymas.\r\n\r\nDėl techninių klausimų ar galimų klaidų kreiptis į atverimas@stat.gov.lt.', 'https://data.gov.lt/datasets/2614/'),
(432, 4, 'Teisės aktų registro duomenys', '2024-04-15', '2024-04-16', 'Rinkinyje pateikiami duomenys apie teisės aktų registro objektus, juos parengusius ir priėmusius subjektus, identifikacinius kodus, objektų rūšis, pavadinimus ir jų chronologijas (teisės akto priėmimo data, registravimo Registre data, paskelbimo data, įsigaliojimo data, pakeitimo ar papildymo data, pripažinimo netekusiu galios data, galiojimo sustabdymo data, galiojimo terminas). Registro objektai yra šie teisės aktai:\r\n1) Lietuvos Respublikos Konstitucija;\r\n2) konstituciniai įstatymai;\r\n3) kiti įstatymai;\r\n4) Lietuvos Respublikos Seimo statutas;\r\n5) Lietuvos Respublikos Seimo (toliau – Seimas) nutarimai;\r\n6) kiti Seimo priimti teisės aktai;\r\n7) Lietuvos Respublikos tarptautinės sutartys;\r\n8) Respublikos Prezidento dekretai ir potvarkiai;\r\n9) Lietuvos Respublikos Vyriausybės (toliau – Vyriausybė) nutarimai, sprendimai ir rezoliucijos;\r\n10) Lietuvos Respublikos Konstitucinio Teismo (toliau – Konstitucinis Teismas) reglamentas;\r\n11) ministrų, Vyriausybės įstaigų, kitų valstybės institucijų ir įstaigų vadovų bei kolegialių institucijų norminiai teisės aktai;\r\n12) Ministro Pirmininko potvarkiai;\r\n13) Seimo Pirmininko potvarkiai;\r\n14) Seimo valdybos sprendimai;\r\n15) Lietuvos banko norminiai teisės aktai;\r\n16) savivaldybių institucijų norminiai teisės aktai, taip pat savivaldybių merų priimami teisės aktai, kuriuos skelbti Registre privaloma pagal teisės aktų reikalavimus;\r\n17) įgaliotų atlikti viešąjį administravimą asociacijų, valstybės ar savivaldybės įmonių, viešųjų įstaigų, kurių savininkė ar dalininkė yra valstybė ar savivaldybė, valdymo organų priimti norminiai teisės aktai. Kitų asociacijų, valstybės ar savivaldybės įmonių, viešųjų įstaigų, kurių savininkė ar dalininkė yra valstybė ar savivaldybė, valdymo organų priimti teisės aktai Registro objektais yra tik tais atvejais, kai šiuos teisės aktus skelbti Registre privaloma pagal teisės aktų reikalavimus;\r\n18) ministrų, Vyriausybės įstaigų, kitų valstybės ir savivaldybių institucijų ir įstaigų vadovų ir kolegialių institucijų, taip pat Lietuvos banko valdybos ar valdybos pirmininko, teisės aktų nustatyta tvarka įgaliotų atlikti viešąjį administravimą asociacijų, valstybės ar savivaldybės įmonių, viešųjų įstaigų, kurių savininkė ar dalininkė yra valstybė ar savivaldybė, valdymo organų priimti teisės taikymo aktai, kuriuos skelbti Registre privaloma pagal teisės aktų reikalavimus;\r\n19) Konstitucinio Teismo nutarimai ir sprendimai dėl Konstitucinio Teismo nutarimo išaiškinimo, taip pat Konstitucinio Teismo pirmininko pranešimai dėl ginčijamo akto galiojimo sustabdymo ir dėl sustabdyto akto galiojimo atnaujinimo;\r\n20) Lietuvos Aukščiausiojo Teismo ir Lietuvos vyriausiojo administracinio teismo sprendimai, nutartys, nutarimai, taip pat įsiteisėję administracinių teismų sprendimai dėl norminių administracinių aktų teisėtumo.\r\n\r\nDėl techninių klausimų ar galimų klaidų kreiptis į atverimas@stat.gov.lt.', 'https://data.gov.lt/datasets/2613/'),
(433, 4, 'Duomenys apie Seime vykusius renginius', '2024-04-15', '2024-04-15', 'Rinkinyje pateikiami duomenys apie Seime organizuotus renginius nuo 2015m. Pateikiama informacija: renginio pavadinimas, kalba, pradžios ir pabaigos laikas ir renginio vieta.\r\n\r\nDėl techninių klausimų ar galimų klaidų kreiptis į atverimas@stat.gov.lt.', 'https://data.gov.lt/datasets/2612/'),
(434, 4, 'Inicijuoti teisės aktų projektai', '2024-04-15', '2024-04-15', 'Rinkinyje pateikiami duomenys apie teiktus pasiūlymus teisės aktų projektams: teisės aktus ir jų atributus. Jeigu pasiūlymas buvo inicijuotas Seime, nurodyti ir jį teikusių Seimo narių vardai ir pavardės.\r\n\r\nDėl techninių klausimų ar galimų klaidų kreiptis į atverimas@stat.gov.lt.', 'https://data.gov.lt/datasets/2611/'),
(435, 4, 'Lietuvos Respublikos Seimo kadencijų ir sesijų klasifikatorius', '2024-04-15', '2024-04-15', 'Lietuvos Respublikos Seimo sesijų tvarkaraštis. Pateikiama eilinių ir neeilinių sesijų pradžia ir pabaiga bei kadencijos, kuriai priklauso sesija, id. Lietuvos Respublikos Seimo kadencijų tvarkaraštis su kadencijų pradžios ir pabaigos datomis.\r\n\r\nDėl techninių klausimų ar galimų klaidų kreiptis į atverimas@stat.gov.lt.', 'https://data.gov.lt/datasets/2610/'),
(436, 4, 'Lietuvos Respublikos Seimo interneto svetainėje paskelbtų tekstų duomenys', '2024-04-15', '2024-04-15', 'Rinkinyje pateikiami duomenys apie Seimo internetiniame puslapyje paskelbtus tekstus nuo 1999m. Lietuvių, anglų, vokiečių, prancūzų ar rusų kalbomis.\r\n\r\nDėl techninių klausimų ar galimų klaidų kreiptis į atverimas@stat.gov.lt.', 'https://data.gov.lt/datasets/2609/'),
(437, 4, 'Lietuvos Respublikos Seimo įvairialypės informacijos duomenys', '2024-04-15', '2024-04-15', 'Rinkinyje pateikiami duomenys apie Seimo archyvuose saugomus vaizdo, teksto ar garso artefaktus nuo XVI amžiaus iki šių dienų. Nurodoma artefakto vieta, kategorija, aprašymas, kalba, tema, pradžios ir pabaigos datos (jei taikoma) ir nuoroda, jei artefakto turinys prieinamas internete.\r\n\r\nDėl techninių klausimų ar galimų klaidų kreiptis į atverimas@stat.gov.lt.', 'https://data.gov.lt/datasets/2608/'),
(438, 50, 'Tvarkomos/ribojamos zonos. Telkiniai', '2024-04-11', '2024-05-03', '„Tvarkomos teritorijos, ribojamos ir reglamentuojamos zonos ir vienetai, už kuriuos atsiskaitoma“ duomenų peržiūros paslauga, kuriame pateikiama informacija apie su šia tema susijusias teritorijas Lietuvos Respublikoje.', 'https://data.gov.lt/datasets/2599/'),
(439, 51, 'VLKK terminų banko terminų duomenys', '2024-04-29', '2024-05-07', 'Valstybinės lietuvių kalbos komisijos Lietuvos Respublikos terminų banke kaupiami įvairių sričių terminai lietuvių bei kitomis Europos kalbomis, kaip vokiečių, prancūzų, lenkų. Duomenys kaupiami nuo 2005 m. ir atnaujinami kas mėnesį. Apimami duomenys yra patys terminai, jų sritys, kalba, statusas: teiktinas, neteiktinas arba aprobuotas, įvedimo data bei organizacija, pateikusi patį terminą. Tarp tokių organizacijų patenka VLKK, Užsienio reikalų ministerija, Policijos departamentas.', 'https://data.gov.lt/datasets/2636/'),
(440, 4, 'Transporto priemonių rezervacijos kirsti pasienį', '2024-04-25', '2024-04-26', 'Pasienio kontrolės punktų direkcijos (PKPD) ir VĮ „Regitra“ duomenų bendras rinkinys, sudarytas Valstybės duomenų agentūros. Duomenys kaupiami nuo 2013 m. ir atnaujinami kasdien. Duomenų rinkinyje saugomas paslaugos kirsti pasienį registracijos identifikatorius, registracijos kaina, mokestis ir kaina su mokesčiu. Taip pat yra nurodyti atvykimo į laukimo aikštelę, į pasienio kontrolės punktą laikai, punkto pavadinimas bei kaimyninė valstybė. Saugomas eilės tipas, transporto priemonės šifruotas valstybinis numeris, VIN šalis, rūšis, kategorija, ar transporto priemonė registruota Lietuvoje, šifruotas fizinio savininko arba atviras juridinio asmens kodas ir savininko pavadinimas, jei tai juridinis asmuo.', 'https://data.gov.lt/datasets/2635/'),
(441, 52, 'Paukščių hemosporidiniai parazitai', '2024-04-23', '2024-04-23', 'Publikuojama informacija apie P.B Šivickio Gamtos Tyrimų Centro mokslinių darbuotojų ištirtus ir aprašytus paukščių hemosporidinius parazitus išplitusius po visą pasaulį, išskyrus Antarktidą, kurie sukelia maliariją, haemoproteozę ir kitas ligas. Informacija pateikta remiantis Lundo universiteto  MalAvi duomenų baze, kurią galite rasti adresu http://130.235.244.92/Malavi/ .', 'https://data.gov.lt/datasets/2634/'),
(442, 52, 'Trematodai iš Centrinės ir Rytų Europos', '2024-04-23', '2024-04-23', 'Publikuojama informacija apie P.B Šivickio Gamtos Tyrimų Centro mokslinių darbuotojų laboratorijos sąlygomis  tiriamus  stuburinius parazitus-siurbikes (trematodus), paplitusius Rytų ir Centrinėje Europoje, bei jų turėtojus.', 'https://data.gov.lt/datasets/2633/'),
(443, 53, 'Nuteistųjų laisvės atėmimo bausme statistika', '2024-04-23', '2024-05-02', 'Lietuvos kalėjimų tarnyba kaupia asmenų, nuteistų laisvės \r\natėmimo bausme, statistinius duomenis nuo 2021 m., atnaujinamus kasmet, \r\ngaunamus iš kalinimo įstaigų. Rinkinys apima punkto numerį, naudojamą \r\natskirti atitinkamus duomenis pagal konkrečius metus. Punkto numeriai \r\ngali būti pateikti tiksliau naudojant daugiau skaitmenų, atskirtų \r\ntaškais. Tarp minėtų duomenų patenka nusikaltimai, išvykimo iš kalinimo \r\nįstaigos pobūdžiai, nuteistųjų amžiaus grupės. Rinkinyje minėti duomenys\r\nmatuojami vienetais nuteistųjų asmenų arba metais, mėnesiais ir \r\ndienomis. Patogumo dėlei taip pat naudojami rinkinio eilučių numeriai.', 'https://data.gov.lt/datasets/2632/');
INSERT INTO `rinkinys` (`RINKINYS_ID`, `ORGANIZACIJA_ID`, `RINKINYS_PAVADINIMAS`, `RINKINYS_IKEL_DATA`, `RINKINYS_ATNAUJ_DATA`, `RINKINYS_APRASAS`, `RINKINYS_NUORODA`) VALUES
(444, 53, 'Nuteistųjų arešto bausme statistika', '2024-04-23', '2024-05-02', 'Lietuvos kalėjimų tarnyba kaupia asmenų, nuteistų arešto \r\nbausme, statistinius duomenis nuo 2021 m., atnaujinamus kasmet, gaunamus\r\niš kalinimo įstaigų. Rinkinys apima punkto numerį, naudojamą atskirti \r\natitinkamus duomenis pagal konkrečius metus. Punkto numeriai gali būti \r\npateikti tiksliau naudojant daugiau skaitmenų, atskirtų taškais. Tarp \r\nminėtų duomenų patenka nusikaltimai, išvykimo iš kalinimo įstaigos \r\npobūdžiai, nuteistųjų amžiaus grupės. Rinkinyje minėti duomenys \r\nmatuojami vienetais nuteistųjų asmenų arba metais, mėnesiais ir \r\ndienomis. Patogumo dėlei taip pat naudojami rinkinio eilučių numeriai.', 'https://data.gov.lt/datasets/2631/'),
(445, 54, 'Savanorių paraiškų statistika pagal priimančias organizacijas', '2024-04-23', '2024-04-26', 'Jaunimo reikalų agentūros Jaunimo savanoriškos tarnybos sistema kaupia duomenis apie jaunimo savanorystę priimančiose organizacijose. Įstaiga teikia duomenis, kaupiamus nuo 2018 m. Juos atnaujinti numatyta kasdien. Duomenyse kaupiama priimančios organizacijos pavadinimas ir adresas, savanorystės paraiškos teikimo metai, priimtų, \r\natmestų įprastų paraiškų skaičiai bei jų suma, paraiškų tapti kuratoriumi bei mentoriumi skaičiai.', 'https://data.gov.lt/datasets/2630/'),
(446, 54, 'Jaunimo darbuotojų kvalifikacija', '2024-04-23', '2024-04-23', 'Jaunimo reikalų agentūros Jaunimo darbuotojų sistema kaupia duomenis apie jaunimo darbuotojus. Teikiami duomenys kaupiami nuo 2018 m., numatyta atnaujinti kasdien. Duomenyse kaupiama darbuotojo šifruotas kodas, išsirinkti kursai, tuometinis etatas, išsilavinimas ir darbovietė.', 'https://data.gov.lt/datasets/2629/'),
(447, 4, 'Nekilnojamojo turto registro butų pirkimų sandorių informacija gardelėse', '2024-04-23', '2024-04-29', 'Lentelėje pateikiami agreguoti VĮ Registrų centro Nekilnojamojo turto registro (NTR) gyvenamosios paskirties objektų (butų) pirkimų sandorių duomenys 1 km stačiakampėse gardelėse.\r\n\r\nLentelės stulpeliuose - kiekvienai gardelei apskaičiuoti sandorių verčių, įsigytų butų plotų, butų verčių, masinio (visuotinio) vertinimo verčių vidurkiai, mažiausios ir didžiausios vertės, 10 - 90 procentiliai.\r\n\r\nLaiko aprėptis - nuo 1998 m.\r\n\r\nDuomenys šiame rinkinyje apima ne visus gyvenamosios paskirties objektų (butų) pirkimų aibės sandorius, bet tik tuos sandorius, kurių metu įsigytas tik vienas objektas. Informacija apie sandorius, kurių metu buvo perkami keli objektai (pvz.: butas ir sandėliukas arba butas ir žemės sklypas) šioje lentelėje nepateikiami.\r\n\r\nGeografinė informacija (gardelės) gauta iš VĮ Registrų centro Adresų registro. Duomenys jungiami su stačiakampių 1x1 km dydžio gardelių tinklų sudarytu Lietuvos valstybinėje koordinačių sistemoje LKS-94. Stačiakampės gardelės 1 km (LKS-94) https://data.gov.lt/datasets/2047/data/Grid1KmSq/?select(_id,grid_id,x_centroid,y_centroid,sav_pav,sav_kodas,geometrija)', 'https://data.gov.lt/datasets/2559/'),
(448, 48, 'Institucijos, teikiančios informaciją Virtualiai elektroninio paveldo sistemai (VEPIS)', '2024-04-22', '2024-04-26', 'Informacija apie įstaigas, teikiančias informaciją Virtualiai elektroninio paveldo sistemai (VEPIS) - įstaigos tipas, nuoroda į svetainę, adresas.', 'https://data.gov.lt/datasets/2627/'),
(449, 48, 'Bibliotekų ir padalinių sąrašas', '2024-04-22', '2024-04-26', 'Informacija apie bibliotekas ir jų padalinius - socialinių tinklų nuoroda, nuoroda į svetainę, adresas bei bibliotekos ar padalinio požymiai (pvz. ar tai edukacinė institucija).', 'https://data.gov.lt/datasets/2626/'),
(450, 48, 'Bibliografiniai įrašai', '2024-04-22', '2024-04-26', 'Martyno Mažvydo bibliotekos LIBIS IS bibliografinių įrašų sąrašas.', 'https://data.gov.lt/datasets/2625/'),
(451, 48, 'Knygomatai', '2024-04-22', '2024-04-26', 'Martyno Mažvydo bibliotekos  LIBIS IS  administruojami knygomatai, jų adresų koordinatės.', 'https://data.gov.lt/datasets/2624/'),
(452, 55, 'Pacientams atlikti radiologiniai tyrimai', '2024-04-19', '2024-04-19', 'Vilniaus universiteto ligoninės Žalgirio klinikos „MedDream“ IS kaupia duomenis apie pacientams vykdytus radiologinius tyrimus. Taikomas vienkartinis duomenų, kurie kaupiami nuo 2013 metų, teikimas. Duomenis papildomai numatoma atnaujinti priėmus sprendimą dėl informacinės sistemos jungimo prie VšĮ Vilniaus universiteto ligoninės Santaros klinikos ir pabaigus aktyviai eksploatuoti esamą sistemą. Duomenys apima pacientų informaciją: asmens kodus, gimimo metus bei lytį, tyrimų informaciją: modalumą, studijos ir serijos aprašymus, tirtą paciento kūno dalį, fotometrinę interpretaciją, paskyrusį gydytoją, atlikusį techniką, dozę decigrėjais kvadratiniame centimetre, apšvitą arksekundėmis.', 'https://data.gov.lt/datasets/2623/'),
(453, 18, 'Asmens sveikatos priežiūros įstaigų aprūpinimo asmeninės apsaugos priemonėmis ir kitomis veiklos vykdymui užtikrinti būtinomis priemonėmis, skirtomis pasirengti ekstremaliųjų situacijų, sukeltų branduolinių ar radiologinių avarijų bei teroristinių išpuolių likvidavimui duomenų bazė', '2024-04-18', '2024-04-25', 'Sveikatos apsaugos ministerijos Ekstremalių sveikatai situacijų centras (ESSC) vykdo sveikatos priežiūros įstaigų (toliau –SPĮ) aprūpinimo asmens apsaugos priemonėmis ir kitomis veiklos vykdymui užtikrinti būtinomis priemonėmis, skirtomis pasirengti ekstremaliųjų situacijų, sukeltų branduolinių ar radiologinių avarijų bei teroristinių išpuolių likvidavimui stebėseną. \r\nDuomenys kaupiami nuo 2023 m. ir atnaujinami 1 kartą per metus (spalio pabaigoje). Duomenys apima datą, nuo kada aktualūs turimi duomenys, įstaigos ir priemonės pavadinimus, priemonės paskirtį, išduotą, panaudotą, turimą ir atstatytą priemonės kiekius bei atstatymo datą.', 'https://data.gov.lt/datasets/2619/'),
(454, 18, 'Sveikatos priežiūros įstaigų parengties ekstremaliosioms situacijoms stebėsenos duomenų bazė', '2024-04-18', '2024-04-25', 'Sveikatos apsaugos ministerijos  Ekstremalių sveikatai situacijų centras  (ESSC) koordinuoja Lietuvos nacionalinės sveikatos sistemos įstaigų pasirengimą ir veiklą ekstremaliųjų situacijų atvejais, vykdydamas asmens ir visuomenės sveikatos priežiūros įstaigų (toliau – SPĮ) pasirengimo veiklai ekstremaliųjų situacijų atvejais stebėseną ir kaupia sveikatos priežiūros įstaigų ekstremalių situacijų valdymo planų įvertinimus duomenų bazėje.\r\nDuomenys atnaujinami atnaujinami 1 kartą per metus (metų pradžioje už praėjusius metus).\r\nDuomenys apima SPĮ pavadinimą, geografinį ir cenzūruotą el. pašto adresus, apskritį, pavaldumą, vertinimų datą, tipą ir artimiausio vertinimo metus.', 'https://data.gov.lt/datasets/2618/'),
(455, 48, 'Lietuvos leidėjai', '2024-04-18', '2024-04-26', '', 'https://data.gov.lt/datasets/2617/'),
(462, 4, 'Studentų studijų pertraukimai ir nutraukimai', '2024-04-17', '2024-04-17', 'Lentelėje pateikti Nacionalinės švietimo agentūros (NŠA) studentų studijų pertraukimų / nutraukimų duomenys iš studentų registro (SR). Persidengiantys pertraukimai (pvz.: studentas pertraukė studijas 2021-09-04 - 2022-01-30 ir tuomet vėl 2022-01-31 - 2022-09-01) yra sutraukti į vieną laikotarpį. Duomenys kaupiami nuo 2010 m.', 'https://data.gov.lt/datasets/2616/'),
(463, 4, 'Pedagogų darbo krūvis', '2024-04-17', '2024-04-17', 'Lentelėje pateikti Nacionalinės Švietimo agentūros (NŠA) pedagogų (bendrojo, ikimokyklinio ugdymo mokyklų, profesinio mokymo įstaigų, neformaliojo vaikų švietimo mokyklų ir formalųjį švietimą papildančio ugdymo mokyklų, mokslo ir studijų institucijų pedagoginių darbuotojų ir/arba tyrėjų) pareigybių ir darbo krūvio duomenys iš pedagogų registro (PR). Duomenys kaupiami nuo 2010 m. Siekiant užtikrinti asmens duomenų apsaugą duomenys buvo triukšminti.', 'https://data.gov.lt/datasets/2615/'),
(464, 50, 'Mineraliniai ištekliai', '2024-05-03', '2024-05-03', '', 'https://data.gov.lt/datasets/2646/'),
(465, 50, 'Seisminio monitoringo stotys', '2024-05-03', '2024-05-03', 'INSPIRE temos „Geologija“ potemės „Geofizika“ duomenų rinkinys, kuriame pateikiami Lietuvos Respublikos teritorijos geofizikiniai duomenys.', 'https://data.gov.lt/datasets/2645/'),
(466, 56, 'Maudyklų vandens kokybės duomenys', '2024-05-03', '2024-05-03', 'Stebimų Lietuvos maudyklų sąrašas, pateikiama informacija apie:  maudymosi sezono metus, maudyklos identifikavimo unikalų kodą, maudymosi sezono pradžią ir pabaigą, vandens kokybės klasę, nuorodos į maudyklos charakteristikų aprašus,\r\nmaudyklos stebėjimo vietos koordinates, mėginio ėmimo datą, parametrų: žarninių enterokokų ir  žarninių lazdelių vertes.', 'https://data.gov.lt/datasets/2644/'),
(467, 50, 'Lietuvos prekvartero geologinis žemėlapis M 1:200 000', '2024-05-03', '2024-05-03', '1999 m. revizuotame Lietuvos prekvatero geologiniame žemėlapyje M 1:200 000 vaizduojamos prekvartero uolienų paplitimo pokvartero paviršiuje geologinės ribos, nuosėdinę dangą kertantys lūžiai ir šio žemėlapio pagrindu sudarytų geologinių pjūvių linijos.', 'https://data.gov.lt/datasets/2643/'),
(468, 50, 'Lietuvos kvartero geologinis žemėlapis M 1:200 000', '2024-05-03', '2024-05-03', 'Kvartero geologinis žemėlapis rodo teritorijos paviršių sudarančių nuogulų litologinę (medžiaginę) sudėtį, genezę (kilmę) ir amžių. Spalva žemėlapyje rodo nuogulų kilmę, o spalvos tamsumu atspindėtas nuogulų amžius (kuo spalva tamsesnė, tuo nuogulos senesnės). Amžių papildomai rodo ir ryškios raudonos linijos, žyminčios: maksimalų paskutiniojo –Nemuno – ledyno išplitimą, šio ledyno Baltijos stadijos pakraštį ir Baltijos stadijos ledyno Pietų, Vidurio ir Šiaurės Lietuvos fazių ribas. Nuogulų litologinė sudėtis pažymėta taškiniais ir brūkšniniais arba kitokiais simboliais. Lietuvos kvartero geologinis žemėlapis apima visą Lietuvos teritoriją.', 'https://data.gov.lt/datasets/2642/'),
(469, 50, 'Karstinio rajono ribos M1:50 000', '2024-05-03', '2024-05-03', 'Lietuvos karstinių regionų ribų žemėlapis M 1:50 000 rodo karstinio ir karstinio sufozinio proceso išplitimo ribas Lietuvos teritorijoje. Karstinis procesas Lietuvoje susijęs su gipso tirpinimu ir išnešimu. Šio proceso metu žemės gelmėse formuojasi tuštumos, o paviršiuje gali susiformuoti paviršinės karstinės formos – smegduobės, įlinkiai, įgriuvos ir kt. Žemėlapis sudarytas analizuojant ir nustatant karstinių reljefo formų paplitimą ir atsižvelgiant į turimą geologinę informaciją (karstėjančių uolienų buvimą, gipso storius, gipsą dengiančių uolienų storius ir kt.).', 'https://data.gov.lt/datasets/2641/'),
(470, 50, 'Požeminio vandens baseinai', '2024-05-03', '2024-05-03', 'Informacija apie Lietuvos požeminio vandens baseinus ir pabaseinius, baseinų/pabaseinių kiekybinę ir kokybinę išteklių būklę ir kiekį.', 'https://data.gov.lt/datasets/2640/'),
(471, 50, 'Saugomos geriamojo vandens teritorijos', '2024-05-03', '2024-05-03', 'Geriamojo vandens apsaugos zonos, tiekimo teritorijos, apsaugos teritorijos', 'https://data.gov.lt/datasets/2639/'),
(472, 52, 'Dirvožemio temperatūra ir drėgmė bei dirvožemyje augantys augalai', '2024-05-03', '2024-05-06', 'Publikuojama informacija apie P.B Šivickio Gamtos Tyrimų Centro mokslinių darbuotojų tiriamą dirvožemio temperatūrą ir drėgmę natūraliose arba pusiau natūraliose pievų bendrijose Lietuvos teritorijoje nuo 2018 metų. Tokie duomenys leidžia tiksliau įvertinti klimato kaitą ir kaitos padarinius augalų bendrijoms lyginant su tradiciniais meteorologinių stotelių kaupiamais duomenimis. Dirvožemio drėgmė apskaičiuojama remiantis informacija pateikta adresu https://tomst.com/web/en/systems/tms/software/  bei esančia skyrelyje  „TMS Calibr utility“.', 'https://data.gov.lt/datasets/2638/'),
(473, 50, 'Hidrogeologinis žemėlapis M1:200 000', '2024-05-03', '2024-05-03', '', 'https://data.gov.lt/datasets/2637/'),
(474, 57, 'Juridinių asmenų dujų suvartojimas', '2024-05-13', '2024-05-13', 'Rinkinyje pateikti Energijos skirstymo operatoriaus (ESO) juridinių asmenų dujų suvartojimo duomenys. Adresai pateikiami 10 kilometrų dydžio stačiakampėmis gardelėmis Lietuvos koordinačių sistemoje (LKS-94). Gardelės, kuriose yra 5 arba mažiau vartotojų nerodomos. Duomenų laiko aprėptis - nuo 2019 m. sausio 1d.', 'https://data.gov.lt/datasets/2621/'),
(475, 57, 'Fizinių asmenų dujų suvartojimas', '2024-05-13', '2024-05-13', 'Rinkinyje pateikti Energijos skirstymo operatoriaus (ESO) fizinių asmenų dujų suvartojimo duomenys. Adresai pateikiami 1 kilometro dydžio stačiakampėmis gardelėmis Lietuvos koordinačių sistemoje (LKS-94). Gardelės, kuriose yra 5 arba mažiau vartotojų nerodomos. Duomenų laiko aprėptis - nuo 2019 m. sausio 1d.', 'https://data.gov.lt/datasets/2622/');
